INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (11, 1082900, 'Elskling', 'Drame', 'Art et Essai', 'Maria, 40 ans, jongle entre ses quatre enfants et une carrière exigeante tandis que son second mari, Sigmund, voyage de plus en plus pour son travail. Un soir, ils se disputent violemment et Sigmund finit par annoncer qu''il veut divorcer.', '2025-06-18 00:00:00', 101, 0, 'NO', 'https://image.tmdb.org/t/p/w500/4DHpXjhMwfwpaldge4OcISjQTX7.jpg', '', NULL, 'Helga Guren, Oddgeir Thune, Heidi Gjermundsen, Maja Tothammer-Hruza', NULL, '1', 11, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (9, 1180629, 'Kneecap', 'Musique', 'Art et Essai', 'La rencontre du prof de Belfast JJ avec les deux minables Naoise et Liam Og fait naître un groupe de hip-hop inusité. Rappant en irlandais, le groupe Kneecap devient le porte-voix d’un mouvement pour la sauvegarde de sa langue maternelle. Dans ce biopic original et délirant, les membres de Kneecap incarnent leur propre rôle en livrant un vibrant cri du cœur pour la défense des cultures indigènes.', '2025-06-18 00:00:00', 105, 0, 'IE', 'https://image.tmdb.org/t/p/w500/ijTk2EQNMfoxV7jXpvE8sv2IiWF.jpg', '', NULL, 'Móglaí Bap, Mo Chara, DJ Próvaí, Josie Walker', NULL, '1', 9, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (8, 1245728, 'Peacock', 'Drame', 'Art et Essai', 'Besoin d’un petit ami cultivé pour impressionner votre entourage ? D’un fils parfait pour forcer l’admiration de vos clients ? D’un répétiteur pour vous préparer à une dispute conjugale ? Louez Matthias, un maître dans sa profession, excellant chaque jour à se faire passer pour une personne différente ! Mais quand Matthias doit ...', '2025-06-18 00:00:00', 102, 0, 'AT', 'https://image.tmdb.org/t/p/w500/x7xxweY5wj9o28PFyiGowlVUYcc.jpg', NULL, NULL, 'Albrecht Schuch, Julia Franz Richter, Anton Noori, Theresa Frostad Eggesbø', NULL, '1', 8, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (3, 1389410, 'Sur la route de papa', 'Comédie', 'Grand Public', 'Prêt à partir en vacances, Kamel se retrouve obligé de changer ses plans à la  dernière minute pour prendre la route du Bled avec sa mère. À bord de la vieille Renault 21, Kamel et sa famille entament un long périple jusqu’au Maroc. Sur la route de son passé, les souvenirs et les rancœurs refont surface, révélant toute la beauté des liens qui les unissent.', '2025-06-18 00:00:00', 91, 0, 'FR', 'https://image.tmdb.org/t/p/w500/jEA7cPodA2ef5BG6HMZ6syM09Vv.jpg', NULL, NULL, 'Redouane Bougheraba, Caroline Anglade, Farida Ouchani, Anouar Akerrouach', NULL, '1', 3, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (2, 1444665, 'Maya, donne-moi un autre titre', 'Animation', 'Jeunesse', 'Après, Maya donne-moi un titre, la suite des aventures de Maya racontées par Blanche Gardin. Maya et son papa vivent dans deux pays différents. Pour maintenir le lien avec sa fille et continuer à lui raconter des histoires, son papa lui demande chaque mois « Maya, donne-moi un titre ». À partir de ce titre, il lui fabrique un dessin animé dont elle est l’héroïne. Michel Gondry donne alors vie à un voyage poétique et amusant qui fera rêver les petits...et sourire les grands.', '2025-06-18 00:00:00', 63, 0, 'FR', 'https://image.tmdb.org/t/p/w500/eU13lnD53Mt5dUa7l8UiqteV0ef.jpg', '', NULL, 'Blanche Gardin', NULL, '1', 2, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (4, 1352310, 'Avignon', 'Comédie', 'Grand Public', 'Comédien en perte de vitesse, Stéphane débarque avec sa troupe au Festival d’Avignon pour jouer une pièce de boulevard. Il y recroise Fanny, une comédienne de renom, et tombe sous son charme. Profitant d’un quiproquo pour se rapprocher d’elle, Stéphane s’enfonce dans un mensonge qu’il va devoir faire durer le temps du festival…mais qui va très vite le dépasser !', '2025-06-18 00:00:00', 102, 0, 'FR', 'https://image.tmdb.org/t/p/w500/zutAtHd8ZR8LI9nQqmWhzaAuLsS.jpg', NULL, NULL, 'Baptiste Lecaplain, Elisa Erka, Romain Francisco, Amaury de Crayencour', NULL, '1', 4, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (5, 1301059, 'Tom le chat - À la recherche du doudou perdu', 'Animation', 'Jeunesse', 'Tom est un petit chat roux malicieux. Curieux, joyeux… mais aussi un peu têtu.  Quand il perd son doudou préféré, celui avec lequel il dort chaque nuit depuis qu’il est petit, c’est la catastrophe. Pas question de rester les pattes croisées : il faut le retrouver !  Heureusement, Tom peut toujours compter sur Chat-Souris, sa meilleure amie, pour le suivre dans ses aventures. C’est donc parti pour une folle expédition : il n’y a pas un endroit qu’ils n’inspecteront pas ! Mais… où est donc passé ce doudou ?!', '2025-06-18 00:00:00', 62, 0, 'BE', 'https://image.tmdb.org/t/p/w500/i22QuxCiTrBE1DdBcsQFkiVDFRf.jpg', NULL, NULL, 'Burny Bos', NULL, '1', 5, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (6, 1277872, 'Enzo', 'Drame', 'Art et Essai', 'Enzo, 16 ans, est apprenti maçon à La Ciotat. Pressé par son père qui le voyait faire des études supérieures, le jeune homme cherche à échapper au cadre confortable mais étouffant de la villa familiale. C’est sur les chantiers, au contact de Vlad, un collègue ukrainien, qu’Enzo va entrevoir un nouvel horizon.', '2025-06-18 00:00:00', 102, 0, 'FR', 'https://image.tmdb.org/t/p/w500/3nLA0gNlnJzCocv8nwKecT7zgWK.jpg', '', NULL, 'Eloy Pohu, Pierfrancesco Favino, Élodie Bouchez, Maksym Slivinskyi', NULL, '1', 6, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (7, 1271979, 'La Tournée', 'Comédie', 'Grand Public', 'Acculé par les dettes après une longue traversée du désert, l''acteur Marius de Villeduc se voit contraint d''accepter le rôle principal du nouveau film de Richard Favard, un acteur-réalisateur prometteur mais dont il ne connait rien. Seulement, pour toucher l''intégralité de son cachet une obligation : participer à la tournée d''avant-premières ! Aux côtés de Richard, Colette et Lulu, Marius se lance alors bien malgré lui sur les routes de France dans un road-movie chaotique et haut en couleur.', '2025-06-18 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/2P2NnoE8DnznSKC573Auy9H44Lg.jpg', NULL, NULL, 'Patrick Chesnais, Richard Berry, Martin Lamotte, Thierry Lhermitte', NULL, '1', 7, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (61, 541671, 'Ballerina', 'Action', 'Grand Public', 'Durant les événements de John Wick : Parabellum, Eve Macarro, une danseuse de ballet initiée aux traditions d''assassin des Ruska Roma, entreprend de se venger de ceux qui sont responsables de la mort de son père. Son action l''amènera à affronter le Chancelier et sa secte, une organisation qui ne respecte pas les règles des assassins.', '2025-06-04 00:00:00', 125, 90000000, 'US', 'https://image.tmdb.org/t/p/w500/e7zUVzux574daVsOlbcvmqEieyn.jpg', NULL, NULL, 'Ana de Armas, Anjelica Huston, Keanu Reeves, Norman Reedus', NULL, '1', 58, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (14, 799064, 'Havana Libré', 'Documentaire', 'Documentaire', 'Après des années d''illégalité du surf, un groupe d''irréductibles surfeurs cubains se bat pour légitimer leur passion. Havana Libre retrace leur combat face à l''oppression politique, en affrontant les frontières et les idéologies dépassées. frontières et des idéologies dépassées.', '2025-06-18 00:00:00', 82, 0, 'US', 'https://image.tmdb.org/t/p/w500/oynItxivTYT53IuFxbcb7RYXNhJ.jpg', '', NULL, '', NULL, '1', 14, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (234, 1459540, 'Last Tape', '', 'Art et Essai', '', '2025-10-31 00:00:00', 0, 0, 'US', '', NULL, NULL, '', NULL, NULL, 229, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (12, 1022787, 'Elio', 'Familial', 'Jeunesse', 'Elio, un petit garçon à l''imagination débordante, qui se retrouve téléporté par inadvertance dans le Communivers, une organisation interplanétaire composée de représentants des galaxies les plus éloignées. Alors que tout l''univers le considère par erreur comme le chef de la Terre, Elio, loin d''être préparé à ce genre de pression, va devoir tisser de nouveaux liens avec d''étranges formes de vie extraterrestres, survivre à une série d''épreuves redoutables, pour finir par découvrir qui il est véritablement.', '2025-06-18 00:00:00', 99, 150000000, 'US', 'https://image.tmdb.org/t/p/w500/jaKbruwD7KLlnprsse1zuOm4o2a.jpg', NULL, NULL, 'Yonas Kibreab, Zoe Saldaña, Remy Edgerly, Brandon Moon', NULL, '1', 12, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (60, 1025491, 'Freud, la dernière confession', 'Drame', 'Grand Public', 'A la veille de la Seconde Guerre mondiale, Sigmund Freud s''est réfugié à Londres, en compagnie de sa fille Anna. Sous l''effet de l''âge et de la maladie, la star mondiale de la psychanalyse s''est changée en un vieillard aigri et capricieux. Mais la curiosité du professeur est piquée au vif lorsqu''un certain C.S Lewis, auteur de romans pour la jeunesse, demande à le rencontrer pour débattre de l''existence de Dieu.', '2025-06-04 00:00:00', 110, 10000000, 'US', 'https://image.tmdb.org/t/p/w500/uxh8U2n23QsEpgtwluJb3jHAu1o.jpg', NULL, NULL, 'Anthony Hopkins, Matthew Goode, Liv Lisa Fries, Jodi Balfour', NULL, '1', 57, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (32, 1461911, 'Indomptables', 'Crime', 'Grand Public', 'À Yaoundé, le commissaire Billong enquête sur le meurtre d''un officier de police. Dans la rue comme au sein de sa famille, il peine à maintenir l’ordre. Homme de principe et de tradition, il approche du point de rupture.', '2025-06-11 00:00:00', 81, 0, 'FR', 'https://image.tmdb.org/t/p/w500/c1DgUjAiLztaqf0xlq80CGnNDL9.jpg', NULL, NULL, 'Thomas Ngijol, Danilo Melande, Bienvenu Roland Mvoe, Thérèse Ngono', NULL, '1', 31, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (33, 1458226, 'Le retour du Gendarme de Abobo', 'Comédie', 'Grand Public', 'Le gendarme Gokou a été décoré par le Président pour avoir déjoué un complot terroriste à Abobo. Mais le jour où il est nommé pour mener une équipe de Gendarmes Ivoiriens face à d’autres équipes de gendarmerie Africaines, ses compétences sont mises à l’épreuve.  Dans le cadre de cette compétition internationale, son partenaire est à nouveau le Lieutenant Leblanc, gendarme français spécialisé dans la lutte antiterroriste, et fils illégitime du Président de la République Française.  Leur seul point en commun : ils doivent sauver la Côte d’Ivoire et prouver une fois de plus qu’ils sont deux super gendarmes.', '2025-06-11 00:00:00', 120, 0, 'FR', 'https://image.tmdb.org/t/p/w500/hfoZVg1U0ZWbBLOIjFuMvcP6PkD.jpg', NULL, NULL, 'Michel Gohou, Ray Reboul, Fingon Tralala, Oyou', NULL, '1', 32, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (47, 10310, 'Les Larmes amères de Petra von Kant', 'Drame', 'Art et Essai', 'Une femme de la grande bourgeoisie, créatrice de mode, vit une passion douloureuse avec une jeune femme de condition plus modeste, Karin, qui rêve de devenir mannequin.', '2025-06-11 00:00:00', 124, 0, 'DE', 'https://image.tmdb.org/t/p/w500/9q8v6Ivl18otklVn3oAhMmmeLCB.jpg', NULL, NULL, 'Margit Carstensen, Hanna Schygulla, Katrin Schaake, Eva Mattes', NULL, '1', 45, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (16, 1474528, 'Flash Drive', 'Action', 'Grand Public', 'Alors qu''il est en train de démêler une affaire avec un des membres d''un des Cartels les plus puissants d''Amérique du Sud, Brad Cole est envoyé en mission sur Paris par l''Agent Pit pour récupérer une clé USB contenant des informations confidentielles qui pourraient compromettre le bon fonctionnement des relations internationales entre les USA et le reste du monde. La taupe qui s''appelle Anthony et qui a volé la clé est localisée. La mission est alors fort simple : il a 24h pour retrouver la taupe et récupérer la clé.', '2025-06-25 00:00:00', 0, 0, 'CD', 'https://image.tmdb.org/t/p/w500/aq4kBNhVDWbMSUDjjlHBofxPMJP.jpg', NULL, NULL, 'Manon Crépel, Arnaud Toussaint, Jean-Claude Dreyfus, Raphaël Quenard', NULL, NULL, 16, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (17, 1378404, 'Ange', 'Drame', 'Grand Public', 'Ange, voyageur solitaire et ethnologue de profession, doit pour rembourser sa dette, mettre le cap sur les bords de la Méditerranée. Alors qu’il a pris les routes au volant de son vieux van telle n’est pas sa surprise quand il retrouve cachée dans le coffre sa fille de 17 ans dont il vient à peine d’apprendre l’existence.', '2025-06-25 00:00:00', 97, 0, 'FR', 'https://image.tmdb.org/t/p/w500/l6Zanm91CgMBYXbCpGzgZqK7MQs.jpg', NULL, NULL, 'Arthur H., Suzanne Aubert, Mathieu Amalric, Maria de Medeiros', NULL, 'https://www.youtube.com/watch?v=WYkGnBdUcbU', 17, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (19, 1309735, 'Il était une fois à Gaza', 'Drame', 'Art et Essai', 'Il était une fois, à Gaza en 2007. Yahya, étudiant rêveur, se lie d’amitié avec Osama, dealer charismatique au grand cœur. Ensemble, ils montent un trafic de drogue, caché dans leur modeste échoppe de falafels. Mais ils croisent le chemin d’un flic corrompu venu contrarier leur plan.', '2025-06-25 00:00:00', 87, 0, 'FR', 'https://image.tmdb.org/t/p/w500/dt6RMOFkMVixfLxFphpxILkKGD7.jpg', NULL, NULL, 'Nader Abd Alhay, Majd Eid, Ramzi Maqdisi, Is''haq Elias', NULL, NULL, 19, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (20, 1255783, 'Le Grand Déplacement', 'Comédie', 'Grand Public', 'Dans le plus grand des secrets, se prépare à décoller la première mission spatiale africaine ! L’équipage, issu du continent et de sa diaspora, doit explorer la planète « NARDAL », afin d’évaluer la possibilité d’y ramener tous les Africains si jamais la Terre devenait inhabitable. Le problème c’est que le voyage sera long. Très long. Et que la plus grande inconnue des missions interstellaires demeure l’entente entre les astronautes…', '2025-06-25 00:00:00', 83, 0, 'FR', 'https://image.tmdb.org/t/p/w500/rkc0MM36br8oyh6QoqzhvKYHPFv.jpg', NULL, NULL, 'Jean-Pascal Zadi, Reda Kateb, Fary Lopes, Djimo', NULL, 'https://www.youtube.com/watch?v=ujsjr1Fu8Ec', 20, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (21, 1171153, 'Au rythme de Vera', 'Drame', 'Art et Essai', 'L''histoire vraie de Vera Brandes, qui, en 1975 et à l''âge de 17 ans, a mis en scène le célèbre concert de Köln du musicien de jazz Keith Jarrett, qui est devenu l''album solo de jazz le plus vendu de tous les temps.', '2025-06-25 00:00:00', 116, 2500000, 'DE', 'https://image.tmdb.org/t/p/w500/3jIl3V6Ur5VAm8jsi7o8jM9JIrY.jpg', NULL, NULL, 'Mala Emde, John Magaro, Michael Chernus, Jördis Triebel', NULL, 'https://www.youtube.com/watch?v=j83Ps9SmpF8', 21, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (22, 1071585, 'M3GAN 2.0', 'Action', 'Grand Public', 'Deux ans ont passé depuis la destruction de M3GAN, le prototype à la pointe de l’intelligence artificielle devenu incontrôlable lors d’un carnage aussi sanglant qu’impeccablement chorégraphié. Sa créatrice Gemma aujourd’hui auteure de renom milite pour l’encadrement drastique des I.A. par le gouvernement, alors que Cady, sa nièce de 14 ans entre dans l’adolescence et se rebelle contre les règles trop strictes de sa tante. Cependant, à l’insu de tous, la technique de pointe mise au point pour M3GAN a été volée et détournée pour créer une arme militaire connue sous le nom d''AM3LIA.', '2025-06-25 00:00:00', 120, 36000000, 'US', 'https://image.tmdb.org/t/p/w500/jRbw7bt9ftolX0GNcCvJdoHKdUq.jpg', NULL, NULL, 'Allison Williams, Violet McGraw, Amie Donald, Jenna Davis', NULL, 'https://www.youtube.com/watch?v=I0VWWnMUjFU', 22, NULL, '2025-06-27 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (35, 1284505, 'Vacances forcées', 'Comédie', 'Grand Public', 'Suite à une erreur de réservation, deux familles que tout oppose, ainsi qu’un éditeur un peu snob et l’influenceuse qu’il souhaite publier, sont contraints de partager une sublime maison de vacances. Le choc des cultures est immédiat, entre habitudes incompatibles et personnalités bien affirmées. Pourtant, malgré les tensions et les quiproquos, ces vacances forcées prennent une tournure inattendue et se révèlent une aventure pleine de surprises et d’éclats de rire.', '2025-06-11 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/rxU0b5zCS0HL7updpQiypQL3uBU.jpg', NULL, NULL, 'Clovis Cornillac, Aure Atika, Bertrand Usclat, Pauline Clément', NULL, '1', 34, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (55, 1265716, 'Horizonte', 'Drame', 'Art et Essai', 'Séparés pendant des années en raison d’un conflit armé, Basilio et sa mère se retrouvent enfin et se mettent en quête du père disparu. Mais tous deux sont désormais morts. Cherchant à expier ses crimes passés, commis à l’époque où il était un criminel de guerre, Basilio va tenter d’obtenir le difficile pardon de ses victimes. Mais aussi celui de sa propre mère…', '2025-06-04 00:00:00', 125, 0, 'CL', 'https://image.tmdb.org/t/p/w500/rsR4y3MjcuRTx8OY5hfGCWzMRka.jpg', NULL, NULL, 'Claudio Cataño, Paulina García, Carlos Mario Echeverry, Victoria Hernández', NULL, '1', 52, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (57, 1241435, 'Sauve qui peut', 'Documentaire', 'Documentaire', 'À l’hôpital, soignants et soignantes interrogent leur pratique lors d’ateliers de simulation avec des comédiens. Pour annoncer un cancer ou accompagner ses proches, l’empathie avec le patient se travaille. Mais l’idéal relationnel prôné en formation est-il applicable dans un système hospitalier de plus en plus à bout de force ? Peu à peu, la simulation devient un exutoire aux malaises qui rongent l’institution…', '2025-06-04 00:00:00', 98, 0, 'BE', 'https://image.tmdb.org/t/p/w500/rH90v61jqcP8CBZ2Mm6pfWvijAa.jpg', NULL, NULL, '', NULL, '1', 54, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (58, 1158616, 'Le Répondeur', 'Comédie', 'Grand Public', 'Baptiste, un imitateur de talent, ne parvient pas à vivre de son art. Un jour, il est approché par Pierre Chozène, un romancier célèbre mais discret, dérangé par les importuns, les solliciteurs, les mondains, les fâcheux. Pierre a besoin de calme pour terminer son texte le plus ambitieux, le plus intime. Il propose alors à Baptiste de devenir sa voix au téléphone, et c''est ainsi que Baptiste devient son répondeur, à leurs risques et périls.', '2025-06-04 00:00:00', 102, 0, 'FR', 'https://image.tmdb.org/t/p/w500/sYkX6APNjnrcVv0v4ROWvoiDly9.jpg', NULL, NULL, 'Salif Cissé, Denis Podalydès, Aure Atika, Clara Bretheau', NULL, '1', 55, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (59, 1157128, 'Fragments d''un parcours amoureux', 'Documentaire', 'Documentaire', 'Depuis ses 16 ans, entre Paris et Rome, Chloé a filmé ses amours. Coup de cœur adolescent, relation à distance, passion charnelle... alors qu’elle vivait une histoire, elle en fabriquait déjà le souvenir. Mais de quoi se souviennent ces ex ? Quelle est leur version des faits ? Douze d’entre eux se livrent pour reconstituer un parcours sentimental aussi singulier qu’universel.', '2025-06-04 00:00:00', 95, 0, 'IT', 'https://image.tmdb.org/t/p/w500/4N4TUARGeNaAchOy7AXHadluOge.jpg', NULL, NULL, 'Jeanne Rosa, Rebecca Zlotowski, Anne Berest, Jean-Philippe Raiche Ludger Beaulieu', NULL, '1', 56, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (56, 1244244, 'Cloud', 'Drame', 'Art et Essai', 'Ryosuke plaque tout pour vivre de la revente en ligne. Mais bientôt, certains clients menaçants resserrent l’étau autour de lui sans qu’il en comprenne les raisons. Son rêve d’indépendance vole en éclats. Dans un Japon hyperconnecté, fuir est impossible. Surtout quand on ignore les règles du jeu.', '2025-06-04 00:00:00', 123, 0, 'JP', 'https://image.tmdb.org/t/p/w500/kznamwpZYXUGQGqdFW2N5jhJPc5.jpg', NULL, NULL, 'Masaki Suda, Kotone Furukawa, Daiken Okudaira, Amane Okayama', NULL, '1', 53, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (10, 1100988, '28 Ans plus tard', 'Horreur', 'Grand Public', 'Cela fait près de trente ans que le Virus de la Fureur s’est échappé d’un laboratoire d’armement biologique. Alors qu’un confinement très strict a été mis en place, certains ont trouvé le moyen de survivre parmi les personnes infectées. C’est ainsi qu’une communauté de rescapés s’est réfugiée sur une petite île seulement reliée au continent par une route, placée sous haute protection. Lorsque l’un des habitants de l’île est envoyé en mission sur le continent, il découvre que non seulement les infectés ont muté, mais que d’autres survivants aussi, dans un contexte à la fois mystérieux et terrifiant…', '2025-06-18 00:00:00', 115, 60000000, 'GB', 'https://image.tmdb.org/t/p/w500/ArbxzDzkJluaZ3h348dE4XhcdCD.jpg', '', NULL, 'Jodie Comer, Aaron Taylor-Johnson, Jack O''Connell, Alfie Williams', NULL, '1', 10, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (30, 757725, 'Shadow Force', 'Action', 'Grand Public', 'Kyrah et Isaac étaient les chefs d''une unité spéciale internationale nommée Shadow Force. Brisant les règles, ils tombent amoureux et, pour protéger leur fils, ils disparaissent dans la clandestinité. Avec une récompense énorme pour leur capture et la Shadow Force vengeresse à leurs trousses, leur lutte familiale se transforme en une guerre sans merci.', '2025-06-12 00:00:00', 103, 60000000, 'US', 'https://image.tmdb.org/t/p/w500/7feqUkd4nImNJrDadxKmD3NtLHh.jpg', NULL, NULL, 'Kerry Washington, Omar Sy, Jahleel Kamara, Mark Strong', NULL, '1', 29, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (31, 1485560, 'Director''s cut', 'Horreur', 'Art et Essai', '', '2025-06-11 00:00:00', 61, 0, 'US', 'https://image.tmdb.org/t/p/w500/5L4wx24fdAYRmaOxgH72FOLY12g.jpg', NULL, NULL, 'Victor Tanghe, Bérénice Yahou, Ema Presle, Clara Spreafico', NULL, '1', 30, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (27, 682012, 'Amélie et la métaphysique des tubes', 'Animation', 'Jeunesse', 'Amélie est une petite fille belge née au Japon. Grâce à son amie Nishio-san, le monde n’est qu’aventures et découvertes. Mais le jour de ses trois ans, un événement change le cours de sa vie. Car à cet âge-là pour Amélie tout se joue : le bonheur comme la tragédie.', '2025-06-25 00:00:00', 77, 0, 'FR', 'https://image.tmdb.org/t/p/w500/5hOW0E9llZy2rfgom0UrO1OLaCC.jpg', NULL, NULL, 'Loïse Charpentier, Victoria Grobois, Yumi Fujimori, Cathy Cerda', NULL, 'https://www.youtube.com/watch?v=nvHxZhO9IKA', 27, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (1, 1293308, 'Dakar Chronicles', 'Documentaire', 'Documentaire', 'Depuis 45 ans, le Rallye Dakar teste les limites de la résilience et de l''habileté humaines, s''imposant comme la course la plus difficile du sport automobile. S''étendant sur plus de 9 000 kilomètres et 14 jours d''efforts acharnés, plus de 1 000 concurrents venus de plus de 60 pays s''élancent à travers des déserts inexplorés, se battant pour une place dans l''héritage légendaire du Dakar. Grâce à un accès exclusif inédit, ce film lève le voile sur l''une des courses de rallye les plus mystérieuses de l''histoire, permettant au public d''accéder aux vérités les plus profondes de ces casse-cous apparemment invincibles.', '2025-06-19 00:00:00', 85, 0, 'FR', 'https://image.tmdb.org/t/p/w500/cFAlsrXQtPNybBpuhPGDwPVtoQz.jpg', NULL, NULL, 'Sébastien Loeb, Mason Klein, Stéphane Peterhansel, Nasser Al-Attiyah', NULL, '1', 1, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (37, 1275248, 'Sister Midnight', 'Comédie', 'Art et Essai', 'Uma débarque à Mumbai après un mariage arrangé. Dans son taudis, elle découvre la réalité de la vie conjugale avec un mari lâche et égoïste. Refusant de céder à l’enfer de son couple, Uma laisse libre cours à ses pulsions et, la nuit venue, se transforme en une figure monstrueuse et inquiétante…', '2025-06-11 00:00:00', 110, 0, 'GB', 'https://image.tmdb.org/t/p/w500/78zyteidOTylo9kzkFQ6EqVNCYw.jpg', NULL, NULL, 'Radhika Apte, Ashok Pathak, Chhaya Kadam, Smita Tambe', NULL, '1', 36, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (29, 1400817, 'Mort sur terre battue', 'Crime', 'Art et Essai', 'A l’approche d’un prestigieux tournoi sur terre battue, le corps sans vie de Manon Picard est découvert sur le court. Qui pouvait bien en vouloir à cette jeune espoir du tennis ? Le lucratif contrat avec un équipementier sportif que la future gagnante devait signer pourrait constituer un excellent mobile.  L''enquête est confiée au capitaine Romain Fabiot, un passionné de tennis, Il est accompagné dans son enquête par la lieutenant Camille Lauristan, une jeune policière légèrement mutique mais extrêmement efficace. Au cours de leurs investigations, ils collaborent avec Vincent Beti, un ancien joueur et désormais directeur du tournoi, aussi charismatique que trouble.', '2025-06-14 00:00:00', 90, 0, 'FR', 'https://image.tmdb.org/t/p/w500/sa6QnVRRAaOYijI15xB4gi2VSPw.jpg', NULL, NULL, 'Florent Peyre, Yannick Noah, Roxanne Roux, Célia Lebrument', NULL, '1', 28, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (38, 1241414, 'Les Mots Qu''elles Eurent Un Jour', 'Documentaire', 'Documentaire', '1962, à la fin de la Guerre d’Algérie, des militantes de l’indépendance algérienne sortent de la prison de Rennes. Une nuit durant, le cinéaste Yann Le Masson les filme. Elles lui racontent leur vision pour l’avenir de l’Algérie et la place que la femme doit occuper dans la nouvelle société à construire. Cinquante ans plus tard, alors que la bande son a disparu, Raphaël Pillosio pars à la recherche de ces femmes.Deux personnes sourdes s’attellent à lire sur les lèvres des femmes filmées par Yann Le Masson, et nous dévoilent des bribes de phrases, des propos amputés par les revirements de la caméra. Un film-enquête où les quelques militantes encore en vie découvrent leurs anciens témoignages et nous racontent leur histoire silencieuse. La reconstitution de la bande son perdue restera en suspens, nul happy end ne viendra résorber l’absence, annuler l’opération féroce du temps. Un film-essai sur le cinéma qui figure leur disparition, et pour toujours, les garde vivantes.', '2025-06-11 00:00:00', 84, 0, 'FR', 'https://image.tmdb.org/t/p/w500/zr6oQmDNEgLr2iJddkqiNaRpnyH.jpg', NULL, NULL, '', NULL, '1', 37, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (39, 1220447, 'D’ Abdul À Leila', 'Documentaire', 'Documentaire', '', '2025-06-11 00:00:00', 92, 200, 'BE', 'https://image.tmdb.org/t/p/w500/yZrOVRshClFgFPgcP6WZE3hjFcH.jpg', NULL, NULL, 'Leila Al Bayaty, Abdul Ilah Albayaty, Simone Albayaty, Dalia Naous', NULL, '1', 38, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (40, 1087192, 'Dragons', 'Action', 'Jeunesse', 'Sur l''île escarpée de Beurk, où depuis des générations Vikings et dragons s’affrontent sans merci, Harold fait figure d’exception. Effacé, écrasé par la stature de son père, le chef de la tribu, Stoïk ce jeune rêveur défie des siècles de tradition en se liant d''amitié avec un dragon nommé Krokmou. Leur lien improbable va révéler la vraie nature des dragons et remettre en question les fondements mêmes de la société viking.Flanqué de l”ambitieuse Astrid et de l’excentrique forgeron du village Gueulfor, Harold va devoir s’imposer dans un monde déchiré par la peur et l’incompréhension.Alors qu’une dangereuse créature réémerge des brumes du passé, menaçant à la fois les Vikings et les dragons, l’amitié d’Harold et Krokmou pourrait bien être la clé d’un nouvel avenir. Ensemble, ils vont devoir se frayer un chemin fragile vers la paix, en dépassant les limites de leurs deux mondes pour mieux redéfinir les notions de chef et de héro.', '2025-06-11 00:00:00', 125, 150000000, 'US', 'https://image.tmdb.org/t/p/w500/fIIlud9ehpxhemVygioyJrJkRTL.jpg', NULL, NULL, 'Mason Thames, Nico Parker, Gerard Butler, Nick Frost', NULL, '1', 39, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (42, 996087, 'Crasse', 'Drame', 'Art et Essai', 'Londres, 1984: Maria, âgée de 7 ans, et sa mère vivent dans un monde bien à elles, tendre et singulier, tissé d’amour et de trésors amassés. Mais une nuit, tout bascule. Dix ans plus tard, Maria vit une vie paisible dans sa famille d’accueil quand un jeune homme plus âgé, Michael, fait irruption dans leur foyer, ravivant des blessures enfouies et brouillant la frontière entre magie et folie…', '2025-06-11 00:00:00', 127, 0, 'GB', 'https://image.tmdb.org/t/p/w500/ee9oBAe0ny6HkVAunIxbCWxoPMW.jpg', NULL, NULL, 'Saura Lightfoot Leon, Joseph Quinn, Hayley Squires, Lily-Beau Leach', NULL, '1', 41, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (45, 513305, '椒麻堂会', 'Drame', 'Art et Essai', 'Grand acteur-clown de l’opéra du Sichuan, Qiu Fu n’est plus. L’artiste quitte à contrecœur la vie terrestre pour le monde souterrain, où il est accueilli par Tête de Bœuf et Visage de Cheval, les deux gardiens du lieu. Alors qu’il revit une dernière fois ses souvenirs avant d’entrer dans l’Au-delà, cinquante années d’art, de lutte et d’amour défilent sur fond d’histoire tumultueuse de la Chine du XXe siècle…', '2025-06-11 00:00:00', 180, 0, 'CN', 'https://image.tmdb.org/t/p/w500/8siryLHotpnfb463IuZCWLxhoQ9.jpg', NULL, NULL, 'Yi Sicheng, Haoyu Chen, Guan Nan, Qiu Zhimin', NULL, '1', 44, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (46, 42254, 'Le Droit du plus fort', 'Drame', 'Art et Essai', 'Lorsque Klaus, son petit ami, est arrêté par la police dans son stand de foire, Franz, un homosexuel, se retrouve ruiné : privé de son amant, il perd emploi et argent. Il retrouve à nouveau l''espoir lorsqu''il gagne 500 000 marks à un concours de pronostics et rencontre au cours d''une soirée un homme élégant et raffiné : Eugen. Franz tombe naturellement amoureux d''Eugen, mais celui-ci exploite les sentiments et la faiblesse de Franz à d''autres fins. C''est ainsi qu''il le convainc d''investir dans l''entreprise déficitaire de son père…', '2025-06-11 00:00:00', 125, 0, 'DE', 'https://image.tmdb.org/t/p/w500/1n8MBJMe8MRdyz7B1UapiujXOCE.jpg', NULL, NULL, 'Rainer Werner Fassbinder, Peter Chatel, Karlheinz Böhm, Adrian Hoven', NULL, '1', 45, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (48, 1481568, 'El Vikario', 'Horreur', 'Art et Essai', '', '2025-06-06 00:00:00', 0, 169, 'PE', 'https://image.tmdb.org/t/p/w500/3CtTWtjmOJmGq7HL0qidUuWJEMW.jpg', NULL, NULL, 'Oscar Aguirre Salazar, Sergio Monchón, Diego Raymundo', NULL, '1', 46, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (49, 1493020, '7 Jours en Juin', 'Guerre', 'Art et Essai', '', '2025-06-05 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/kVvlE3EEyfwIulYtywErgFAG4sf.jpg', NULL, NULL, 'Manuel Gonçalves, Laurent Guiot, Franck Rasamison, Anthony Wauters', NULL, '1', 47, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (50, 1045021, 'Thug Life', 'Action', 'Grand Public', 'Le film se déroule dans un monde façonné par les criminels.', '2025-06-05 00:00:00', 150, 35000000, 'IN', 'https://image.tmdb.org/t/p/w500/DmBbUtbA3T9sdVXDgIJ8bsIDw0.jpg', NULL, NULL, 'Kamal Haasan, Silambarasan, Trisha Krishnan, Ashok Selvan', NULL, '1', 48, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (44, 842924, 'Life Of Chuck', 'Drame', 'Grand Public', 'Basé sur la nouvelle de Stephen King, qui raconte trois chapitres de la vie d''un homme ordinaire nommé Charles Krantz en commençant par sa mort d''une tumeur cérébrale à 39 ans et en terminant par son enfance dans une maison prétendument hantée.', '2025-06-11 00:00:00', 111, 0, 'US', 'https://image.tmdb.org/t/p/w500/gSJzgltK1mx2m6SNQhStbXiqu7l.jpg', NULL, NULL, 'Tom Hiddleston, Jacob Tremblay, Benjamin Pajak, Nick Offerman', NULL, '1', 43, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (52, 1396565, '3ème Œil', 'Drame', 'Art et Essai', 'Fanny, journaliste, découvre un mystérieux album photo dans une brocante, révélant la vie d''une photographe inconnue disparue dans des circonstances obscures à New York. À la recherche de la vérité, Fanny retrouve la galerie à Paris exposant ses œuvres. Des autoportraits, des installations et des mises en scènes avec une Love Doll. De ces photographies exposées et de cet album photo émane le quotidien du travail de Christina et l''expérience d''une vie dédiée à la photographie. Ouvrant les portes à un monde photographique étrange ainsi qu''à la réalité d''une œuvre d''art. Chaque image semble dissimuler un secret.', '2025-06-04 00:00:00', 116, 0, 'FR', 'https://image.tmdb.org/t/p/w500/37d8dDeF6KzEyGvjSreqXDrkNch.jpg', NULL, NULL, 'Tatiana Becquet Genel, Valérie Moinet, Zoé Bensimon, Julia Vidal', NULL, '1', 49, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (53, 1390530, 'La Terre des Vertus', 'Documentaire', 'Documentaire', 'Les Jardins ouvriers des Vertus à Aubervilliers font face aux aménagements liés aux JO2024 et à la pression foncière. Quand les tractopelles du Grand Paris menacent, la résistance s’organise, les expérimentations citoyennes fleurissent. Film impressionniste et politique, La Terre des Vertus conte les défis et les espérances de ce jardin-monde.', '2025-06-04 00:00:00', 92, 0, 'FR', 'https://image.tmdb.org/t/p/w500/qw0eKlQzOR7G5ZGiLXowngDomgm.jpg', NULL, NULL, '', NULL, '1', 50, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (54, 1311186, 'Dans la peau', 'Documentaire', 'Documentaire', 'À sa sortie de prison, Kaleem revient vivre à Marseille, à la Cité de la Savine. Il travaille sur les chantiers tout en rêvant de vivre de sa passion pour la danse. Marie, jeune architecte d’origine grecque, découvre la ville et ses cultures. Leur rencontre inattendue devient vite une histoire d’amour tumultueuse dans cette ville multiculturelle mais socialement divisée.', '2025-06-04 00:00:00', 100, 0, 'FR', 'https://image.tmdb.org/t/p/w500/szz5f74IDz99Gms8pDSfNHNTUgT.jpg', NULL, NULL, 'Wilfried Blé, Almaz Papatakis, Daniel Saïd, Amélie Hassani', NULL, '1', 51, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (62, 1474499, 'Stock-car family', 'Documentaire', 'Documentaire', 'Tous les ans, à Brissac, au pied des Cévennes, un drôle de manège se met en place. Autour d’un ovale de terre se regroupe toute une bande de passionnés, avec une seule idée en tête : se frayer un chemin coûte que coûte. À travers une course de Stock-Cars dans l’arrière-pays de Montpellier se raconte un village, des valeurs, des métiers, et des passions, tout cela se transmettant de génération en génération dans deux familles très proches du réalisateur. Ces passions pourront elles survivre à l’heure du bouleversement climatique ?', '2025-06-03 00:00:00', 55, 0, 'FR', 'https://image.tmdb.org/t/p/w500/lFdG7MjNF7BGZ848W6g2uh6GXBj.jpg', NULL, NULL, '', NULL, '1', 59, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (63, 1480549, 'The Toughest Footrace on Earth', 'Documentaire', 'Documentaire', '', '2025-06-02 00:00:00', 126, 0, 'BE', 'https://image.tmdb.org/t/p/w500/qSvZVJy50QmvJuJqPUklgDrrDFr.jpg', NULL, NULL, 'Average Rob, Arno Van Impe, Milan Cools, Karel Sabbe', NULL, '1', 60, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (13, 975511, 'The Return, le retour d''Ulysse', 'Histoire', 'Art et Essai', 'Après 20 ans d''absence, Ulysse échoue sur les côtes d''Ithaque, hagard et méconnaissable. Le roi est enfin rentré chez lui, mais beaucoup de choses ont changé dans son royaume depuis son départ pour la guerre de Troie. Sa femme bien-aimée, Pénélope, est désormais prisonnière de sa propre maison, harcelée par ses nombreux et ambitieux prétendants pour choisir un nouveau mari, un nouveau roi. Leur fils Télémaque, qui a grandi sans père, risque la mort aux mains des prétendants qui le considèrent comme un obstacle dans leur quête du royaume.', '2025-06-18 00:00:00', 116, 20000000, 'GR', 'https://image.tmdb.org/t/p/w500/5DsrpyV5tT75CJqrj3ZsWjlVXOA.jpg', '', NULL, 'Ralph Fiennes, Juliette Binoche, Charlie Plummer, Marwan Kenzari', NULL, '1', 13, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (41, 1001030, 'Différente', 'Comédie', 'Art et Essai', 'Katia, brillante documentaliste de 35 ans, fait preuve de singularité dans sa manière de vivre ses relations, toutes plus ou moins chaotiques. Sa participation à un nouveau reportage l’amène à mettre enfin un mot sur sa différence. Révélation qui va chambouler une vie déjà bien compliquée.', '2025-06-11 00:00:00', 100, 3500000, 'FR', 'https://image.tmdb.org/t/p/w500/oqO6abIuZcefdz6Rl0xFnLOq187.jpg', NULL, NULL, 'Jehnny Beth, Thibaut Évrard, Mireille Perrier, Emmanuelle Schaaff', NULL, '1', 40, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (24, 1005972, 'Sous hypnose', 'Comédie', 'Grand Public', 'André et Vera, un jeune couple d''entrepreneurs a l''occasion de présenter leur application de santé féminine lors d''un prestigieux concours. Avant de s''y rendre, Vera essaie l''hypnothérapie pour arrêter de fumer. À partir de ce moment, son attitude change et André commence à se comporter de manière inattendue…', '2025-06-25 00:00:00', 98, 0, 'SE', 'https://image.tmdb.org/t/p/w500/jEDBx4o9IAzxgvyB2rlEJP7OgXk.jpg', NULL, NULL, 'Asta Kamma August, Herbert Nordrum, Andrea Edwards, David Fukamachi Regnfors', NULL, 'https://www.youtube.com/watch?v=3mWglWbcPfQ', 24, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (108, 1477121, 'I huvudet på Bo', 'Documentaire', 'Documentaire', '', '2025-07-02 00:00:00', 105, 0, 'SE', 'https://image.tmdb.org/t/p/w500/6zf7dx5xgS332o3HPH9ub6a86ps.jpg', NULL, NULL, 'Bo Widerberg, Roy Andersson, Thommy Berggren, Kalle Boman', NULL, 'https://www.youtube.com/watch?v=zKjLe1Z6DZA', 105, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (110, 1317616, 'L''Aventura', 'Comédie', 'Grand Public', 'Les vacances d’été. Sardaigne, Italie. Un (road) trip en famille. Claudine, bientôt 11 ans, raconte leurs aventures au fur et à mesure. Quand Raoul, son frère de 3 ans, ne l’en empêche pas…', '2025-07-02 00:00:00', 100, 0, 'FR', 'https://image.tmdb.org/t/p/w500/bcIHtdjz6EKEwK6Wcj5D9m3iqgU.jpg', NULL, NULL, 'Philippe Katerine, Sophie Letourneur, Bérénice Vernet, Esteban Melero', NULL, NULL, 107, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (103, 1000407, 'Valensole 1965', 'Comédie', 'Grand Public', 'Valensole, Provence, Été 65. À l’aube, Maurice Masse, un paysan découvre dans son champ de lavandes un mystérieux engin qui décolle à une vitesse sidérante en laissant des traces au sol. La nouvelle attire les foules et met Maurice sous le feu des projecteurs. Face à cette soudaine notoriété non désirée, il tente de protéger sa famille et de faire face. Sa vie, celle de sa famille et de ce petit village vont être bouleversées. Basé sur une histoire vraie.', '2025-07-09 00:00:00', 90, 700000, 'FR', 'https://image.tmdb.org/t/p/w500/tX3UAs3NczOKYH09LppdrQCqVzY.jpg', NULL, NULL, 'Matthias Van Khache, Vahina Giocante, Sasha Gravat Harsch, Olivia Gotanègre', NULL, NULL, 100, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (111, 1313144, 'L''Accident de piano', 'Comédie', 'Grand Public', 'Une star du web devenue célèbre en postant des contenus choc sur les réseaux sociaux, qui, après un accident grave survenu sur le tournage de l’une des vidéos, décide de s’isoler dans un chalet à la montagne avec son assistant personnel pour faire un break.', '2025-07-02 00:00:00', 92, 0, 'FR', 'https://image.tmdb.org/t/p/w500/5VmXgd1oYsF6mLB0pXYon0kOPuj.jpg', NULL, NULL, 'Adèle Exarchopoulos, Gabin Visona, Jérôme Commandeur, Sandrine Kiberlain', NULL, 'https://www.youtube.com/watch?v=TyuwHhSxXiE', 108, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (106, 838443, 'Des Feux dans la Plaine', 'Mystère', 'Art et Essai', 'Chine, 1997. Une série de meurtres endeuille la ville de Fentun. Les crimes s’arrêtent mystérieusement sans que les autorités aient pu élucider l’affaire. Huit ans plus tard, un jeune policier, proche d’une des victimes, décide de rouvrir l’enquête.', '2025-07-09 00:00:00', 101, 0, 'CN', 'https://image.tmdb.org/t/p/w500/xxLkLosOuqY9JOoPqtptXUqs1Hh.jpg', NULL, NULL, 'Zhou Dongyu, Liu Haoran, Mei Ting, Yuan Hong', NULL, NULL, 103, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (116, 1136867, 'Materialists', 'Romance', 'Art et Essai', 'Une jeune et ambitieuse matchmakeuse new-yorkaise se retrouve dans un triangle amoureux complexe, tiraillée entre le " match " parfait et son ex tout sauf idéal.', '2025-07-02 00:00:00', 117, 20000000, 'US', 'https://image.tmdb.org/t/p/w500/ycS4AydmXRWL4uj2vCwJOdfrcVt.jpg', NULL, NULL, 'Dakota Johnson, Chris Evans, Pedro Pascal, Zoë Winters', NULL, 'https://www.youtube.com/watch?v=TGDGmP9sA-k', 111, NULL, '2025-06-13 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (90, 1012618, 'Kouté vwa', 'Drame', 'Art et Essai', 'Melrick, un adolescent de 13 ans, passe ses vacances d''été chez sa grand-mère Nicole, à Cayenne, en Guyane. Sa présence et son désir d’apprendre à jouer du tambour fait resurgir le spectre de Lucas, le fils de Nicole, lui aussi tambouyé, mort dans des conditions tragiques 11 ans plus tôt. Confronté au deuil qui hante sa famille et au désir de vengeance du meilleur ami de Lucas, Melrick cherche sa propre voie vers le pardon.', '2025-07-16 00:00:00', 77, 0, 'BE', 'https://image.tmdb.org/t/p/w500/5vG5Wm3td9ibkFwHznqBg9r0dDF.jpg', NULL, NULL, 'Melrick Diomar, Nicole Diomar, Yannick Cébret', NULL, NULL, 87, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (287, 1390382, 'Coutures', 'Drame', 'Grand Public', 'Maxine, une réalisatrice américaine est embarquée dans un parcours de vie et de mort alors qu''elle arrive à Paris pour la Fashion Week et que son existence va entrer en collision avec celles de deux autres femmes.', '2025-10-15 00:00:00', 0, 0, 'FR', '', NULL, NULL, 'Angelina Jolie, Ella Rumpf, Louis Garrel, Anyier Anei', NULL, NULL, 1, 282, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (118, 1107216, 'Falcon Express', 'Animation', 'Jeunesse', 'Des animaux de compagnie, piégés dans un train lancé à toute allure, vont devoir déjouer les plans de Hans, un blaireau rancunier en quête de vengeance. Alors que le crash semble inévitable, les animaux peuvent compter sur Falcon, un raton-laveur filou et débrouillard, prêt à tout pour les sauver !', '2025-07-02 00:00:00', 99, 0, 'FR', 'https://image.tmdb.org/t/p/w500/jf2wB6idJ8N4gMC9OqNxDD51Ayp.jpg', NULL, NULL, '', NULL, 'https://www.youtube.com/watch?v=HUsx5IfgL0I', 113, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (98, 1284484, 'Marius et les Gardiens de la Cité Phocéenne', 'Comédie', 'Grand Public', 'Auto-proclamé "Roi de Marseille", Marius est un guide touristique haut en couleur qui trimballe ses clients dans son bus panoramique.  Le jour où son véhicule tombe en panne, mettant en péril son petit business, il fait la rencontre de trois gamins du quartier qui prétendent être sur la piste d''un trésor.  Marius se retrouve alors engagé dans une dangereuse aventure...', '2025-07-09 00:00:00', 85, 0, 'FR', 'https://image.tmdb.org/t/p/w500/1aPCz3pzGUYOGxr1fVfmMBmNO7o.jpg', NULL, NULL, 'Soprano, Anys Ajbouh, Imran Bouzalim, Fatou Niass', NULL, NULL, 95, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (94, 54421, 'Mahjong', 'Comédie', 'Grand Public', 'Marthe, jeune française de dix-huit ans arrive à Taipei où elle vient retrouver Marcus, un homme rencontré à Londres et dont elle s’était éprise. Mais lorsqu’elle arrive chez lui, Marthe est confrontée à la nouvelle compagne de Marcus. Elle est bientôt prise en charge par Ginger, une amie de Marcus qui est à la tête d’une agence d’escort girls. Désœuvrée et perdue dans cette ville inconnue, Marthe se lie avec un gang de jeunes taïwanais à l’influence malsaine…', '2025-07-16 00:00:00', 121, 0, 'TW', 'https://image.tmdb.org/t/p/w500/hSc96TDwzjKCtsnfGnFZzhMPHEc.jpg', NULL, NULL, 'Lawrence Ko Yu-Luen, Chang Chen, Tang Tsung Sheng, Virginie Ledoyen', NULL, NULL, 91, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (109, 1438405, 'Le bonheur est une bête sauvage', 'Comédie', 'Grand Public', 'Jeanne, la cinquantaine, est brisée. Elle a perdu son mari lors d’un naufrage survenu 10 ans plus tôt au large de l’île d’Yeu. Tom, son neveu de 19 ans, lui annonce qu’il va quitter l’île. Jeanne est sous le choc. Le soir-même, un ours est aperçu sur l’île. Sous l''œil de la lune, les islais partent à sa recherche. Durant une semaine, une quête collective du bonheur revêt des atours magiques et cocasses sur le manque et l’absence grâce à l’éloge des forces de la nature et des humains.', '2025-07-02 00:00:00', 95, 0, 'FR', 'https://image.tmdb.org/t/p/w500/wTYRvWraF78rWHu11ZWo8qdhykr.jpg', NULL, NULL, 'Sacha Guerry, Sophie Davout, Chris Walder, Cédric Marchal', NULL, NULL, 106, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (120, 1058128, 'Les amants astronautes', 'Comédie', 'Grand Public', 'Pedro rentre d’Espagne dans son pays natal l’Argentine pour revoir ses proches. Mais les retrouvailles avec un ami d’enfance, le séduisant Maxi, prennent une tournure inattendue à mesure que leur relation devient de plus en plus ambigüe. Bien que Maxi soit hétérosexuel, la montée du désir entre eux ne cesse de croître tandis qu’ils cherchent à le cacher, et peut-être à l’accepter ?', '2025-07-02 00:00:00', 116, 0, 'AR', 'https://image.tmdb.org/t/p/w500/qHcynYYAJ6J3fozXnfj65Fq1XUg.jpg', NULL, NULL, 'Javier Orán, Lautaro Bettoni, Mora Arenillas, Agustín Frías', NULL, 'https://www.youtube.com/watch?v=IepMsdf5hYM', 115, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (117, 1128547, 'Islands', 'Drame', 'Grand Public', 'Coach de tennis dans un complexe hôtelier, Tom mène une vie sans attaches au rythme de virées nocturnes alcoolisées et de cours monotones sous le soleil de Fuerteventura. Un jour, parmi le flot incessant des vacanciers, débarque sur l’île Anne, accompagnée de son fils et de son mari. Tom accepte de jouer le guide touristique pour la famille et très vite d’étranges liens commencent à se nouer entre eux.', '2025-07-02 00:00:00', 123, 0, 'DE', 'https://image.tmdb.org/t/p/w500/y9W0KytjdHdpV3OGrSgFwl79TsL.jpg', NULL, NULL, 'Sam Riley, Stacy Martin, Jack Farthing, Dylan Torrell', NULL, NULL, 112, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (119, 1081196, 'Mamie-sitting', 'Comédie', 'Grand Public', 'À Dublin, Edward, un romancier introverti au grand cœur, touche enfin du doigt le succès. Mais alors qu’une prestigieuse tournée promotionnelle se profile, il doit s’occuper, le temps d’un week-end, de quatre femmes âgées hautes en couleur – dont sa propre mère. Entre situations improbables et révélations émouvantes, cette cohabitation imprévue pourrait bien changer leur vie.', '2025-07-02 00:00:00', 89, 0, 'IE', 'https://image.tmdb.org/t/p/w500/x9e7mQVShfZqsYRwy5kbwnMRvxH.jpg', NULL, NULL, 'James McArdle, Fionnula Flanagan, Dearbhla Molloy, Paddy Glynn', NULL, 'https://www.youtube.com/watch?v=6i1wyJMY-aI', 114, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (128, 1161751, 'TKT (T''inquiète)', 'Comédie', 'Art et Essai', 'Emma, une jeune fille de 16 ans bien dans sa peau, populaire dans son lycée, est tombée dans le coma. Pourquoi ? Que lui est-il arrivé ? Pour le comprendre, elle va devenir " fantôme " pour quelques jours. Invisible, elle peut alors tout voir, tout entendre et retourner dans ses souvenirs pour reconstituer son histoire. Avec ce film, elle aborde notamment la question du harcèlement scolaire, dans la vraie vie comme sur les réseaux sociaux.', '2025-09-24 00:00:00', 82, 0, 'BE', 'https://image.tmdb.org/t/p/w500/3OsnEjOkzKv6UCMGBhTVA9N182G.jpg', NULL, NULL, 'Lanna de Palmaert, Émilie Dequenne, Stéphane De Groodt, Raphaëlle Lubansu', NULL, NULL, 1, 123, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (131, 1001043, 'Rembrandt', 'Drame', 'Art et Essai', 'Claire et Yves, physiciens de formation, travaillent dans le nucléaire depuis toujours. Lors d’une visite à la National Gallery, Claire va être bouleversée par trois toiles de Rembrandt. Cette rencontre avec ces trois œuvres magistrales va les changer à jamais.', '2025-09-24 00:00:00', 107, 0, 'BE', 'https://image.tmdb.org/t/p/w500/ph7oqNFZKNimUWwaO3toIUZ33Sd.jpg', NULL, NULL, 'Camille Cottin, Romain Duris, Denis Podalydès, Céleste Brunnquell', NULL, NULL, 1, 126, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (121, 1002158, 'Rapaces', 'Thriller', 'Grand Public', 'Un père et sa fille : Samuel, journaliste, et Ava, sa stagiaire, couvrent le meurtre d’une jeune fille attaquée à l’acide, pour leur magazine. Frappé par la brutalité de ce meurtre, ainsi que par l’intérêt de sa fille pour l’affaire, Samuel décide de mener une enquête indépendante, à l’insu de sa rédaction, et découvre des similitudes troublantes avec le meurtre d’une autre femme…', '2025-07-02 00:00:00', 104, 0, 'FR', 'https://image.tmdb.org/t/p/w500/prZ5PUQ4z3vYUP0dfTKXDlNHLoa.jpg', NULL, NULL, 'Sami Bouajila, Mallory Wanecque, Jean-Pierre Darroussin, Valérie Donzelli', NULL, 'https://www.youtube.com/watch?v=DKG-hu15NZI', 1, 116, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (129, 1149764, 'Sukkwan Island', 'Drame', 'Art et Essai', 'Un homme se rend sur une île sauvage pour renouer avec son père. Dix ans auparavant, ils ont partagé une expérience bouleversante qui a transformé leur relation.', '2025-09-24 00:00:00', 114, 0, 'BE', 'https://image.tmdb.org/t/p/w500/9CrzZIhIU1jF75LWDUuebI7IoTb.jpg', NULL, NULL, 'Swann Arlaud, Woody Norman, Ruaridh Mollica, Alma Pöysti', NULL, '1', 1, 124, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (112, 1284120, 'The Ugly Stepsister', 'Horreur', 'Grand Public', 'Dans un royaume où la beauté règne en maître, la jeune Elvira doit faire face à une féroce concurrence pour espérer gagner l’attention du prince. Parmi ses nombreuses rivales, se trouve notamment sa demi-sœur à la beauté insolente. Dans cette course effrénée à l’obtention du physique parfait, Elvira devra avoir recours aux méthodes les plus extrêmes.', '2025-07-02 00:00:00', 109, 4250000, 'NO', 'https://image.tmdb.org/t/p/w500/hRbaOImESNEJWC2SZ8qHXiRFm4i.jpg', NULL, NULL, 'Lea Myren, Ane Dahl Torp, Thea Sofie Loch Næss, Flo Fagerli', NULL, 'https://www.youtube.com/watch?v=vn2i668hs_k', 109, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (113, 1228685, 'La Trilogie d’Oslo / Amour', 'Drame', 'Art et Essai', 'Sur un ferry qui les ramène à Oslo, Marianne, médecin, retrouve Tor, infirmier dans l’hôpital où elle exerce. Il lui raconte qu’il passe souvent ses nuits à bord, à la recherche d’aventures sans lendemain avec des hommes croisés sur des sites de rencontre. Ces propos résonnent en Marianne, qui revient d’un blind date organisé par sa meilleure amie et s’interroge sur le sens d’une vie amoureuse sans engagement. Ce soir-là, Tor succombe au charme de Bjorn, qui lui résiste et lui échappe...', '2025-07-02 00:00:00', 119, 0, 'NO', 'https://image.tmdb.org/t/p/w500/dV0SKBbh9CDQDg6ISFzBPE5Vxf6.jpg', NULL, NULL, 'Andrea Bræin Hovig, Tayo Cittadella Jacobsen, Thomas Gullestad, Lars Jacob Holm', NULL, 'https://www.youtube.com/watch?v=tmYu9dtfwDA', 110, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (114, 1228682, 'La Trilogie d’Oslo / Rêves', 'Drame', 'Art et Essai', '', '2025-07-02 00:00:00', 110, 0, 'NO', 'https://image.tmdb.org/t/p/w500/7sGGy7UbV8Wy8td8B8drgQMWvUQ.jpg', NULL, NULL, 'Ella Øverbye, Selome Emnetu, Anne Marit Jacobsen, Ane Dahl Torp', NULL, 'https://www.youtube.com/watch?v=ijqwWwGdHZY', 110, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (146, 1455069, 'I am the Future', 'Documentaire', 'Documentaire', 'Des rêves plein la tête malgré les difficultés qu’ils rencontrent, quatre jeunes s’interrogent sur leur avenir et celui de leur communauté. Venus de France, Indonésie, Inde et Liban, leurs destins convergent à New York où ils témoignent de leur expérience de la pauvreté aux Nations Unies. Au travers de l’écriture, de la danse, de la photographie et du dessin, les protagonistes posent, avec courage et joie, un œil rare sur les grands défis contemporains.', '2025-09-10 00:00:00', 98, 0, 'FR', 'https://image.tmdb.org/t/p/w500/skPSaZOnPDz4o9ukbx8HZqQBqnG.jpg', NULL, NULL, '', NULL, NULL, 1, 141, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (161, 1197122, 'Fils de', 'Comédie', 'Grand Public', 'Une semaine après la présidentielle, la France cherche toujours son Premier Ministre. Nino, jeune attaché parlementaire ambitieux, est missionné pour convaincre son père, Lionel Perrin d’accepter le poste. Mais cet éternel perdant a coupé les ponts avec la politique…et son fils. Nino se retrouve embarqué dans une course effrénée où tous les coups sont permis. Il a 24h pour sauver sa carrière, son couple et si possible l’avenir de la France !', '2025-09-03 00:00:00', 90, 0, 'BE', 'https://image.tmdb.org/t/p/w500/2lFqSgZxO2cVY00Z1C21EW9Psiy.jpg', '', 7, 'Jean Chevalier, François Cluzet, Karin Viard, Alex Lutz', NULL, NULL, 156, 156, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (135, 1318339, 'Día de caza', 'Drame', 'Art et Essai', 'Blanca, Rosa et Carmen sont trois amies d''âge mûr qui, après une longue période sans se voir, se retrouvent avec Diana, la réservée nièce de Rosa, pour aller chasser le lapin dans une propriété que Blanca a héritée de son oncle.', '2025-09-17 00:00:00', 0, 0, 'ES', '', '', NULL, 'Carmen Machi, Rossy de Palma, Blanca Portillo, Zoe Arnao', NULL, NULL, 1, 130, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (163, 1103747, 'Nos jours sauvages', 'Drame', 'Art et Essai', 'En rupture avec sa famille, Chloé, 20 ans, est recueillie par un groupe de jeunes marginaux. A bord de leur van, ils sillonnent la Grèce post-crise, venant en aide aux plus démunis, moyennant des combines pas toujours légales. A leur contact, Chloé expérimente une nouvelle vie, plus libre, plus intense, où tout peut s''arrêter demain.', '2025-10-22 00:00:00', 104, 0, 'GR', 'https://image.tmdb.org/t/p/w500/jyE0PTs3IIbHahQVjxLjuVenLxc.jpg', NULL, NULL, 'Daphné Patakia, Nikos Zeginoglou, Eva Samioti, Stavros Tsoumanis', NULL, NULL, 158, 158, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (174, 1315657, 'Sarı Harfler', 'Drame', 'Art et Essai', 'Le récit d''un couple d’artistes turcs forcés à l’exil.', '2026-02-25 00:00:00', 0, 0, 'TR', '', NULL, NULL, 'Özgü Namal, Tansu Biçer, Şiir Eloğlu, Eray Egilmez', NULL, '1', 1, 169, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (145, 977168, 'Bardot', 'Documentaire', 'Documentaire', 'Jamais vraiment dans une case, muse de cinéastes finissant par sacrifier tout à la cause animale, Brigitte Bardot est une femme libre mais sans doute incomprise. BARDOT revient sur les aspects si contradictoires de sa vie, de sa carrière artistique légendaire à sa célèbre fondation. Elle qui bouscula l’image des femmes et fut en avance sur la conscience écologique et le bien-être animal qui semblent, enfin, pour tous une évidence.', '2025-09-17 00:00:00', 90, 0, 'FR', 'https://image.tmdb.org/t/p/w500/zOYIJhhzPL1iCtanG3kzm8olt6s.jpg', NULL, NULL, 'Brigitte Bardot, Claude Lelouch, Naomi Campbell, Paul Watson', NULL, 'https://www.youtube.com/watch?v=ceMk76Nl4Fc', 1, 140, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (149, 1313168, 'Toujours possible', 'Comédie', 'Grand Public', 'À 55 ans, Gaby, biologiste, perd son job…et gagne une idée folle : avoir un enfant ! Avec sa mère fantasque et un fichier de donneurs, elle traque le sperme parfait, tandis que Pierre, 56 ans, tente de rajeunir à tout prix pour séduire. Mais l’amour pourrait bien prouver que tout reste… toujours possible !', '2025-09-10 00:00:00', 90, 0, 'FR', '', NULL, NULL, 'Nadia Farès, Amanda Lear, Patrick Ridremont, Jean-Baptiste Maunier', NULL, 'https://www.youtube.com/watch?v=LEJU-puemyM', 1, 144, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (124, 1389448, 'Silent Shot', 'Drame', 'Art et Essai', 'Alex, jeune artiste electro française pétillante, vient tourner au Japon des images pour les clips de son nouvel album. Sur le tournage, elle se rapproche de Mia, sa belle assistante japonaise. Cette histoire d’amour naissante est stoppée nette quand le réalisateur du clip commence à mettre en scène Mia plutôt qu’Alex... Une jalousie s’installe, de plus en plus profonde, et Alex sombre peu à peu dans une folie paranoïaque...', '2025-09-24 00:00:00', 60, 0, 'FR', 'https://image.tmdb.org/t/p/w500/krpfbk3JmXO4zzNKzyZuxbTykue.jpg', NULL, NULL, 'Désirée Deboës, Nagisa Chauveau, Loïc Garnier', NULL, 'https://www.youtube.com/watch?v=OrKxjLS_Lz8', 1, 119, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (150, 1293858, 'L''Intérêt d''Adam', 'Drame', 'Art et Essai', 'Adam, 4 ans, est hospitalisé pour malnutrition à la suite d’une décision de justice. Lucy, l’infirmière en chef autorise la mère d’Adam à rester auprès de son fils au-delà des heures de visite fixées par le juge. Mais la situation se complique quand celle-ci refuse une nouvelle fois de quitter son fils. Dans l’intérêt de l’enfant, Lucy fera tout pour venir en aide à cette mère en détresse.', '2025-09-10 00:00:00', 73, 0, 'BE', 'https://image.tmdb.org/t/p/w500/7oNyeYr9kRLXekfEmnEmKsr12lq.jpg', '', NULL, 'Léa Drucker, Anamaria Vartolomei, Alex Descas, Jules Delsart', NULL, NULL, 1, 145, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (199, 420634, 'Terrifier', 'Horreur', 'Grand Public', 'C''est la nuit d''Halloween dans une petite ville américaine. Un grand clown dégingandé et mutique, tout habillé de blanc et de noir, s''installe à une table dans une pizzeria, portant un gros sac poubelle. Il s''attaque alors à plusieurs jeunes femmes qui tentent tant bien que mal de lui échapper. Ce meurtrier psychopathe déguisé en clown prend un plaisir sadique à mutiler atrocement toutes ses victimes.', '2025-07-04 00:00:00', 84, 35000, 'US', 'https://image.tmdb.org/t/p/w500/deOSc1shhi8NhBUeSa6NkXQ2ivL.jpg', NULL, NULL, 'David Howard Thornton, Jenna Kanell, Samantha Scaffidi, Catherine Corcoran', NULL, '1', 193, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (211, 1376439, 'Jean Valjean', 'Drame', 'Art et Essai', '1815. Jean Valjean sort du bagne après dix-neuf ans de travaux forcés. Pétri par la colère, le sentiment d’injustice et les violences subies, il est devenu un animal dangereux qui n’a plus confiance en rien ni personne. Un soir, après avoir été de nombreuses fois rejeté, il trouve refuge chez un prêtre. Monseigneur Bienvenu vit là avec sa sœur et une unique servante. Surpris par la chaleur de l’accueil, Jean Valjean est ébranlé dans ses convictions criminelles. Il lui faudra choisir entre les actes définitifs que lui inspire sa haine du monde et l’acceptation de la main tendue.', '2025-11-19 00:00:00', 0, 7000000, 'FR', '', NULL, NULL, 'Grégory Gadebois, Bernard Campan, Isabelle Carré, Alexandra Lamy', NULL, NULL, 207, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (216, 1119537, 'Des preuves d''amour', 'Drame', 'Grand Public', 'Céline attend l’arrivée de son premier enfant. Mais elle n’est pas enceinte. Dans trois mois, c’est Nadia, sa femme, qui donnera naissance à leur fille. Sous le regard de ses amis, de sa mère, et aux yeux de la loi, elle cherche sa place et sa légitimité.', '2025-11-19 00:00:00', 97, 0, 'FR', 'https://image.tmdb.org/t/p/w500/6sqBoqPT08s3r8Cm6nSokcTIx8V.jpg', NULL, NULL, 'Ella Rumpf, Monia Chokri, Noémie Lvovsky, Félix Kysyl', NULL, NULL, 212, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (218, 1318417, 'La maison des femmes', 'Drame', 'Art et Essai', 'À la Maison des femmes, on soigne les femmes victimes de violences. Ailleurs elles sont menacées, brutalisées, violées, mutilées, leurs souffrances ignorées. Ici, elles sont écoutées, soutenues, aidées, crues. Diane, Manon, Inès, Awa et les autres leur donneront le bras jusqu’à ce qu’elles puissent se relever. En équipe. Quitte à risquer leur propre équilibre.', '2025-11-12 00:00:00', 0, 0, 'FR', '', NULL, NULL, 'Karin Viard, Laetitia Dosch, Oulaya Amamra, Eye Haïdara', NULL, NULL, 214, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (219, 1313226, 'Kika', 'Drame', 'Grand Public', 'Alors que son compagnon vient de mourir, Kika réalise avec stupéfaction qu''elle est enceinte. Complètement fauchée et le cœur en bouillie, elle hiérarchise ses priorités : 1- sortir de la mouise. 2- réfléchir à garder ou non cet enfant.', '2025-11-12 00:00:00', 108, 0, 'BE', 'https://image.tmdb.org/t/p/w500/2w4UGKh9ZEfezsWBbrLteMw95pf.jpg', NULL, NULL, 'Manon Clavel, Makita Samba, Thomas Coumans, Thierry Hellin', NULL, NULL, 54, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (215, 1126694, 'Les filles du ciel', 'Drame', 'Art et Essai', 'Une nuit, Héloïse se retrouve seule dans une ville qui n’est pas la sienne, et n’a nulle part où aller. Elle fait la rencontre de Nora, qui la ramène chez elle, où vivent déjà quatre jeunes femmes. Elles forment une tribu, où tout est partagé, et se protègent l’une l’autre. Mais l’omerta sur leurs blessures passées pèse de plus en plus lourd sur ces femmes si solides, et pourtant si fragiles.', '2025-11-19 00:00:00', 0, 0, 'FR', '', NULL, NULL, 'Héloïse Volle, Shirel Nataf, Jonas Bloquet, Yowa-Angélys Tshikaya', NULL, NULL, 1, 211, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (133, 1385015, 'Cosmos', 'Drame', 'Art et Essai', 'Dans un village oublié du Yucatán, Lena, 68 ans, une veuve esseulée condamnée par la maladie, croise le chemin de Leon, 62 ans, un Indien maya gardien des secrets de la nature et des esprits. Lena trouve en Leon un compagnon inattendu. Malgré leurs différences, leurs univers apparemment opposés, une connexion profonde se forme entre eux.', '2025-09-18 00:00:00', 150, 0, 'FR', 'https://image.tmdb.org/t/p/w500/wl6o1tPQp3HcfiFyUsbem5NY0ek.jpg', NULL, NULL, 'Ángela Molina, Andrés Catzín, Marco Antonio Treviño, Abraham Sarabia', NULL, NULL, 1, 128, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (201, 1102145, 'Bonjour la langue', 'Drame', 'Art et Essai', 'Lorsque son train arrive en gare de Draguignan, Jean-Luc décide de descendre et de rendre une visite imprévue à son père, qu''il n''a pas vu depuis plus de six ans.', '2025-08-27 00:00:00', 80, 0, 'FR', 'https://image.tmdb.org/t/p/w500/bj4vef6xvAswBplwqSSjEmgDN0J.jpg', NULL, NULL, 'Pascal Cervo, Paul Vecchiali, Julien Lucq', NULL, 'https://www.youtube.com/watch?v=V_T-cYUhPFY', 1, 196, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (257, 1197125, 'Louise', 'Drame', 'Art et Essai', 'Suite à un incident, la jeune Marion décide de fuguer du domicile familial. Elle démarre alors une nouvelle vie sous une autre identité : Louise. Quinze ans plus tard, « Louise » retrouve la trace de sa sœur et de sa mère. Petit à petit, elle réapprend à les connaître sans leur dévoiler son identité. Alors qu''elle renoue avec son passé, un dilemme s''impose à elle : rester Louise ou redevenir Marion…', '2025-12-03 00:00:00', 0, 0, 'BE', '', NULL, NULL, 'Diane Rouxel, Salomé Dewaels, Myriem Akheddiou, Laurent Capelluto', NULL, NULL, 1, 252, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (210, 1241983, 'Train Dreams', 'Drame', 'Art et Essai', 'Robert Grainier est employé comme bûcheron pour aider à l''expansion des chemins de fer à travers l''Amérique. Contraint de passer de longues périodes loin de sa femme, Gladys et de leur petite fille, Grainier s''efforce de trouver sa place dans un monde en pleine mutation.', '2025-11-21 00:00:00', 102, 10000000, 'US', 'https://image.tmdb.org/t/p/w500/pHHUxQv2ntS0UvUA70kQhAEIzM9.jpg', NULL, NULL, 'Joel Edgerton, Felicity Jones, Kerry Condon, William H. Macy', NULL, NULL, 1, 206, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (190, 680770, 'Le Monde de Wishy', 'Aventure', 'Jeunesse', 'Lorsque Thomas rencontre Fleak, une créature poilue venue d’une autre dimension, il se retrouve embarqué dans une aventure fantastique au cours de laquelle il découvre un moyen de remarcher. Mais en échange, il doit affronter un monstre dévoreur de tout, né de sa propre ombre.', '2025-08-13 00:00:00', 83, 4500000, 'FI', 'https://image.tmdb.org/t/p/w500/lhWKrW3kiMjv376hdnGtprYuvMc.jpg', '', 7, '', NULL, 'https://www.youtube.com/watch?v=mmE768I_4EY', 1, 184, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (237, 1368166, 'La Femme de ménage', 'Thriller', 'Grand Public', 'Millie fait le ménage dans la maison des Winchester, une riche famille new-yorkaise. Elle récupère aussi leur fille à l''école et prépare les repas avant d''aller se coucher dans sa chambre, située au grenier. Pour Millie, ce travail représente une chance de repartir de zéro. Mais, sous des dehors respectables, sa patronne, Nina, se montre de plus en plus toxique. Lorsque Millie découvre que la porte de sa chambre ne peut être verrouillée que de l''extérieur, il est peut-être déjà trop tard...', '2025-12-24 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/8bnoMczXfK2jTIlRckSYjrjj8c9.jpg', NULL, NULL, 'Sydney Sweeney, Amanda Seyfried, Brandon Sklenar, Michele Morrone', NULL, NULL, 232, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (238, 1318710, 'Selon Joy', 'Drame', 'Art et Essai', 'Dans une ville grise et sans passé, Joy est une enfant trouvée, recueillie par le père André. Gardienne le jour, organiste pendant les messes, animée par une foi ardente, Joy ne quitte presque jamais l''église. Un jour, elle aperçoit un jeune inconnu qui sort du confessionnal, un sac de livraison sur le dos. Elle en est persuadée, elle doit le retrouver. Joy part en quête. En quête d''une nouvelle vie. De son corps. En quête d’elle-même.', '2025-12-24 00:00:00', 86, 0, 'FR', 'https://image.tmdb.org/t/p/w500/nMnNMmkYNNh14Dj9ZybBb6PBNJK.jpg', NULL, NULL, 'Sonia Bonny, Volodymyr Zhdanov, Asia Argento, Raphaël Thiéry', NULL, NULL, 233, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (239, 1291202, 'Duse', 'Drame', 'Art et Essai', 'La légendaire diva de la scène italienne Eleonora Duse, à travers la dernière partie de sa vie et sa carrière légendaire maintenant terminée depuis longtemps.', '2025-12-24 00:00:00', 0, 11002819, 'IT', '', NULL, NULL, 'Valeria Bruni Tedeschi, Noémie Merlant, Fausto Russo Alesi, Marcello Mazzarella', NULL, NULL, 234, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (241, 1069650, 'L''Engloutie', 'Drame', 'Art et Essai', '1899. Hautes Alpes. "Soudain" est un hameau encerclé par la neige sur les hauts plateaux d’une montagne reculée. Ses habitants voient arriver, par une nuit de tempête, Aimée, une jeune institutrice, laïque et républicaine, qui restera le temps de l’hiver pour faire l’école à une poignée d’enfants. Mais peu après son arrivée, une avalanche engloutit un premier montagnard…', '2025-12-24 00:00:00', 98, 0, 'FR', 'https://image.tmdb.org/t/p/w500/lPNMNMFEBkHhRdcvpOSYPjDpUVN.jpg', NULL, NULL, 'Galatea Bellugi, Matthieu Lucci, Samuel Kircher, Oscar Pons', NULL, NULL, 236, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (243, 1290450, 'Love Me Tender', 'Drame', 'Art et Essai', 'Une fin d’été, Clémence annonce à son ex-mari qu’elle a des histoires d’amour avec des femmes. Sa vie bascule lorsqu''il lui retire la garde de son fils. Clémence va devoir lutter pour rester mère, femme, libre.', '2025-12-17 00:00:00', 137, 0, 'FR', 'https://image.tmdb.org/t/p/w500/wAOj7jNImqi76Dmm9tbf7BudBdu.jpg', NULL, NULL, 'Vicky Krieps, Antoine Reinartz, Monia Chokri, Viggo Ferreira Redier', NULL, NULL, 238, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (253, 524635, 'The Chronology of Water', 'Drame', 'Art et Essai', 'Ayant grandi dans un environnement ravagé par la violence et l’alcool, la jeune Lidia peine à trouver sa voie. Elle parvient à fuir sa famille et entre à l’université, où elle trouve refuge dans la littérature. Peu à peu, les mots lui offrent une liberté inattendue…', '2025-12-10 00:00:00', 128, 0, 'US', 'https://image.tmdb.org/t/p/w500/a7keKUtkEtHjhZUqqfr50CED5di.jpg', NULL, NULL, 'Imogen Poots, Thora Birch, Charlie Carrick, Tom Sturridge', NULL, NULL, 248, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (221, 1255778, 'La Bonne étoile', 'Comédie', 'Grand Public', 'France 1940, Jean Chevalin et sa famille vivent dans la misère après que ce dernier ait jugé bon de… déserter ! La situation n’est plus tenable. Convaincu que « certains » s’en sortent mieux, Chevalin a une brillante idée : se faire passer pour juifs afin de bénéficier de l’aide des passeurs pour accéder à la zone libre. De malentendus en révélations, il va entrainer sa famille dans ce grand périple qui déconstruira ses préjugés un à un…', '2025-11-12 00:00:00', 0, 0, 'FR', '', NULL, NULL, 'Benoît Poelvoorde, Audrey Lamy, Josiane Balasko, Hugo Becker', NULL, NULL, 216, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (222, 1221711, 'L''Incroyable femme des neiges', 'Comédie', 'Grand Public', 'Dormir sur la banquise, traverser le Groenland en solitaire, se battre à mains nues avec un ours… Il n’y a plus grand chose qui fasse peur à Coline Morel. A part, peut-être, se confronter à sa propre existence.', '2025-11-12 00:00:00', 101, 0, 'FR', 'https://image.tmdb.org/t/p/w500/y0t4bI9SPrHkwOvshozVYPc56MZ.jpg', NULL, NULL, 'Blanche Gardin, Philippe Katerine, Bastien Bouillon, Ole Eliassen', NULL, NULL, 217, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (223, 1159206, 'Father Mother Sister Brother', 'Comédie', 'Grand Public', 'Des frères et sœurs séparés se retrouvent après des années de séparation, obligés de faire face à des tensions non résolues et de réévaluer leurs relations tendues avec leurs parents émotionnellement éloignés.', '2025-11-12 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/202dbGr6fbAQpwzNNPSX6BUTCOM.jpg', NULL, NULL, 'Cate Blanchett, Charlotte Rampling, Vicky Krieps, Adam Driver', NULL, NULL, 218, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (226, 1503896, 'France, une histoire d''amour', 'Documentaire', 'Documentaire', 'Après avoir exploré le monde, Yann Arthus-Bertrand revient chez lui, en France, et part à la rencontre des français et françaises qui agissent concrètement pour faire avancer leur monde. Ce documentaire, touchant et plein d’humanité, tourné comme un road-movie dans la France entière, est une invitation à la curiosité mais surtout au vivre ensemble. Ces rencontres permettent de révéler des paroles sincères et des moments rares qui dessinent des portraits d’hommes et de femmes engagés.', '2025-11-05 00:00:00', 105, 0, 'FR', '', NULL, NULL, '', NULL, NULL, 221, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (228, 1302848, 'T’as pas changé', 'Comédie', 'Grand Public', 'Suite à la disparition d’un de leur camarade de classe, quatre anciens lycéens décident, 30 ans après le bac, de réunir toute leur promo à l’occasion d’une fête.  Véritable déclaration d’amour aux années 90, "T’as pas changé" dresse le portrait drôle et doux-amer de ces presque quinquas que des retrouvailles vont bouleverser à jamais…', '2025-11-05 00:00:00', 0, 0, 'FR', '', NULL, NULL, 'Jérôme Commandeur, Vanessa Paradis, Laurent Lafitte, François Damiens', NULL, NULL, 223, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (231, 1229563, 'La ola', 'Musique', 'Art et Essai', '', '2025-11-05 00:00:00', 129, 0, 'CL', 'https://image.tmdb.org/t/p/w500/srkHoeXw4SOzpODPhn3UX6BgdfV.jpg', NULL, NULL, 'Daniela López, Avril Aurora, Lola Bravo, Paulina Cortés', NULL, NULL, 226, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (232, 1221724, 'Les rêveurs', 'Drame', 'Grand Public', 'Dans les années 70, l''histoire d''une famille de rêveurs un peu déglinguée, mais touchante, luttant pour la liberté. Elle met en lumière les métamorphoses douloureuses des adultes, les couleurs vives de l''époque, et la découverte du monde compliqué des adultes par une jeune fille, révélée à elle-même par le théâtre.', '2025-11-05 00:00:00', 0, 0, 'FR', '', NULL, NULL, 'Bernard Campan, Judith Chemla, Tessa Dumont Janod, Isabelle Carré', NULL, NULL, 227, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (236, 1418709, 'Bagarre', 'Comédie', 'Grand Public', 'Gloria, ex-championne de boxe, élève seule son fils autiste Antoine. Quand un incident à la piscine menace la scolarité d’Antoine, Gloria doit livrer son plus grand combat : faire accepter la différence de son fils.', '2025-12-24 00:00:00', 0, 0, 'FR', '', NULL, NULL, 'Nassim Lyes, Zoé Marchal, Idir Azougli, Paul Deby', NULL, NULL, 231, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (227, 1331358, 'Les Braises', 'Comédie', 'Grand Public', 'Karine et Jimmy voient leur vie bouleversée lorsque Karine s’engage dans la révolte sociale qui secoue le pays...', '2025-11-05 00:00:00', 0, 0, 'FR', '', NULL, NULL, 'Virginie Efira, Arieh Worthalter, Katia Crivellari', NULL, NULL, 1, 222, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (249, 1437985, 'Chasse gardée 2', 'Comédie', 'Grand Public', 'Deux ans se sont écoulés à Saint Hubert. La vie y est paisible, peut-être trop pour Adélaïde et Simon qui souffrent du manque d’amis de leur âge. C’est sans compter sur l’arrivée de Stanislas, le fils de Bernard (l''ancien président des chasseurs du village), qui revient vivre à la campagne avec sa femme et ses deux enfants. Ils sont beaux, jeunes, et sympas. Leur seul défaut : ils pratiquent la chasse à courre ! La paix du village va être mise à mal : nouveaux voisins, nouveaux problèmes…', '2025-12-10 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/huOuo17SLInClHftcpgsHwlSHWs.jpg', NULL, NULL, 'Didier Bourdon, Camille Lou, Hakim Jemili, Thierry Lhermitte', NULL, NULL, 244, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (250, 1432812, 'Cher Père Noël', 'Comédie', 'Jeunesse', 'Zoé, une jeune fille de 8 ans, souhaite obtenir un fusil à billes du Père Noël pour se venger de Timothée, un camarade qui l''ennuie en jouant avec son robot en Lego. Sa mère, Nadia, travaille pour les parents de Timothée, ce qui complique sa quête de vengeance. Lorsqu''elle découvre que son souhait n''a pas été exaucé à Noël, Zoé est déterminée à retrouver le Père Noël pour le forcer à réaliser son désir. Et la chance tourne de son côté quand elle entend une publicité révélant que le Père Noël, en personne, fait une parade tous les jours au Parc Enchanté, célèbre parc d’attractions…', '2025-12-10 00:00:00', 0, 0, 'FR', '', NULL, NULL, 'Patrick Timsit, Isabelle Nanty, Antoine Gouy', NULL, NULL, 245, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (251, 1221719, 'Dites-lui que je l’aime', 'Drame', 'Grand Public', 'Romane décide d’adapter pour le cinéma le livre de Clémentine Autain consacré à sa mère. Ce projet va l’obliger à se confronter à son passé et à sa propre mère qui l’a abandonnée quand elle avait neuf mois…', '2025-12-10 00:00:00', 92, 0, 'FR', 'https://image.tmdb.org/t/p/w500/5s2TmudKv5urU5lHXtbxZoYTt4D.jpg', NULL, NULL, 'Romane Bohringer, Clémentine Autain, Philippe Rebbot, Eva Yelmani', NULL, NULL, 246, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (252, 1087209, 'Lady Nazca', 'Drame', 'Grand Public', 'Une jeune femme découvre un vestige millénaire au milieu du désert péruvien et va en faire l’œuvre de sa vie.', '2025-12-10 00:00:00', 90, 1500000, 'DE', '', NULL, NULL, 'Paula Beer, Guillaume Gallienne, Alice Dwyer', NULL, NULL, 247, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (254, 1310830, 'Fuori', 'Drame', 'Art et Essai', 'L''histoire de la comédienne et écrivaine italienne Goliarda Sapienza, une figure du XXe siècle aux nombreuses facettes dont le roman L’art de la joie, publié de manière posthume, a récemment été transposé dans la série TV L’arte della gioia,', '2025-12-03 00:00:00', 117, 0, 'IT', 'https://image.tmdb.org/t/p/w500/zFo7tZqQes1JASl1eDefZoG1AHV.jpg', NULL, NULL, 'Valeria Golino, Matilda De Angelis, Elodie, Corrado Fortuna', NULL, NULL, 249, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (258, 1119548, 'La condition', 'Drame', 'Grand Public', '1908. Victoire et André sont mariés mais leur amour n’est pas réciproque. Ils peinent à avoir un enfant. Alors qu’André se sent délaissé, il abuse de leur jeune bonne Céleste. Terrifiée, elle ne parvient pas à le repousser. Ces abus se répètent jusqu’à ce que Céleste tombe enceinte et le cache…', '2025-12-03 00:00:00', 0, 0, 'FR', '', NULL, NULL, 'Swann Arlaud, Galatea Bellugi, Louise Chevillotte, Emmanuelle Devos', NULL, NULL, 253, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (255, 1277882, 'Les enfants vont bien', 'Drame', 'Art et Essai', 'Un soir d’été, Suzanne, accompagnée de ses deux jeunes enfants Gaspard et Margaux, rend une visite impromptue à sa sœur Jeanne. Celle-ci est prise au dépourvu, car elles ne sont pas revues depuis longtemps. Au réveil, Jeanne découvre le mot laissé par sa sœur : “Elle ne reviendra pas”. Après la sidération, vient la colère lorsqu’à la gendarmerie Jeanne comprend qu’aucune procédure de recherche ne pourra être engagée : Suzanne a fait le choix insensé de disparaître…', '2025-12-03 00:00:00', 111, 0, 'FR', 'https://image.tmdb.org/t/p/w500/wPOQJTVxnc2J8NJyTXjKrpyrPTB.jpg', NULL, NULL, 'Camille Cottin, Juliette Armanet, Monia Chokri, Manoâ Varvat', NULL, NULL, 1, 250, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (300, 1262773, 'Météors', 'Drame', 'Art et Essai', 'Diagonale du vide. Mika et Dan ont beaucoup de rêves mais peu de chance. Après un nouveau plan raté de Dan, ils se retrouvent à bosser pour Tony, leur meilleur ami, devenu roi du BTP. Mika et Dan doivent se sauver d’ici, se sauver l’un l’autre, se sauver tout court.', '2025-10-08 00:00:00', 110, 0, 'FR', 'https://image.tmdb.org/t/p/w500/8svmicBAZZdV8GuCzfXDflgYXIv.jpg', NULL, NULL, 'Paul Kircher, Idir Azougli, Salif Cissé, Elsa Bouchain', NULL, NULL, 294, 294, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (274, 1001288, 'Vade Retro', 'Fantastique', 'Art et Essai', 'Pour entrer dans l’âge adulte, un vampire doit mordre. Pour conjurer cette virginité, il lui faut du sang "pur". Autrement, il sait qu’une malédiction s’abattrait sur sa famille : ils retourneraient en poussière, leur château avec. Norbert a déjà 350 ans, il est temps pour lui de devenir cet adulte. Il a trouvé sa proie, mais qui s’avère être une chasseuse de vampire. Il en sort traumatisé, et une dent en moins. Sa famille décide de l’envoyer à l’autre bout du monde pour vaincre sa soudaine phobie, mordre et sauver leur château. Norbert débarque par erreur sur l’île de Boulet Rouge, régie par le cartésianisme français. L’arrivée de Norbert déclenche bien sûr une chasse au vampire…', '2025-10-29 00:00:00', 0, 0, 'FR', '', NULL, NULL, 'Estéban, Pascal Tagnati, Céline Fuhrer, Eva Rami', NULL, NULL, 269, 269, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (280, 1076897, 'Kaamelott: Deuxième volet (première partie)', 'Aventure', 'Grand Public', '', '2025-10-22 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/sqsubXXKujK0iIlrXS0bqYG31Y2.jpg', NULL, NULL, 'Alexandre Astier, Franck Pitiot, Jean-Christophe Hembert, Thomas Cousseau', NULL, NULL, 1, 275, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (289, 1331349, 'Deux pianos', 'Drame', 'Art et Essai', 'Mathias Vogler, pianiste, rentre en France après un long exil. Il y retrouve son mentor, Elena,avec laquelle il prépare un concert. Dans un parc, il croise un enfant qui lui ressemble comme deux gouttes d''eau. Cette rencontre le conduira vers Claude, la femme aimée.', '2025-10-15 00:00:00', 0, 0, 'FR', '', NULL, NULL, 'François Civil, Nadia Tereszkiewicz, Charlotte Rampling, Hippolyte Girardot', NULL, NULL, 284, 284, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (290, 1323409, 'Dracula', 'Comédie', 'Art et Essai', 'Un acteur interprétant Dracula s''enfuit d''un spectacle dans un restaurant.', '2025-10-15 00:00:00', 0, 0, 'RO', 'https://image.tmdb.org/t/p/w500/wYu0RPHIsA7Jqo8XgcoNpcYy5Sv.jpg', NULL, NULL, 'Lukas Miko, Alexandru Dabija, Oana Maria Zaharia, Gabriel Spahiu', NULL, NULL, 1, 118, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (318, 1012591, 'Nino dans la nuit', 'Drame', 'Art et Essai', 'Suite à une soirée qui tourne mal, Nino Paradis, 20 ans, prend la fuite. Après une tentative ratée d’intégrer la Légion étrangère, il rentre à Paris où il retrouve Lale, celle qui embrase son cœur, ainsi que Malik et Charlie, ses deux compagnons d’infortune. De petits boulots mal payés en soirées, Nino cherche sa place dans un monde qui lui laisse peu d’espoir, mais s’évertue à continuer de rêver…', '2026-01-07 00:00:00', 117, 0, 'BE', '', NULL, NULL, 'Oscar Högström, Mara Taquin, Bilal Hassani, Théo Augier', NULL, NULL, 312, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (285, 804370, 'Arco', 'Animation', 'Art et Essai', 'En 2075, une petite fille de 10 ans, Iris, voit un mystérieux garçon vêtu d''une combinaison arc-en-ciel tomber du ciel. C''est Arco. Il vient d''un futur lointain et idyllique où voyager dans le temps est possible. Iris le recueille et va l''aider par tous les moyens à rentrer chez lui.', '2025-10-22 00:00:00', 88, 0, 'FR', 'https://image.tmdb.org/t/p/w500/4qEi9e3QExH4ngWVw4PHos2G514.jpg', NULL, NULL, 'Alma Jodorowsky, Swann Arlaud, Vincent Macaigne, Louis Garrel', NULL, NULL, 1, 280, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (309, 1238188, 'Cervantes avant Don Quichotte', 'Drame', 'Art et Essai', 'Biopic sur Miguel de Cervantes, l''auteur du roman "Don Quichotte". À Alger en 1575, Cervantès est un soldat blessé de la marine espagnole âgé de 28 ans. Il est retenu prisonnier par des corsaires ottomans. Face à une mort cruelle qui l''attend si ses compatriotes ne paient pas rapidement sa rançon, Cervantès trouve son refuge dans l''art de raconter des histoires.', '2025-10-01 00:00:00', 134, 10720500, 'ES', 'https://image.tmdb.org/t/p/w500/9Iec0m1fv8TTviLeLP16m5pYcVn.jpg', NULL, NULL, 'Julio Peña, Alessandro Borghi, Miguel Rellán, Fernando Tejero', NULL, NULL, 1, 303, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (317, 1290436, 'Ma frère', 'Comédie', 'Grand Public', 'Shaï et Djeneba ont 20 ans et sont amies depuis l’enfance. Cet été là, elles sont animatrices dans une colonie de vacances. Elles accompagnent dans la Drôme une bande d’enfants qui comme elles ont grandi entre les tours de la Place des Fêtes à Paris. À l’aube de l’âge adulte, elles devront faire des choix pour dessiner leur avenir et réinventer leur amitié.', '2026-01-07 00:00:00', 112, 0, 'FR', 'https://image.tmdb.org/t/p/w500/m88FxrdmS5HUccPOTQ2O2tSHq9d.jpg', NULL, NULL, 'Fanta Kebe, Shirel Nataf, Zakaria-Tayeb Lazab, Mouctar Diawara', NULL, NULL, 1, 311, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (310, 988099, 'La Mort n’existe pas', 'Animation', 'Art et Essai', 'Après un attentat armé raté au cours duquel elle abandonne ses compagnons, Hélène s’enfuit en forêt. Manon, une de ses complices lors de l’attaque, revient alors la hanter. Ensemble, elles traversent une vallée à la fois intime et fantastique, où métamorphoses, pouvoirs vénéneux et grands bouleversements viendront bientôt bousculer l’ordre des choses. Hélène aura à revisiter ses choix et les dilemmes, personnels et collectifs, qui les circonscrivent.', '2025-10-01 00:00:00', 72, 0, 'CA', 'https://image.tmdb.org/t/p/w500/pHlOjrNkKbxaMRqoYCzrt3uUxex.jpg', NULL, NULL, 'Zeneb Blanchet, Karelle Tremblay, Mattis Savard-Verhoeven, Barbara Ulrich', NULL, 'https://www.youtube.com/watch?v=gOhXeMkqwZU', 304, 304, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (281, 1037264, 'La Disparition de Josef Mengele', 'Drame', 'Art et Essai', 'Au lendemain de la Seconde Guerre mondiale, Josef Mengele, le médecin nazi du camp d’Auschwitz, parvient à s’enfuir en Amérique du Sud pour refaire sa vie dans la clandestinité. De Buenos Aires au Paraguay, en passant par le Brésil, celui qu’on a baptisé « L’Ange de la Mort » va organiser sa méthodique disparition pour échapper à toute forme de procès.', '2025-10-22 00:00:00', 135, 0, 'DE', 'https://image.tmdb.org/t/p/w500/5BZq2x4iN3dHUJpDDdfmNs6VWmr.jpg', NULL, NULL, 'August Diehl, Friederike Becht, Max Bretschneider, David Ruland', NULL, NULL, 276, 276, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (306, 1383266, 'Moi qui t’aimais', 'Drame', 'Grand Public', 'Elle l’aimait plus que tout, il l’aimait plus que toutes les autres.INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (303, 768614, 'Silver Star', 'Crime', 'Art et Essai', 'L''histoire de Buddy et Franny, un couple du genre de Bonnie et Clyde. Buddy est déterminé à renouer avec ses parents éloignés en sauvant leur maison de la saisie, quoi qu''il en coûte. Lors d''un braquage de banque raté, Buddy prend Franny en otage et ensemble, ils se lancent dans un road trip inattendu à travers l''Amérique.', '2025-10-08 00:00:00', 102, 0, 'US', 'https://image.tmdb.org/t/p/w500/cFAdQaqCTZ8m51rx9OlH8lAWoP1.jpg', NULL, NULL, 'Grace Van Dien, Troy Leigh-Anne Johnson, Noa Fisher, Odley Jean', NULL, NULL, 1, 297, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (284, 931285, 'Mortal Kombat II', 'Action', 'Grand Public', '', '2025-10-22 00:00:00', 0, 68000000, 'US', 'https://image.tmdb.org/t/p/w500/lGamD2f6xEZJSoXlntAd5wvQnWZ.jpg', NULL, NULL, 'Karl Urban, Jessica McNamee, Mehcad Brooks, Ludi Lin', NULL, 'https://www.youtube.com/watch?v=8qKhWSyVPGA', 1, 279, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (298, 1284496, 'C''était mieux demain', 'Comédie', 'Grand Public', 'Dans une petite bourgade française, Hélène, Michel et leurs deux enfants, coulent des jours heureux dans l’insouciance des années 1950. Soudainement propulsés en 2025, le couple découvre un monde moderne à l’opposé de celui qu’ils connaissent. Pour Hélène, qui a toujours vécu comme il se doit dans l’ombre de l’époux, c’est une révolution. Mais, pour Michel, qui voit ses privilèges d’Homme voler en éclat, c’est un cataclysme. Entre vent nouveau et parfum d’antan, ce voyage dans le temps ne sera pas de tout repos…', '2025-10-08 00:00:00', 100, 0, 'FR', '', NULL, NULL, 'Elsa Zylberstein, Didier Bourdon, Giulia Lambert, Frédéric Clou', NULL, NULL, 1, 292, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (268, 1327862, 'Regretting You', 'Drame', 'Art et Essai', 'Morgan est devenue mère très jeune, mettant ses propres rêves entre parenthèses pour élever Clara. Aujourd''hui, cette dernière est adolescente, leur relation se tend surtout après le décès de Chris, le mari de Morgan et père de Clara.', '2025-10-29 00:00:00', 0, 0, 'DE', '', NULL, NULL, 'Allison Williams, Mckenna Grace, Dave Franco, Mason Thames', NULL, NULL, 1, 263, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (316, 1307118, 'SOULM8TE', 'Science-Fiction', 'Grand Public', 'Un homme acquiert un androïde à intelligence artificielle pour faire face à la perte de sa femme. En essayant de créer un partenaire vraiment sensible, il transforme un "lovebot" inoffensif en une compagne dangereuse.', '2026-01-07 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/q0XwYzZywCbuVVcillmLXABw9Ax.jpg', NULL, NULL, 'Lily Sullivan, David Rysdahl, Claudia Doumit, Oliver Cooper', NULL, NULL, 310, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (320, 1371185, 'Song Sung Blue', 'Drame', 'Art et Essai', '', '2025-12-31 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/nXHwKaHAxV1vdOycECPd3eqhv5V.jpg', NULL, NULL, 'Hugh Jackman, Kate Hudson, Michael Imperioli, Fisher Stevens', NULL, NULL, 314, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (229, 1290424, 'L''Inconnu de la Grande Arche', 'Drame', 'Art et Essai', '1983, François Mitterrand décide de lancer un concours d''architecture international pour le projet phare de sa présidence : la Grande Arche de la Défense, dans l''axe du Louvre et de l''Arc de Triomphe ! A la surprise générale, Otto von Spreckelsen, architecte danois, remporte le concours. Du jour au lendemain, cet homme de 53 ans, inconnu en France, débarque à Paris où il est propulsé à la tête de ce chantier pharaonique. Et si l''architecte entend bâtir la Grande Arche telle qu’il l’a imaginée, ses idées vont très vite se heurter à la complexité du réel et aux aléas de la politique.', '2025-11-05 00:00:00', 105, 0, 'DK', 'https://image.tmdb.org/t/p/w500/zriwECvMyJNcUdXrELeYSrXF0f2.jpg', NULL, NULL, 'Claes Bang, Sidse Babett Knudsen, Swann Arlaud, Michel Fau', NULL, NULL, 224, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (313, 1005623, 'Les Enchantés', 'Drame', 'Art et Essai', 'Lors de sa première rentrée scolaire, découvrant à la fois le plaisir d''apprendre et le handicap mental de son père, une fillette est prise dans un conflit de loyauté.', '2025-07-11 00:00:00', 85, 0, 'FR', 'https://image.tmdb.org/t/p/w500/kHNCePMCrHK9qVS2YmI75ftPYRB.jpg', NULL, NULL, 'Grégory Montel, Daphné Richard, Lula Cotton-Frapier, François Chattot', NULL, NULL, 307, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (365, 1511094, 'Paul Cézanne, pionnier de l''art moderne', 'Documentaire', 'Documentaire', 'À l’occasion de la réouverture de la bastide familiale aixoise où Paul Cézanne créa une grande partie de son œuvre, ce documentaire revisite la trajectoire du maître, qui puisa dans sa Provence natale son inspiration avant-gardiste.', '2025-06-29 00:00:00', 53, 0, 'FR', 'https://image.tmdb.org/t/p/w500/lSRxFTFM2mmSslMamPaWyQge9gz.jpg', NULL, NULL, '', NULL, NULL, 1, 362, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (25, 948184, '默視錄', 'Crime', 'Grand Public', 'La petite fille de Darren a disparu. Lorsque des images mystérieuses apparaissent, Darren soupçonne son voisin Goh, d''être le voyeur lié à la disparition de sa fille. De plus en plus inquiet, Darren décide de traquer Goh...', '2025-06-25 00:00:00', 125, 400000, 'US', 'https://image.tmdb.org/t/p/w500/82wZgWGBI9SGPnKrL3lzOfhlchV.jpg', NULL, NULL, 'Wu Chien-Ho, Lee Kang-sheng, Anicca Panna, Vera Chen', NULL, 'https://www.youtube.com/watch?v=BZEz0rPeYWY', 25, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (334, 1174382, 'Gérald le Conquérant', 'Comédie', 'Grand Public', 'Il s’appelle Gérald. Son objectif : redorer le blason de sa région de cœur, la Normandie. Sa méthode : bâtir le plus grand parc d''attractions du pays, à la gloire de Guillaume le conquérant. Et pour y parvenir, il est prêt à aller loin, très loin… Retenez bien ce prénom, car il va marquer l’Histoire !', '2025-11-19 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/pLsUx56yBAQ78fjKvYl3K83xrEp.jpg', NULL, NULL, 'Fabrice Eboué, Vincent Solignac, Joaquim Fossi, Gaëtan Cotigny', NULL, NULL, 331, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (337, 1421153, '生息之地', 'Drame', 'Art et Essai', '', '2025-12-24 00:00:00', 132, 0, 'CN', 'https://image.tmdb.org/t/p/w500/enIDhMFB9Bs8UNZBI9Muo2XGDmL.jpg', NULL, NULL, 'Wang Shang, Zhang Chuwen, Zhang Yanrong, Zhang Caixia', NULL, NULL, 334, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (335, 1266816, 'Le Gang des amazones', 'Drame', 'Art et Essai', 'Au début des années 90, cinq jeunes femmes, amies d’enfance, ont braqué sept banques dans la région d’Avignon. La presse les a surnommées “Le Gang des Amazones”. Ce film est leur histoire.', '2025-11-12 00:00:00', 100, 0, 'FR', '', NULL, NULL, 'Laura Felpin, Lyna Khoudri, Kenza Fortas, Mallory Wanecque', NULL, NULL, 332, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (315, 1308910, 'Le Pays d’Arto', 'Drame', 'Art et Essai', 'Céline arrive pour la première fois en Arménie afin de régulariser la mort d’Arto, son mari. Elle découvre qu’il lui a menti, qu’il a fait la guerre, usurpé son identité, et que ses anciens amis le tiennent pour un déserteur. Commence pour elle un nouveau voyage, à la rencontre du passé d''Arto : invalides des combats de 2020, vétérans des batailles victorieuses des années 90, hantises d’une guerre qui n’en finit jamais. Une femme court après un fantôme. Comment faire pour l’enterrer ? Peut-on sauver les morts ?', '2026-01-07 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/1JPwgMoaETdKPxZ9dYqyomnjtrx.jpg', NULL, NULL, 'Camille Cottin, Zar Amir Ebrahimi, Hovnatan Avédikian, Denis Lavant', NULL, NULL, 1, 309, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (332, 1291659, 'Le mage du Kremlin', 'Thriller', 'Grand Public', 'Russie, au début des années 1990, au lendemain de l''effondrement de l''URSS. Dans un nouveau monde qui promet la liberté et flirte avec le chaos, un jeune artiste devenu producteur de télévision, Vadim Baranov, devient de manière inattendue le spin doctor d''un membre prometteur du FSB (ex-KGB), Vladimir Poutine.', '2025-11-26 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/1qdypyrJLu8tJXNPTvTZfgNra4k.jpg', NULL, NULL, 'Paul Dano, Jude Law, Alicia Vikander, Zach Galifianakis', NULL, NULL, 1, 329, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (326, 1388311, 'Luz', 'Mystère', 'Art et Essai', '', '2025-08-19 00:00:00', 0, 0, 'MX', '', NULL, NULL, 'Evan Regueira, Ana Karen Parra, Dalia Xiuhcoatl, Ramón Medína', NULL, NULL, 1, 321, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (269, 1309725, 'La Femme la plus riche du monde', 'Drame', 'Grand Public', 'La femme la plus riche du monde : sa beauté, son intelligence, son pouvoir. Un écrivain photographe : son ambition, son insolence, sa folie. Le coup de foudre qui les emporte. Une héritière méfiante qui se bat pour être aimée. Un majordome aux aguets qui en sait plus qu’il ne dit. Des secrets de famille. Des donations astronomiques. Une guerre où tous les coups sont permis. Une histoire trop connue pour qu’on ne la raconte pas autrement.', '2025-10-29 00:00:00', 121, 0, 'BE', 'https://image.tmdb.org/t/p/w500/6fPXZXvc1WkKMNZScW3l3I3mfHP.jpg', NULL, NULL, 'Isabelle Huppert, Marina Foïs, Laurent Lafitte, Raphaël Personnaz', NULL, NULL, 1, 264, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (323, 1507476, 'Germaine Acogny, l''essence de la danse', 'Documentaire', 'Documentaire', 'En puisant son inspiration dans les danses traditionnelles ouest-africaines, Germaine Acogny s’est imposée, au fil de ses cinquante ans de carrière, comme l’une des figures majeures de la danse contemporaine mais également comme l’une des artistes les plus importantes du continent. À Dakar, où elle a fondé son École des Sables, elle s’applique quotidiennement, à plus de 80 ans, à former une nouvelle génération de danseurs venus de toute l’Afrique et appelée à prendre sa relève.', '2025-07-16 00:00:00', 88, 0, 'DE', 'https://image.tmdb.org/t/p/w500/mmJx5OlMgDOBEDnqCPA5CwRqouL.jpg', NULL, NULL, 'Germaine Acogny', NULL, NULL, 318, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (329, 1511394, 'Best Of Gastes 2025', 'Comédie', 'Grand Public', '', '2025-07-11 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/s3gaYrvEvB3moaDcZgq3QHceRoy.jpg', NULL, NULL, 'Lana Chazette, Clara Carrere, Olivia Giraud, Emma Triaux', NULL, NULL, 326, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (18, 1323072, 'Les Amants du Yangtsé', 'Drame', 'Art et Essai', 'Xia You, professionnelle de la finance, mène une vie apparemment parfaite. Cependant, derrière cette façade se cache un sombre secret : elle subit de graves violences physiques et psychologiques de la part de son partenaire. Épuisée par cette relation toxique, elle rencontre Xu, un marginal désabusé. Ils tombent éperdument amoureux l''un de l''autre et se lancent dans un long voyage dans lequel le corps, l’esprit, la vie et la mort sont intimement liés.', '2025-06-25 00:00:00', 109, 0, 'CN', 'https://image.tmdb.org/t/p/w500/j1qkNr52Ev1yoHsJnk8YOOcHJ7D.jpg', NULL, NULL, 'Ni Ni, Zhou You, Liao Fan', NULL, 'https://www.youtube.com/watch?v=FVYxR1G21C0', 18, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (338, 1166170, 'L’Âme Idéale', 'Comédie', 'Grand Public', 'Elsa, médecin, cache au reste du monde qu’elle voit les morts et les aide à "passer de l’autre côté". Convaincue que son don provoque le rejet, elle a renoncé aux histoires d''amour et s''est enfermée dans la solitude et le travail. Jusqu’au jour où elle fait la rencontre d’Oscar, un mort qui ne sait pas qu’il est mort...', '2025-12-17 00:00:00', 0, 0, 'FR', '', NULL, NULL, 'Alice Vial, Jonathan Cohen, Magalie Lépine-Blondeau, Florence Janas', NULL, NULL, 335, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (242, 1309373, 'Le chant des forêts', 'Documentaire', 'Documentaire', 'Un homme marche, sac au dos, bâton à la main, veste lourde et chaude sur les épaules, vers les profondeurs d’une vieille forêt moussue. Ni le vent, ni la brume, ni même la neige ne l’arrêteront dans son élan pour rejoindre son affût, sa planque : un sapin. En se glissant sous ses branches basses, l’homme s’efface et un monde s’éveille. Celui des bêtes. Le vieux sage nous invite à partager des émotions puissantes à ses côtés, celles qu’il a ressenties au cours de milliers d’affuts. Le moment est venu pour lui d’ouvrir son savoir, ses souvenirs de ses plus belles rencontres sauvages. Au cours d’un voyage dans nos forêts proches, il nous éveillera au "sensible", où plus précisément à la poésie du monde sauvage, celle qu’il a transmise à son fils dès l’âge de 12 ans et qu’il transmettra peut-être à son petit-fils.', '2025-12-17 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/6VbbC9YRRrTJJn2QalqHyxVrcBi.jpg', NULL, NULL, 'Vincent Munier', NULL, NULL, 237, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (339, 1406657, '果てしなきスカーレット', 'Animation', 'Jeunesse', '', '2025-12-10 00:00:00', 0, 0, 'JP', 'https://image.tmdb.org/t/p/w500/ArZDuwW1cZcghpfD4FXoR2vbF22.jpg', NULL, NULL, 'Mana Ashida, Masaki Okada', NULL, NULL, 336, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (340, 1292123, 'Mother', 'Drame', 'Art et Essai', 'Sept jours consécutifs d''un moment charnière de la vie de Mère Teresa, la période où elle décide de quitter le couvent Loreto Entally de Calcutta et de lancer sa propre congrégation.', '2025-12-03 00:00:00', 0, 1470055, 'BE', '', NULL, NULL, 'Noomi Rapace, Nikola Ristanovski, Sylvia Hoeks, Ekin Corapci', NULL, NULL, 337, NULL, NULL);
