INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (85, 1295035, 'Super Happy Forever', 'Drame', 'Art et Essai', 'Accompagné de son ami Miyata, Sano retourne à Izu, une station balnéaire au Japon où, cinq ans auparavant, il était tombé amoureux de sa femme Nagi.', '2025-07-16 00:00:00', 83, 0, 'FR', 'https://image.tmdb.org/t/p/w500/2A3bvAunlt9VFuatPuXgx7tkSnI.jpg', NULL, NULL, 'Hiroki Sano, Yoshinori Miyata, Nairu Yamamoto, Hoang Nhu Quynh', NULL, 'https://www.youtube.com/watch?v=DPkCjFaOLkY', 1, 82, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (26, 911430, 'F1® Le Film', 'Action', 'Grand Public', 'Sonny Hayes était le prodige de la F1 des années 90 jusqu’à son terrible accident. Trente ans plus tard, devenu un pilote indépendant, il est contacté par Ruben Cervantes, patron d’une écurie en faillite qui le convainc de revenir pour sauver l’équipe et prouver qu’il est toujours le meilleur. Aux côtés de Joshua Pearce, diamant brut prêt à devenir le numéro 1, Sonny réalise vite qu''en F1, son coéquipier est aussi son plus grand rival, que le danger est partout et qu''il risque de tout perdre.', '2025-06-25 00:00:00', 155, 200000000, 'US', 'https://image.tmdb.org/t/p/w500/lWCPcMevGaTWR9MawrPkMpJGTsz.jpg', NULL, NULL, 'Brad Pitt, Damson Idris, Kerry Condon, Javier Bardem', NULL, 'https://www.youtube.com/watch?v=-kGmpcYwUPw', 26, NULL, '2025-06-27 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (330, 1193421, 'Berlinguer - La grande ambizione', 'Drame', 'Art et Essai', '', '2025-10-08 00:00:00', 122, 0, 'BE', 'https://image.tmdb.org/t/p/w500/uOhMAIkmjUoPYl5NjmXxraVCsbC.jpg', NULL, NULL, 'Elio Germano, Paolo Pierobon, Roberto Citran, Stefano Abbati', NULL, NULL, 1, 327, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (183, 1186640, 'Papamobile', 'Comédie', 'Grand Public', 'Au dernier jour d’un voyage historique au Mexique, le pape est enlevé par un cartel de drogue. Le Saint-Père découvre la personnalité mystique de la cheffe du cartel et les multiples activités de son gang. Mais bientôt la redoutable criminelle découvre qu’elle a enlevé un imposteur.', '2025-08-13 00:00:00', 0, 0, 'BE', '', NULL, NULL, 'Kad Merad, Myriam Tekaïa, Julia Vignali, Carlo Basabe', NULL, NULL, 178, 178, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (198, 1000821, 'L’été de Jahia', 'Drame', 'Art et Essai', 'Jahia, une jeune Erythéenne vit dans un centre pour demandeurs d’asile en Belgique. Sans perspective, Jahia nourrit une peur du futur qui l’isole et l’empêche de vivre. Un jour, elle rencontre Nèta, une jeune Moldave, qui l’entraîne dans sa folle énergie. Malheureusement, la famille de Nèta reçoit l’ordre de quitter le territoire. Nèta sombre brutalement dans un profond sommeil, victime du syndrome de résignation.', '2025-08-06 00:00:00', 90, 0, 'BE', 'https://image.tmdb.org/t/p/w500/a88XNxaPjAzG0vTVUUxDbNJFVER.jpg', '', 7, 'Rania Noura Bance, Sofiia Malovatska, Céline Sallette, Eugenie Anselin', NULL, NULL, 192, 192, NULL);
