INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (366, 1339943, 'En avant guinguette!', 'Documentaire', 'Documentaire', 'Les guinguettes, ce sont ces cabarets-restaurants, symboles d''une certaine douceur de vivre. Des établissements simples et joyeux initialement installés en région parisienne, en bord de Marne. Bourgeois et prolétaires s''y retrouvaient pour se restaurer et danser. Elles ont connu leur âge d''or à la fin du XIXe siècle avant de disparaître, peu à peu, au profit des boîtes de nuit. Mais, depuis quelques années, les guinguettes sont à nouveau à la mode. Rencontre à Neuilly-sur-Marne avec Philippe Panier de Bellechasse, dit Fifi, à la tête d''un des derniers établissements de ce genre, mais aussi avec une toute nouvelle génération de professionnels qui ont décidé, à Rennes ou encore à Paris, de se réapproprier les guinguettes en les mettant au goût du jour.', '2025-06-24 00:00:00', 52, 0, 'FR', 'https://image.tmdb.org/t/p/w500/tmVC1aKQylyOkpBmxHbP1IWWpHd.jpg', NULL, NULL, '', NULL, NULL, 1, 363, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (367, 1502502, 'Touche pas à mon pote', 'Documentaire', 'Documentaire', 'Début 1985, une « petite main » déferle dans les collèges et les lycées, s''imposant comme le signe de ralliement d''une jeunesse révoltée par les crimes racistes, les violences policières et la percée de l''extrême droite. Un an après la « Marche des beurs », des centaines de milliers de manifestants se joignent aux enfants d''immigrés pour dénoncer les discriminations et les inégalités... Un concert géant est organisé à Paris, place de la Concorde, tandis que des intellectuels, des journalistes, des vedettes du show-biz s''engagent aux côtés de SOS Racisme, l''association présidée par Harlem Désir. Touche pas à mon pote devient le slogan phare du mouvement antiraciste et le symbole de toute une génération. Mais derrière ces mobilisations de masse, se dessine une autre histoire dans les coulisses du pouvoir, sur fond de montée inexorable du Front National. Une histoire méconnue, racontée ici pour la première fois par ses principaux acteurs.', '2025-06-22 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/b1iz36qqdG3VUhT5UtK2YREAaCn.jpg', NULL, NULL, '', NULL, NULL, 1, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (368, 1502290, 'Libres comme l''art : peintres américaines des années 1950', 'Documentaire', 'Documentaire', 'Focus sur l’oeuvre de trois pionnières de l’expressionnisme abstrait : Lee Krasner, Helen Frankenthaler et Joan Mitchell, dont le génie et l’audace n’ont rien à envier à leurs homologues masculins.', '2025-06-22 00:00:00', 52, 0, 'FR', 'https://image.tmdb.org/t/p/w500/8eN9oxESankvDSKFRe37sDD2L6g.jpg', NULL, NULL, '', NULL, NULL, 1, 364, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (369, 1509440, 'Les Garçons Bouchers - Live at Hellfest', 'Musique', 'Art et Essai', 'Au Hellfest, Les Garçons Bouchers tranchent dans le vif pour rendre hommage à François Hadji-Lazaro, légende du rock alternatif made in France partie bien trop tôt.', '2025-06-21 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/nSIIhvJ8ISLMPwhmkl0821x1mrJ.jpg', NULL, NULL, '', NULL, NULL, 1, NULL, NULL);
