INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (371, 1503128, 'Le Montespan', 'Comédie', 'Grand Public', 'Le marquis de Montespan refuse que sa femme, Françoise Athénaïs de Rochechouart, devienne la favorite de Louis XIV. L''humiliation publique le guette.', '2025-06-20 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/1TDAX9glY6FussFLFO0Uhuy9RYE.jpg', NULL, NULL, '', NULL, NULL, 1, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (372, 1501235, 'La Peau dure', '', 'Art et Essai', 'Avec Lola, nous pensons souvent aux 15 années passées ensemble dans notre club de judo d''Argenteuil. C''était une vie intense faite de grandes joies mais aussi de sacrifices. Chaque année, nous retournons au Championnat de France pour voir les judokates d''aujourd''hui. Là, je découvre Blandine dont les traits me rappellent ceux de Lola. Je me demande comment elle fait pour être une judokate de haut niveau, tout en vivant sa vie de jeune femme. Je décide d''aller à sa rencontre.', '2025-06-20 00:00:00', 61, 0, 'FR', 'https://image.tmdb.org/t/p/w500/70d0HmGxZRp4rMMCvYQSCsHMCr3.jpg', NULL, NULL, 'Blandine Pont', NULL, NULL, 1, 366, NULL);
