INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (126, 1312312, 'L’Homme qui a vu l’ours qui a vu l’homme', 'Comédie', 'Grand Public', 'Grégoire et Michel ne sont pas de la même génération mais ils sont unis par l’amitié, l’amour de la nature et une grande affection pour un ours échappé d’un cirque.', '2025-09-17 00:00:00', 88, 0, 'FR', 'https://image.tmdb.org/t/p/w500/nVtJKQ034b3blVitW3DIClf2r83.jpg', NULL, NULL, 'Pierre Richard, Timi-Joy Marbot, Gustave Kervern, Anny Duperey', NULL, NULL, 121, 121, NULL);
