INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (127, 1274837, 'Le million', 'Comédie', 'Grand Public', 'Pensant à tort qu''il ne va pas être promu par son entreprise, Stan craque et décide de voler dans le coffre de son patron une valise contenant 1 million d''euros d''argent sale. Direction l''aéroport avec sa copine... Mais en route, un coup de fil lui apprend qu''il obtient la promotion dont il rêvait. Il a alors une nuit pour rattraper son erreur et remettre le million dans le coffre. Pour cela, il va faire appel à Hippolyte, un serrurier peu regardant sur la déontologie…', '2025-09-24 00:00:00', 0, 0, 'FR', '', '', 9, 'Christian Clavier, Rayane Bensetti, Julie Ferrier, Claire Chust', NULL, NULL, 1, 122, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (36, 1278950, 'The Ritual – L’Exorcisme d’Emma Schmidt', 'Horreur', 'Grand Public', 'Deux prêtres - l''un remettant en question sa foi et l''autre devant faire face à son passé - doivent mettre de côté leurs différences pour sauver une jeune femme possédée à travers des exorcismes.', '2025-08-20 00:00:00', 98, 98, 'US', 'https://image.tmdb.org/t/p/w500/neEmMy5Y5Uysp9t4r0zN8KXHfgF.jpg', NULL, NULL, 'Al Pacino, Dan Stevens, Ashley Greene, Abigail Cowen', NULL, 'https://www.youtube.com/watch?v=GH5JslStSlA', 1, 35, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (28, 1498851, 'Johnny Hallyday - Le Concert de la Tour Eiffel - 25ème anniversaire', 'Musique', 'Art et Essai', 'Le 10 juin 2000, Johnny Hallyday célèbre ses 40 ans de carrière à l’occasion d’un concert qui réunit 600 000 personnes sur le Champ de Mars au pied de la Tour Eiffel.  Le Taulier vient de sortir l''album « Sang pour Sang ». Sa carrière est à son apogée. Ses récents succès Vivre pour le meilleur, Sang pour sang et Allumer le feu ont conquis une nouvelle génération de Français qui se pressent pour l''acclamer.  25 ans après, le film de ce concert historique s''offre une nouvelle jeunesse avec un son et une image remasterisés. Il sera diffusé exclusivement au cinéma le dimanche 15 juin, jour anniversaire de la naissance du chanteur.', '2025-06-15 00:00:00', 140, 0, 'FR', 'https://image.tmdb.org/t/p/w500/sS6pzA6FQtqqM8EBRkls7YY83qQ.jpg', NULL, NULL, '', NULL, NULL, 1, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (72, 1295517, 'Vittoria', 'Drame', 'Art et Essai', 'Jasmine est coiffeuse à Naples où elle vit avec son mari et ses trois fils. Depuis le décès de son père, elle est hantée par un rêve récurrent qui accroit son désir d’avoir une fille. Malgré l’incompréhension de sa famille et au risque de tout bouleverser, elle décide d’entamer les démarches pour adopter.', '2025-07-23 00:00:00', 80, 0, 'IT', 'https://image.tmdb.org/t/p/w500/uFDW66IawFDGzWoghRgsFzbiJYW.jpg', NULL, NULL, 'Marilena Amato, Gennaro Scarica, Vincenzo Scarica, Anna Amato', NULL, NULL, 69, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (51, 1492543, 'Meurtres en Balagne', 'Mystère', 'Art et Essai', '', '2025-06-04 00:00:00', 0, 0, 'RU', 'https://image.tmdb.org/t/p/w500/lXoms9Yb7Nj6J2fAEy5a55y27F8.jpg', NULL, NULL, '', NULL, NULL, 1, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (83, 245656, 'La Dame de Constantinople', 'Drame', 'Art et Essai', 'Une dame d’un certain âge décide d’échanger son appartement deux pièces contre un logement plus petit. La marée de gens intéressés qui suit ébranle sa vie solitaire avec des rencontres incongrus qui la mette en contact avec des étrangers un bref instant.', '2025-07-23 00:00:00', 76, 0, 'HU', 'https://image.tmdb.org/t/p/w500/lyo0UrNpobfgg7mSPnsHSwicHJS.jpg', NULL, NULL, 'Manyi Kiss, Éva Almási, László Bathó, József Bánfalvi', NULL, NULL, 80, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (79, 1025011, 'Pooja, Sir', 'Crime', 'Grand Public', 'Pooja, une policière népalaise à la peau claire, est la première femme détective du pays. Elle est confrontée à sa première affaire dans une ville frontalière. Alors que des dizaines de milliers de personnes manifestent dans les rues pour protester contre la discrimination systémique dont sont victimes les Madhesi à la peau foncée, deux garçons à la peau claire ont été kidnappés et une rançon impossible à obtenir leur a été demandée. Pooja n''a que 48 heures pour sauver les garçons.', '2025-07-23 00:00:00', 109, 0, 'US', 'https://image.tmdb.org/t/p/w500/fmM6eEVJksrmzrvRg3jCrnLuxCD.jpg', NULL, NULL, 'Asha Magrati, Nikita Chandak, Dayahang Rai, Aarti Mandal', NULL, 'https://www.youtube.com/watch?v=cb-SzUM4K8o', 1, 76, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (89, 1083433, 'Souviens-toi… l''été dernier', 'Horreur', 'Grand Public', 'Une nouvelle version du film d''horreur "Souviens-toi l''été dernier".', '2025-07-16 00:00:00', 115, 0, 'US', 'https://image.tmdb.org/t/p/w500/mLKQtg75oAx3L5prBuzfr7zWQBw.jpg', NULL, NULL, 'Chase Sui Wonders, Madelyn Cline, Jonah Hauer-King, Tyriq Withers', NULL, 'https://www.youtube.com/watch?v=UoDwZVpcd1M', 1, 86, '2025-07-18 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (66, 1131460, 'Gangs of Taïwan', 'Drame', 'Grand Public', 'À Taïwan, Zhong-Han, un jeune homme mutique d''une vingtaine d''années, mène une double vie. Employé dans un restaurant familial le jour, il rackette en bande la nuit pour le compte de parrains locaux. Mais le rachat du restaurant par un homme d''affaires véreux met en danger ses proches, et oblige Zhong-Han à affronter son propre gang.', '2025-07-30 00:00:00', 135, 0, 'TW', 'https://image.tmdb.org/t/p/w500/brVumOSCDdNujXxux9916Pezg1c.jpg', NULL, NULL, 'Wilson Liu, Rimong Ihwar, Devin Pan, Yu An-Shun', NULL, 'https://www.youtube.com/watch?v=T7jCxObxOGM', 1, 63, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (78, 1138476, 'En boucle', 'Comédie', 'Grand Public', 'L''auberge centenaire Fujiya se dresse dans la paisible région de Kyoto. Mikoto se tient devant la rivière Kibune à l''arrière du bâtiment lorsqu''elle est rappelée au travail. Mais deux minutes plus tard, elle se retrouve de nouveau à la rivière. Toute l''auberge semble être coincée dans une boucle temporelle !', '2025-08-13 00:00:00', 86, 0, 'JP', 'https://image.tmdb.org/t/p/w500/3Nta7iiVB9SCA9VHSzjOzrqWyje.jpg', '', 0, 'Riko Fujitani, Yuki Torigoe, Munenori Nagano, Takashi Sumita', NULL, 'https://www.youtube.com/watch?v=xPlQyLuYGhQ', 1, 75, '2023-06-23 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (325, 1303398, 'L''Évangile de la révolution', 'Documentaire', 'Documentaire', 'Le souffle révolutionnaire qu’a connu l’Amérique latine au XXe siècle doit beaucoup à la participation de millions de chrétiens, engagés dans les luttes politiques au nom de leur foi. Portés par la théologie de la libération, ils ont défié les régimes militaires et les oligarchies au péril de leur vie. À rebours de l’idée de la religion comme opium du peuple, le film part à la rencontre d’hommes et de femmes qui ont cru voir dans la révolution l’avènement du Royaume de Dieu, sur la terre plutôt qu’au ciel.', '2025-09-03 00:00:00', 115, 0, 'FR', 'https://image.tmdb.org/t/p/w500/oMFVBgWh0xPNCRwiB4KWsHfaE4O.jpg', NULL, NULL, '', NULL, 'https://www.youtube.com/watch?v=KFmE0oFmmIA', 319, 319, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (70, 1367997, 'Perla', 'Drame', 'Art et Essai', 'Vienne, années 1980, la vie d''une artiste dissidente est bouleversée par la réapparition de son ancien partenaire sortant de prison.', '2025-07-30 00:00:00', 108, 0, 'AT', 'https://image.tmdb.org/t/p/w500/b1eGvYzYepSSQAmR0VfCkLHc5dj.jpg', NULL, NULL, 'Rebeka Poláková, Simon Schwarz, Carmen Diego, Noël Czuczor', NULL, NULL, 1, 67, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (173, 1178602, 'Miroirs No. 3', 'Drame', 'Art et Essai', 'Lors d''un week-end à la campagne, Laura, étudiante à Berlin, survit miraculeusement à un accident de voiture. Physiquement épargnée mais profondément secouée, elle est recueillie chez Betty, qui a été témoin de l''accident et s’occupe d’elle avec affection. Peu à peu, le mari et le fils de Betty surmontent leur réticence, et une quiétude quasi familiale s’installe. Mais bientôt, ils ne peuvent plus ignorer leur passé, et Laura doit affronter sa propre vie.', '2025-08-27 00:00:00', 86, 0, 'DE', 'https://image.tmdb.org/t/p/w500/A434PrBdY5l1ZhMydqXouJCnaq9.jpg', '', 7, 'Paula Beer, Barbara Auer, Matthias Brandt, Enno Trebs', NULL, 'https://www.youtube.com/watch?v=KEiZa4E8r38', 1, 168, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (342, 1509129, 'Last Train - Les Eurockéennes de Belfort 2025', 'Musique', 'Art et Essai', 'Originaire d’Alsace, ce groupe de rock français est reconnu pour ses prestations live puissantes et son énergie brute. Il incarne avec force le renouveau du rock indépendant européen. Formé à l’adolescence par quatre amis d’enfance, Last Train s’est rapidement imposé comme l’un des groupes live les plus intenses de sa génération.', '2025-07-05 00:00:00', 81, 0, 'FR', 'https://image.tmdb.org/t/p/w500/1VQAEjX3WyYYm6B7KGulNUUXKnj.jpg', NULL, NULL, 'Jean-Noël Scherrer, Timothée Gérard, Antoine Baschung, Julien Peultier', NULL, NULL, 1, 339, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (343, 1509190, 'Entre duel et duo - Jean-François Zygel & André Manoukian en concert au Festival les Baux Pianos', 'Musique', 'Art et Essai', 'Dans ce nouveau spectacle « Entre duel et duo », Jean-François Zygel et André Manoukian s’affrontent piano contre piano dans le cadre idyllique de l’esplanade du châteauINSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (74, 1261605, 'Comme des riches', 'Comédie', 'Grand Public', 'Deux amis travaillent sur un yacht de luxe au cœur de Saint-Tropez. Ils mènent une vie glamour, se faisant passer pour des propriétaires de yachts. Leur vie quotidienne insouciante est perturbée par Chloé, envoyée par le propriétaire oligarque pour vendre le navire à des princes du Moyen-Orient. Et puis ils élaborent un plan brillant : persuader leurs amis de Paris de se faire passer pour ces mêmes princes de l''Est et de s''amuser le week-end afin de ruiner l''affaire.', '2025-07-23 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/tJnWdyWvSM1dpJm8vir1MXLH2k.jpg', NULL, NULL, 'Philippe Katerine, Brahim Bouhlel, Youssef Hajdi, Fehdi Bendjima', NULL, 'https://www.youtube.com/watch?v=Y2P1LZVix5s', 1, 71, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (77, 1193440, 'Aux jours qui viennent', 'Drame', 'Grand Public', 'Nice, de nos jours. Laura, la trentaine, essaie de se reconstruire après une relation tumultueuse avec Joachim. Elle mène une vie en apparence tranquille, en élevant seule sa petite fille. Mais l’accident de Shirine, la nouvelle compagne de Joachim, va faire ressurgir son passé. Les deux femmes, en proie à la violence du même homme, vont peu à peu se soutenir…', '2025-07-23 00:00:00', 100, 0, 'FR', 'https://image.tmdb.org/t/p/w500/mHLF6T2Oy9MoR54TJ91pi9PVDq.jpg', NULL, NULL, 'Zita Hanrot, Bastien Bouillon, Alexia Chardard, Marianne Basler', NULL, 'https://www.youtube.com/watch?v=IUAYzma-gfY', 1, 74, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (73, 1285965, 'Dangerous Animals', 'Horreur', 'Grand Public', 'Zephyr, une surfeuse intrépide au tempérament libre est kidnappée par un tueur en série obsédé par les requins. Séquestrée sur son bateau et confrontée à la folie de son ravisseur, elle va devoir se battre pour survivre face à tous les prédateurs…', '2025-07-23 00:00:00', 93, 0, 'US', 'https://image.tmdb.org/t/p/w500/fVZxvR7Vth5UOIXSlrbcJKF9O4g.jpg', NULL, NULL, 'Hassie Harrison, Jai Courtney, Josh Heuston, Ella Newton', NULL, 'https://www.youtube.com/watch?v=o90AF-pHAtY', 1, 70, '2025-06-06 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (97, 1314452, 'Other', 'Horreur', 'Grand Public', 'Lorsque sa mère meurt brutalement, Alice, qui avait rompu tous les ponts depuis des années, se voit contrainte de rentrer chez elle pour régler les démarches funéraires. Elle renoue, malgré elle, avec une jeunesse traumatique quand elle revient dans cette maison où rien, pas même sa chambre d’adolescente, ne semble avoir changé... si ce n’est cet étrange système de vidéosurveillance très sophistiqué, ou cette ombre qui rôde alentour. Le passé ne s’enfouit pas si facilement, surtout quand il est aussi monstrueux.', '2025-07-09 00:00:00', 95, 0, 'BE', 'https://image.tmdb.org/t/p/w500/ouNcK16DGlNrih2f2LbHXTRmVOA.jpg', NULL, NULL, 'Olga Kurylenko, Jean Schatz, Philip Schurer, Ange Nawasadio', NULL, 'https://www.youtube.com/watch?v=EjfUtcCnxu0', 1, 94, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (99, 1154304, 'Buffalo Kids', 'Animation', 'Jeunesse', 'En 1886 en Amérique, Mary et Tom, une sœur et un frère âgés de 9 ans et 12 ans, arrivent dans la cohue new-yorkaise à bord d''un paquebot. Ils sont là pour rencontrer leur oncle Niall et assurer leur héritage. Mais quand Oncle Niall manque leur rendez-vous, ils décident d''embarquer sur le Transcontinental dans l''espoir de parvenir jusqu''en Californie pour le retrouver.', '2025-07-09 00:00:00', 83, 0, 'ES', 'https://image.tmdb.org/t/p/w500/4H60622NXlC1FHvRwGnx2BodVkB.jpg', NULL, NULL, 'Mia Pérez Ullod, Jaume Solà, Javier Cassi Gimeno, Federico Bote Bubaila', NULL, 'https://www.youtube.com/watch?v=B0OsdEnkFnw', 1, 96, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (82, 605320, 'My Father''s Son', 'Drame', 'Art et Essai', 'Qiao, 18 ans, vient de terminer ses examens d''entrée à l''université lorsqu''il apprend la mort de son père, brutal et secret, qui lui a légué une passion pour la boxe. Des années plus tard, devenu ingénieur, Qiao développe un logiciel d''entraînement de boxe utilisant l’intelligence artificielle. Il modélise un adversaire virtuel reprenant les traits de son père, qui bientôt lui échappe…', '2025-07-23 00:00:00', 109, 0, 'CN', 'https://image.tmdb.org/t/p/w500/kOo1DJMxcymK94cLixdw7QUGTzG.jpg', NULL, NULL, 'Song Yang, Sun Ning, Sun Anke, Tong Chenjie', NULL, 'https://www.youtube.com/watch?v=Ds2atcod-Nw', 1, 79, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (65, 1175942, 'Les Bad Guys 2', 'Familial', 'Jeunesse', 'Les criminels animaliers s''efforcent de se faire à leur nouvelle vie de gentils. Bientôt, ils sont tirés de leur retraite et forcés de faire "un dernier travail" par une équipe entièrement féminine.', '2025-07-30 00:00:00', 104, 0, 'US', 'https://image.tmdb.org/t/p/w500/opKf1uITVUkm8nteNM54uIgJZKQ.jpg', NULL, NULL, 'Sam Rockwell, Marc Maron, Craig Robinson, Anthony Ramos', NULL, 'https://www.youtube.com/watch?v=qAi8EXkABEE', 1, 62, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (69, 918287, 'Sam fait plus rire', 'Drame', 'Grand Public', 'Sam, une jeune comédienne et jeune fille au pair souffrant de stress post-traumatique, se demande si elle doit ou non participer aux recherches de Brooke, une fillette disparue dont elle était la nounou.', '2025-07-30 00:00:00', 106, 2000000, 'CA', 'https://image.tmdb.org/t/p/w500/xFXB4N7wuw0BLRAcLSLj1yoKgdP.jpg', NULL, NULL, 'Rachel Sennott, Olga Petsa, Jason Jones, Sabrina Jalees', NULL, 'https://www.youtube.com/watch?v=wtVSWnofryc', 1, 66, '2024-06-07 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (96, 1319196, 'Jeunesse (Retour au pays)', 'Documentaire', 'Documentaire', 'Le Nouvel An approche et les ateliers textiles de Zhili sont quasi-déserts. Les quelques ouvriers qui restent peinent à se faire payer avant de partir. Des rives du Yangtze aux montagnes du Yunnan, tout le monde rentre célébrer la nouvelle année dans sa ville natale. Pour Shi Wei, c’est aussi l’occasion de se marier, ainsi que pour Fang Lingping. Son mari, ancien informaticien, devra la suivre à Zhili après la cérémonie. L’apprentissage est rude mais ne freine pas l’avènement d’une nouvelle génération d’ouvriers.', '2025-07-09 00:00:00', 154, 0, 'FR', 'https://image.tmdb.org/t/p/w500/fy4FZhP4NV4Mmm9G3MfeZ0Pcjmc.jpg', NULL, NULL, '', NULL, 'https://www.youtube.com/watch?v=-d2VD2Bl8Hc', 1, 93, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (344, 960051, 'Furcy, né libre', 'Histoire', 'Art et Essai', 'Île de la Réunion, 1817. À la mort de sa mère, l''esclave Furcy découvre des documents qui pourraient faire de lui un homme libre. Avec l’aide d’un procureur abolitionniste, il se lance dans une bataille judiciaire pour la reconnaissance de ses droits. Inspiré d’une histoire vraie.', '2026-01-14 00:00:00', 108, 0, 'FR', '', NULL, NULL, 'Makita Samba, Romain Duris, Ana Girardot, Vincent Macaigne', NULL, NULL, 1, 342, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (314, 1379266, 'Le Maître du Kabuki', 'Drame', 'Art et Essai', 'Nagasaki, 1964 - A la mort de son père, chef d’un gang de yakuzas, Kikuo, 14 ans, est confié à un célèbre acteur de kabuki. Aux côtés de Shunsuke, le fils unique de ce dernier, il décide de se consacrer à ce théâtre traditionnel. Durant des décennies, les deux jeunes hommes évoluent côte à côte, de l’école du jeu aux plus belles salles de spectacle, entre scandales et gloire, fraternité et trahisons... L''un des deux deviendra le plus grand maître japonais de l''art du kabuki.', '2026-01-07 00:00:00', 174, 0, 'JP', 'https://image.tmdb.org/t/p/w500/bPuH9nB995PE3P9j4sTanWsxfUW.jpg', NULL, NULL, 'Ryo Yoshizawa, Ryusei Yokohama, Mitsuki Takahata, Shinobu Terajima', NULL, NULL, 308, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (345, 1221061, 'In die Sonne schauen', 'Drame', 'Art et Essai', 'Quatre filles de quatre décennies différentes grandissent ensemble dans une ferme et semblent être liées les unes aux autres.', '2026-01-07 00:00:00', 159, 0, 'DE', 'https://image.tmdb.org/t/p/w500/zL5xJWVucxZ3j8PA3DY0xIeVjge.jpg', NULL, NULL, 'Luise Heyer, Lena Urzendowsky, Claudia Geisler-Bading, Lea Drinda', NULL, 'https://www.youtube.com/watch?v=rwVkvvVu0-c', 1, 344, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (76, 1205515, 'Sorry, Baby', 'Drame', 'Grand Public', 'Quelque chose est arrivé à Agnès. Tandis que le monde avance sans elle, son amitié avec Lydie demeure un refuge précieux. Entre rires et silences, leur lien indéfectible lui permet d''entrevoir ce qui vient après.', '2025-07-23 00:00:00', 104, 0, 'US', 'https://image.tmdb.org/t/p/w500/iq1QtN1H8AVEBfl1SgNAqhMgTbQ.jpg', NULL, NULL, 'Eva Victor, Naomi Ackie, Lucas Hedges, Louis Cancelmi', NULL, 'https://www.youtube.com/watch?v=ju8sMjH_hfo', 1, 73, '2025-07-04 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (100, 1151082, 'In the Summers', 'Drame', 'Art et Essai', 'Vio­le­ta et Eva rendent visite chaque été à leur père Vicente, à la fois aimant et témé­raire. Il crée un monde mer­veilleux mais, der­rière la façade enjouée, lutte contre l’addiction qui érode pro­gres­si­ve­ment la magie. Vicente essaie de répa­rer les erreurs du pas­sé, mais les plaies ne sont pas faciles à refermer…', '2025-07-09 00:00:00', 95, 0, 'US', 'https://image.tmdb.org/t/p/w500/nyZ0IvkSjoU7ShhLh1wjfVz0QXN.jpg', NULL, NULL, 'Residente, Sasha Calle, Lio Mehiel, Dreya Renae Castillo', NULL, 'https://www.youtube.com/watch?v=rxqixUAI0TY', 1, 97, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (92, 936108, 'Les Schtroumpfs', 'Animation', 'Jeunesse', 'Lorsque le Grand Schtroumpf est mystérieusement kidnappé par les vilains sorciers : Razamel et Gargamel, la Schtroumpfette et son meilleur ami Le Schtroumpf Sans-Nom partent en mission pour le retrouver ! Commence alors une aventure délirante où nos héros bleus vont croiser la route de nouveaux amis hauts en couleur comme Mama Poot et ses petits. Les Schtroumpfs doivent prendre en main leur destin pour sauver celui du monde entier !', '2025-07-16 00:00:00', 92, 0, 'US', 'https://image.tmdb.org/t/p/w500/1Ee26rIanprYQAwnQEDw1331cp4.jpg', NULL, NULL, 'Rihanna, James Corden, Nick Offerman, JP Karliak', NULL, 'https://www.youtube.com/watch?v=2OYDrsAn0eE', 1, 89, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (104, 997519, 'Arnon - un élève modèle', 'Drame', 'Grand Public', 'Arnon est un élève brillant qui vit seul à Bangkok. Son école est l’une des meilleures du pays et les pots de vin pour y entrer y sont monnaie courante. Un jour, il rencontre Bee un jeune délinquant qui a mis en place un système permettant aux élèves de tricher à leur examen d’entrée en échange d’une certaine somme. Bien que sceptique au départ, Arnon le rejoint et découvre le monde de la corruption en Thaïlande. Pendant ce temps, la révolte s''organise.', '2025-07-09 00:00:00', 83, 0, 'FR', 'https://image.tmdb.org/t/p/w500/pGmaUmqx74m28Y2aTqMop93hMxG.jpg', NULL, NULL, 'Korndanai Marc Dautzenberg, Siriboon Naddhabhan, Winyu Wongsurawat, Chayut Anantapong', NULL, 'https://www.youtube.com/watch?v=YWoWGAJuG6o', 1, 101, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (91, 977548, 'Segundo premio', 'Drame', 'Art et Essai', 'Fin des années 90, Grenade est en pleine effervescence culturelle. Los Planetas, le groupe de rock espagnol culte, est sur le point de se séparer. Mario, un jeune étudiant mélomane, est le témoin privilégié de cette rupture imminente. Plongé au cœur de leurs tensions, il jouera un rôle dans l''histoire mythique de ce groupe.', '2025-07-16 00:00:00', 110, 0, 'ES', 'https://image.tmdb.org/t/p/w500/e2eQxBsDxoqpaYUy5yZosvrBuVz.jpg', NULL, NULL, 'Daniel Ibáñez, Cristalino, Stéphanie Magnin, Eduardo Rejón', NULL, 'https://www.youtube.com/watch?v=2GrCnVuIBhM', 1, 88, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (346, 1376415, 'L’affaire Bojarski', 'Histoire', 'Art et Essai', 'Jan Bojarski, un jeune réfugié Polonais, devient dans la France de l’après-guerre le plus grand faux-monnayeur de tous les temps, le "Cézanne de la fausse monnaie". Comment cet homme mènera pendant plus de quinze ans une double vie à l’insu de sa famille en fabriquant seul dans un cabanon au fond de son jardin des contrefaçons plus "vraies" que les billets sortis de la Banque de France… Comment pendant toutes ces années, ce faussaire hors-pair réussira à éviter de tomber dans les filets de la Police et deviendra la bête noire du Commissaire Mattei au cours d’une traque qui, pour ces deux obsessionnels, tournera au duel.', '2026-01-14 00:00:00', 0, 0, 'FR', '', NULL, NULL, 'Reda Kateb, Sara Giraudeau, Bastien Bouillon, Quentin Dolmaire', NULL, NULL, 1, 340, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (350, 1042910, 'Les Saisons', 'Documentaire', 'Documentaire', '', '2025-12-03 00:00:00', 82, 0, 'AT', 'https://image.tmdb.org/t/p/w500/oL8Ta7NQQpJdGnkwS4qL3Fhz1CU.jpg', NULL, NULL, 'Simão Ramalho, Cláudio da Silva, Ana Potra, Manuel Leitão', NULL, NULL, 1, 346, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (93, 648878, 'Eddington', 'Western', 'Grand Public', 'Mai 2020 à Eddington, petite ville du Nouveau Mexique, la confrontation entre le shérif et le maire met le feu aux poudres en montant les habitants les uns contre les autres.', '2025-07-16 00:00:00', 145, 0, 'US', 'https://image.tmdb.org/t/p/w500/8yA7esHh0L3vOl60Qyf4mfBTmMh.jpg', NULL, NULL, 'Joaquin Phoenix, Pedro Pascal, Emma Stone, Austin Butler', NULL, 'https://www.youtube.com/watch?v=LqQ3gjhXc-U', 1, 90, '2025-07-18 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (95, 1477279, 'I Love Peru', 'Documentaire', 'Documentaire', 'Lancé dans une course effrénée vers le succès, un comédien biscornu abandonne ses plus fidèles alliés. Seul face à lui-même, une vision troublante le percute. Direction le Pérou pour une aventure spirituelle.', '2025-07-09 00:00:00', 68, 0, 'FR', 'https://image.tmdb.org/t/p/w500/9lK7aJkx2QvkdxyEixN7X80Uzkk.jpg', NULL, NULL, 'Raphaël Quenard, Hugo David, Anaïde Rozam, José Garcia', NULL, 'https://www.youtube.com/watch?v=qM3UjJVelAU', 1, 92, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (105, 947595, 'Rock Bottom', 'Animation', 'Jeunesse', 'À partir de l''album mythique de Robert Wyatt, ROCK BOTTOM nous plonge dans l''histoire d''amour vertigineuse de Bob et Alif, deux jeunes artistes de la culture hippie du début des années 1970.', '2025-07-09 00:00:00', 86, 0, 'ES', 'https://image.tmdb.org/t/p/w500/rDnEd3u0EBOOYEBGYCpqRTqYu0.jpg', NULL, NULL, 'Laura Casaña, Fermí Delfa, Omar Sanchís Gomez, Roger Riu Gasso', NULL, 'https://www.youtube.com/watch?v=38tTx4D24x4', 1, 102, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (347, 1220564, 'L’Agent secret', 'Drame', 'Grand Public', '1977, Brésil. Marcelo, un homme d’une quarantaine d’années fuyant un passé trouble, arrive dans la ville de Recife où il espère construire une nouvelle vie et renouer avec sa famille. C’est sans compter sur les menaces de mort qui rôdent et planent au-dessus de sa tête…', '2026-01-14 00:00:00', 158, 0, 'BR', 'https://image.tmdb.org/t/p/w500/9nkeIlEkx5BXv4QEi5hwCaiVEyd.jpg', NULL, NULL, 'Wagner Moura, Carlos Francisco, Tânia Maria, Robério Diógenes', NULL, 'https://www.youtube.com/watch?v=pprqFcZJheU', 1, 341, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (101, 1103551, 'Le Rire et le couteau', 'Drame', 'Art et Essai', 'Sergio voyage dans une métropole d''Afrique de l''Ouest pour travailler comme ingénieur environnemental sur la construction d''une route entre le désert et la forêt. Il se lie à deux habitants de la ville, Diara et Gui, dans une relation intime mais déséquilibrée. Il apprend bientôt qu''un ingénieur italien, affecté à la même mission que lui quelques mois auparavant, a mystérieusement disparu.', '2025-07-09 00:00:00', 211, 0, 'BR', 'https://image.tmdb.org/t/p/w500/e73SipJBMkBqH1ws8lmmnQxzmHR.jpg', NULL, NULL, 'Sérgio Coragem, Cleo Diára, Jonathan Guilherme, Jorge Quintino Biague', NULL, 'https://www.youtube.com/watch?v=1DnOYuwE1oo', 1, 98, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (102, 1061474, 'Superman', 'Action', 'Grand Public', 'Superman doit trouver l’équilibre entre ses racines kryptoniennes et son identité humaine, sous les traits de Clark Kent, originaire de Smallville, dans le Kansas. Il est l’incarnation de la vérité, de la justice et des valeurs américaines et il est animé par une véritable bienveillance dans un monde qui considère cette qualité comme obsolète.', '2025-07-09 00:00:00', 129, 225000000, 'US', 'https://image.tmdb.org/t/p/w500/bL1U8TDb2ZiThIBFAdKHOfpv8lk.jpg', NULL, NULL, 'David Corenswet, Rachel Brosnahan, Nicholas Hoult, Edi Gathegi', NULL, 'https://www.youtube.com/watch?v=-ouFFSOyo_o', 1, 99, '2025-07-11 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (75, 1217365, 'Chroniques fidèles survenues au siècle dernier à l’hôpital psychiatrique Blida-Joinville, au temps où le Docteur Frantz Fanon était chef de la cinquième division entre 1953 et 1956', 'Histoire', 'Documentaire', 'Frantz Fanon était un homme politique renommé et un militant de la décolonisation. Ce dossier se concentre sur ses méthodes visionnaires de thérapie sociale pendant sa période de psychiatre en Algérie de 1953 à 1956. Un morceau d''humanisme universel.', '2025-07-23 00:00:00', 91, 0, 'DZ', 'https://image.tmdb.org/t/p/w500/vzB9t4F27GectroWtOucTq4JoP5.jpg', NULL, NULL, 'Alexandre Desane, Frantz Fanon, Gérard Dubouche, Nicolas Dromard', NULL, 'https://www.youtube.com/watch?v=kTjU9FQZLPM', 1, 72, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (134, 1392527, 'Renoir', 'Drame', 'Art et Essai', 'Tokyo, 1987. Fuki, 11 ans, vit entre un père hospitalisé et une mère débordée et absente. Un été suspendu commence pour Fuki, entre solitude, rituels étranges et élans d’enfance. Le portrait d’une fillette à la sensibilité hors du commun, qui cherche à entrer en contact avec les vivants, les morts, et peut-être avec elle-même.', '2025-09-17 00:00:00', 120, 0, 'FR', 'https://image.tmdb.org/t/p/w500/l8SW5j7bQbw7QRUKQA3wK8CDdJv.jpg', '', NULL, 'Yui Suzuki, Hikari Ishida, Lily Franky, Ayumu Nakajima', NULL, 'https://www.youtube.com/watch?v=GzIK65JIwMA', 1, 129, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (64, 1246049, 'Dracula', 'Horreur', 'Art et Essai', 'Au XVe siècle, le Prince Vladimir renie Dieu après la perte brutale et cruelle de son épouse. Il hérite alors d’une malédiction : la vie éternelle. Il devient Dracula. Condamné à errer à travers les siècles, il n’aura plus qu’un seul espoir : celui de retrouver son amour perdu.', '2025-07-30 00:00:00', 0, 40000000, 'FR', 'https://image.tmdb.org/t/p/w500/juUIOcOQ0ip9qw3ecH9IBEQklEp.jpg', NULL, NULL, 'Caleb Landry Jones, Christoph Waltz, Zoë Bleu Sidel, Matilda De Angelis', NULL, 'https://www.youtube.com/watch?v=lgIkwzR_0qs', 1, 61, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (67, 1053927, 'Eternal', 'Science-Fiction', 'Grand Public', 'Elias et Anita sont jeunes et amoureux. Elias a un jour l’opportunité de réaliser son rêve en devenant scientifique, mais il doit partir et quitter Anita. Des années plus tard, il rejoint une mission périlleuse autour d’une fracture sous-marine. À son contact, d’étranges visions le bouleversent et lui révèlent une autre réalité. Quelle aurait été sa vie s’il avait fait des choix différents ?', '2025-07-30 00:00:00', 102, 0, 'DK', 'https://image.tmdb.org/t/p/w500/9564tzWS6csbsLhUxsz4EiziVZA.jpg', NULL, NULL, 'Simon Sears, Nanna Øland Fabricius, Viktor Hjelmsøe, Anna Søgaard Frandsen', NULL, 'https://www.youtube.com/watch?v=ETJAMr7e7EE', 1, 64, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (125, 1313211, 'Classe moyenne', 'Comédie', 'Grand Public', 'Mehdi a prévu de passer un été tranquille dans la somptueuse demeure de ses beaux-parents. Mais dès son arrivée, un conflit éclate entre la famille de sa fiancée et le couple de gardiens de la villa. Comme Mehdi est issu d’un milieu modeste, il pense pouvoir mener les négociations entre les deux parties et ramener tout le monde à la raison. Pourtant, tout s’envenime…', '2025-09-24 00:00:00', 96, 0, 'BE', 'https://image.tmdb.org/t/p/w500/zchwrcgBr0Cpvya6qHFTsDJFiYS.jpg', '', 7, 'Laurent Lafitte, Élodie Bouchez, Ramzy Bedia, Laure Calamy', NULL, 'https://www.youtube.com/watch?v=DAKXR16cDdE', 1, 120, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (123, 1410189, 'Kontinental ''25', 'Drame', 'Art et Essai', 'Nouveau film de Radu Jude.', '2025-09-24 00:00:00', 109, 0, 'RO', 'https://image.tmdb.org/t/p/w500/9NMekIITIoYAHmyYA0iPEQYNZ7e.jpg', NULL, NULL, 'Eszter Tompa, Gabriel Spahiu, Adonis Tanța, Oana Mardare', NULL, 'https://www.youtube.com/watch?v=b8-j8_kCg1A', 1, 118, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (132, 986097, 'HIM', 'Horreur', 'Art et Essai', 'Un jeune athlète prometteur est invité à s''entraîner avec la star d''une équipe bientôt à la retraite.', '2025-09-24 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/3T4yN4GgmwdQom1kCiO8v1fwsHC.jpg', NULL, NULL, 'Tyriq Withers, Marlon Wayans, Julia Fox, Tim Heidecker', NULL, 'https://www.youtube.com/watch?v=ccmQETThJgs', 1, 127, '2025-09-19 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (87, 1158915, 'Dìdi', 'Comédie', 'Grand Public', 'En 2008, un mois avant le début du lycée, un jeune américain taïwanais de 13 ans, très impressionnable, apprend ce que sa famille ne peut pas lui enseigner : comment patiner, comment flirter et comment aimer sa mère.', '2025-07-16 00:00:00', 93, 0, 'US', 'https://image.tmdb.org/t/p/w500/dg151xqjJdecw7biwl9UtG1RMui.jpg', NULL, NULL, 'Izaac Wang, Joan Chen, Shirley Chen, Chang Li Hua', NULL, 'https://www.youtube.com/watch?v=FUUgmNahIEY', 1, 84, '2024-08-09 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (348, 891584, 'The History of Sound', 'Drame', 'Art et Essai', 'Pendant la Première Guerre mondiale, deux jeunes hommes, Lionel et David, entreprennent d''enregistrer les vies, les voix et la musique de leurs compatriotes américains...', '2026-01-14 00:00:00', 127, 0, 'US', 'https://image.tmdb.org/t/p/w500/jYITiE66gZ3qjKSWzCQIuxqXqTB.jpg', NULL, NULL, 'Paul Mescal, Josh O''Connor, Molly Price, Alison Bartlett', NULL, NULL, 1, 343, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (349, 1383289, 'Laurent dans le vent', 'Comédie', 'Grand Public', 'À 29 ans, Laurent cherche un sens à sa vie. Sans travail ni logement, il atterrit dans une station de ski déserte hors-saison et s’immisce dans la vie des rares habitant·es qu’il rencontre. Quand les touristes arrivent avec l’hiver, Laurent ne peut plus repartir.', '2025-12-03 00:00:00', 110, 0, 'FR', 'https://image.tmdb.org/t/p/w500/gkldBQmO33rAcFFy5uKFi9PX0sY.jpg', NULL, NULL, 'Baptiste Perusat, Béatrice Dalle, Djanis Bouzyani, Thomas Daloz', NULL, NULL, 1, 345, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (336, 701387, 'Bugonia', 'Comédie', 'Grand Public', 'Deux jeunes hommes obsédés par les théories du complot kidnappent la PDG d’une grande entreprise, convaincus qu’elle est une extraterrestre déterminée à détruire la planète Terre.', '2025-11-12 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/nQslTGVHhk1eGUEfjeWUJmz8apd.jpg', NULL, NULL, 'Emma Stone, Jesse Plemons, Aidan Delbis, Stavros Halkias', NULL, 'https://www.youtube.com/watch?v=jFUCzZHeksc', 1, 333, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (86, 1172244, 'Mond', 'Drame', 'Grand Public', 'Sarah est une ancienne kickboxeuse professionnelle de Vienne. Elle accepte de travailler comme coach pour une riche famille du Moyen-Orient. Elle se retrouve dans un palais entouré de murs et coupé d''Internet, où les sœurs sont surveillées en permanence. Elles n''ont aucune envie d''apprendre à boxer. Alors pourquoi Sarah a-t-elle été amenée ici ?', '2025-07-16 00:00:00', 92, 0, 'AT', 'https://image.tmdb.org/t/p/w500/s1NmH3zf8dyBssxHOLsWQes8Nim.jpg', NULL, NULL, 'Florentina Holzinger, Andria Tayeh, Celina Antwan, Nagham Abu Baker', NULL, 'https://www.youtube.com/watch?v=w8lH85vp_t8', 1, 83, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (235, 1421401, 'Les parfait(s)', 'Comédie', 'Grand Public', 'Chez les Toussaint, du grand-père au petit dernier, l’arnaque est un art qui rapporte. Poursuivis, ils doivent fuir. Seule option ? Emprunter l’identité d’une famille sans histoire - les Parfait - et se réfugier...en Écosse. Entre des collègues trop curieux et une mystérieuse voisine, leur double vie va rapidement se compliquer : les faux Parfait se retrouvent face au coup d’une vie. Plans démentiels, déguisements fous, gadgets étonnants : pour réussir, notre famille pas comme les autres va devoir prouver qu’elle est plus que parfaite.', '2025-12-24 00:00:00', 0, 0, 'FR', '', NULL, NULL, 'Audrey Fleurot, Ramzy Bedia, Alexandre Desrousseaux, Bert Seymour', NULL, NULL, 1, 230, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (160, 1266813, 'Adieu, Jean-Pat', 'Drame', 'Grand Public', 'Au moment de s’engager vraiment avec Alice, Etienne, 35 ans, a un doute : et s’il était passé à côté de sa vie ? Pour en avoir le coeur net, il entreprend de retrouver Magali, son grand amour d’enfance, en appelant Jean-Pat, son ancien rival… mais celui-ci meurt pendant le coup de fil. Et voilà Etienne embarqué dans l’organisation des obsèques de son pire ennemi.', '2025-09-03 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/spivccL871NfTV9AAkoykRfidiY.jpg', '', 7, 'Hakim Jemili, Constance Labbé, Nora Hamzawi, Valérie Karsenti', NULL, 'https://www.youtube.com/watch?v=zI24JlU35R0', 1, 155, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (147, 1421157, 'Premières classes', 'Documentaire', 'Documentaire', '', '2025-09-10 00:00:00', 125, 0, 'LU', 'https://image.tmdb.org/t/p/w500/b49YNh0qTTBbxS7IP4sWdypTKoP.jpg', NULL, NULL, 'Olha Bryhynets, Borys Khovriak, Mykola Kolomiiets, Valeriia Hukova', NULL, 'https://www.youtube.com/watch?v=5xPjzNrPsRg', 1, 142, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (169, 1245993, 'Pris au piège', 'Crime', 'Grand Public', 'Un ancien joueur de baseball Hank Thompson, plonge dans le milieu criminel du New York des années 1990.', '2025-08-27 00:00:00', 109, 0, 'US', 'https://image.tmdb.org/t/p/w500/3Ba53oZxqM7qOj7ZCGGxkY9GDE4.jpg', NULL, NULL, 'Austin Butler, Zoë Kravitz, Regina King, Matt Smith', NULL, 'https://www.youtube.com/watch?v=6YDbJ1ujgnI', 1, 164, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (139, 1242426, 'Regarde', 'Comédie', 'Grand Public', 'Chris et Antoine ont bien du mal à s’entendre depuis leur divorce. Mais, lorsqu’on leur annonce que leur fils de 16 ans est atteint d’une maladie rare, qui va lui faire perdre la vue, ils s’efforcent de mettre leurs rancœurs de côté. Les ex-conjoints embarquent leur fils pour des vacances inoubliables, bien décidés à lui offrir ses plus beaux souvenirs.', '2025-09-17 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/5mF6VQyjZiVZnNH3uRDtcAkOSr5.jpg', '', 8, 'Audrey Fleurot, Dany Boon, Nicolas Marié, Manon Villa', NULL, 'https://www.youtube.com/watch?v=9GRIQLr1o-U', 1, 134, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (130, 1054867, 'Une bataille après l''autre', 'Comédie', 'Grand Public', 'Une bande d''anciens révolutionnaires se réunit pour sauver la fille de l''un des leurs quand leurs ennemis refont surface après 16 ans.', '2025-09-24 00:00:00', 170, 110000000, 'US', 'https://image.tmdb.org/t/p/w500/oklJLdtqpUOEfdxBMfCgqFNw744.jpg', 'd''office', NULL, 'Leonardo DiCaprio, Sean Penn, Benicio del Toro, Regina Hall', NULL, 'https://www.youtube.com/watch?v=0yXndop7g4Q', 1, 125, '2025-09-26 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (138, 1284493, 'Les tourmentés', 'Drame', 'Grand Public', 'Ça vaut quoi la vie d’un homme ? D’un homme comme lui. Un homme sans rien. Skender, ancien légionnaire, le découvrira bien assez tôt. "Madame", veuve fortunée et passionnée de chasse, s’ennuie. Elle charge alors son majordome d’une terrible mission. Lui trouver un candidat pour une chasse à l’homme moyennant un très juteux salaire. Skender est le gibier idéal. Mais rien ne se passera comme prévu...', '2025-09-17 00:00:00', 100, 0, 'BE', 'https://image.tmdb.org/t/p/w500/1Ou4upkLdTaf0765BSSgUfluNUf.jpg', NULL, NULL, 'Niels Schneider, Linh-Dan Pham, Ramzy Bedia, Déborah François', NULL, 'https://www.youtube.com/watch?v=DFSXwpoVdzI', 1, 133, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (137, 1313229, 'Nino', 'Drame', 'Art et Essai', 'Dans trois jours, Nino devra affronter une grande épreuve. D’ici là, les médecins lui ont confié deux missions. Deux impératifs qui vont mener le jeune homme à travers Paris, le pousser à refaire corps avec les autres et avec lui-même.', '2025-09-17 00:00:00', 96, 0, 'FR', 'https://image.tmdb.org/t/p/w500/sLcb7iPIByXyBav3cPfKlfAOy8c.jpg', NULL, NULL, 'Théodore Pellerin, Salomé Dewaels, Jeanne Balibar, William Lebghil', NULL, 'https://www.youtube.com/watch?v=TVvFKulmNfI', 1, 132, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (162, 1195108, 'Chroniques d''Haïfa', 'Drame', 'Art et Essai', 'Un accident mineur à Jérusalem déclenche une série d''événements.', '2025-09-03 00:00:00', 124, 0, 'PS', 'https://image.tmdb.org/t/p/w500/qo4oPwn1KBoG0gLcJFbgJpvv8k8.jpg', '', 0, 'Manar Shehab, Wafaa Aoun, Merav Mamorsky, Toufic Danial', NULL, 'https://www.youtube.com/watch?v=mzZk64jxasY', 1, 157, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (351, 1376046, 'Que ma volonté soit faite', 'Drame', 'Art et Essai', 'La jeune Nawojka, qui vit avec son père et ses frères dans la ferme familiale, cache un terrible secret : un pouvoir monstrueux, qu''elle pense hérité de sa défunte mère, s''éveille chaque fois qu''elle éprouve du désir. Lorsque Sandra, une femme libre et sulfureuse originaire du coin, revient au village, Nawojka est fascinée et ses pouvoirs se manifestent sans qu’elle ne puisse plus rien contrôler.', '2025-11-19 00:00:00', 95, 0, 'FR', 'https://image.tmdb.org/t/p/w500/oQnjOAi65fsLR31GK8YPEUikaFA.jpg', NULL, NULL, 'Maria Wróbel, Roxane Mesquida, Wojciech Skibiński, Kuba Dyniewicz', NULL, NULL, 1, 347, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (180, 1282280, 'Dieva suns', 'Animation', 'Art et Essai', 'Au XVIIe siècle, dans un village de Livonie où règnent l''ivresse et une pluie constantes, une relique est volée et des rumeurs de sorcellerie commencent à se répandre. C''est alors qu''un vieux loup-garou, autoproclamé le "Dog of God", se présente aux villageois avec un mystérieux cadeau. Peu à peu, le chaos est semé dans le village.', '2025-08-13 00:00:00', 92, 0, 'LV', 'https://image.tmdb.org/t/p/w500/pBL4KrMAFk8iKo5T2yXvLMEe3ag.jpg', '', NULL, 'Jurģis Spulenieks, Einars Repše, Agate Krista, Kristians Karelins', NULL, 'https://www.youtube.com/watch?v=6grA_xBpwjY', 1, 175, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (148, 1337562, 'Libre échange', 'Comédie', 'Art et Essai', 'Alors que sa femme vient de demander le divorce, Carey court chercher du soutien auprès de ses amis, Julie et Paul. Il découvre alors que le secret de leur bonheur est qu''ils sont en couple libre.', '2025-09-10 00:00:00', 100, 0, 'US', 'https://image.tmdb.org/t/p/w500/gxCv6kUdywxYzIXX6xYcmX5APUV.jpg', '', NULL, 'Dakota Johnson, Adria Arjona, Kyle Marvin, Michael Angelo Covino', NULL, 'https://www.youtube.com/watch?v=VrdSQSLD63Q', 1, 143, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (140, 1213193, 'Panoptikoni', 'Drame', 'Art et Essai', 'Après que son père l''abandonne pour devenir moine orthodoxe, le jeune Sandro se retrouve livré à lui-même dans la société turbulente de la Géorgie post-soviétique. Il s''efforce de concilier son devoir envers Dieu et sa sexualité naissante, qui se manifeste de manière incontrôlable et le conduit à des comportements malsains.', '2025-09-17 00:00:00', 95, 0, 'FR', 'https://image.tmdb.org/t/p/w500/nidTfCSTHjR7GU13a6yoB0hRRQw.jpg', '', NULL, 'Data Chachua, Ia Sukhitashvili, Vakhtang Kedeladze, Malkhaz Abuladze', NULL, 'https://www.youtube.com/watch?v=slHdnAoh1wQ', 1, 135, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (142, 1143440, 'La tour de glace', 'Drame', 'Art et Essai', 'Années 1970. Jeanne fugue de son foyer de haute montagne pour rejoindre la ville. Dans le studio où elle s''est réfugiée, la jeune fille tombe sous le charme de Cristina, l''énigmatique star du film La Reine des Neiges, son conte fétiche. Une troublante relation s''installe entre l''actrice et la jeune fille.', '2025-09-17 00:00:00', 118, 0, 'FR', 'https://image.tmdb.org/t/p/w500/3PeKQJMrpFysN8dnakd9vnUXgRL.jpg', NULL, NULL, 'Marion Cotillard, Clara Pacini, August Diehl, Gaspar Noé', NULL, 'https://www.youtube.com/watch?v=GtzKxCgPc1o', 1, 137, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (154, 1151269, 'Une place pour Pierrot', 'Drame', 'Art et Essai', 'Pierrot, 50 ans, est autiste et vit dans un foyer. Sa soeur Camille, 45 ans, découvre qu''il subit une surmédication qui le fait régresser. Révoltée, elle décide de le prendre chez elle en attendant de trouver un lieu adapté à sa différence. Une longue quête commence.', '2025-09-10 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/mwi1idRTXlQXhdqJzUQDPNdH20D.jpg', NULL, NULL, 'Marie Gillain, Grégory Gadebois, Mathilde Labarthe, Patrick Mille', NULL, 'https://www.youtube.com/watch?v=TxE5haSM9ko', 1, 149, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (168, 1267905, 'La Guerre des Rose', 'Comédie', 'Grand Public', 'Ivy et Theo forment un couple parfait à qui tout réussit : des carrières couronnées de succès, un mariage épanoui, des enfants formidables... Mais sous les apparences de cette vie idéale, une tempête se prépare… Alors que la carrière de Theo s’écroule et que celle d’Ivy décolle, leurs ressentiments et leur rivalité jusque-là étouffés vont bientôt exploser.', '2025-08-27 00:00:00', 121, 0, 'US', 'https://image.tmdb.org/t/p/w500/98n5HnCJ5LnXKIMNP9SBfVNyxCE.jpg', NULL, NULL, 'Benedict Cumberbatch, Olivia Colman, Andy Samberg, Kate McKinnon', NULL, 'https://www.youtube.com/watch?v=jlX-qzNprOA', 1, 163, '2025-08-29 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (151, 1289936, 'Downton Abbey III : le grand final', 'Drame', 'Grand Public', '', '2025-09-10 00:00:00', 123, 0, 'GB', 'https://image.tmdb.org/t/p/w500/bux6avxSvsO3IJuKag4gwdTQMG4.jpg', '', 8, 'Hugh Bonneville, Laura Carmichael, Phyllis Logan, Robert James-Collier', NULL, 'https://www.youtube.com/watch?v=P_30wFRxlnA', 1, 146, '2025-09-12 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (157, 1485163, 'Nénuphar', 'Thriller', 'Art et Essai', 'Maude invite son amoureux Jérémy dans la villa maternelle. Des vacances de rêve ! Et puis, la sensation qu’un intrus surveille. Maude suspecte son ex... En effet, Félix est jaloux. Félix est instable. Félix est complètement dingue.', '2025-09-03 00:00:00', 105, 0, 'FR', 'https://image.tmdb.org/t/p/w500/74VJj0YbVObvopHeOM6SUbRmkSY.jpg', NULL, NULL, 'Thomas Lesserteur, Julien Thibaut, Guerric Nivelon, Florence Bonanno', NULL, 'https://www.youtube.com/watch?v=QB5Qrja8cKY', 1, 152, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (179, 1303356, 'L''épreuve du feu', 'Drame', 'Art et Essai', 'Hugo a 19 ans. Comme chaque été, il passe ses vacances sur une île atlantique, dans la petite maison familiale. Mais cette année est différente, Hugo s’est transformé physiquement et arrive accompagné de sa petite amie, Queen, une esthéticienne dont la verve et les longs ongles strassés détonnent avec la sobriété et la timidité du jeune homme. Rapidement, le couple devient l’objet de tous les regards.', '2025-08-13 00:00:00', 105, 0, 'FR', 'https://image.tmdb.org/t/p/w500/9iClZ7fpSBVB0LPgKHWpA60xhzU.jpg', '', 9, 'Suzanne Jouannet, Félix Lefebvre, Anja Verderosa, Victor Bonnel', NULL, 'https://www.youtube.com/watch?v=wiId-4R5uww', 1, 174, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (170, 1242372, 'Escape from the 21st Century', 'Science-Fiction', 'Grand Public', 'En 1999, trois adolescents tombés dans une eau quelque peu toxique contractent le pouvoir du voyage spatio-temporel. Ils se retrouvent vingt ans après sur la planète K, qui ressemble étrangement à la Terre, en gardant leur âme d’adolescent dans leur corps d’adulte. En ce va-et-vient permanent, sauver le monde est à la portée de leurs mains...', '2025-08-27 00:00:00', 98, 0, 'CN', 'https://image.tmdb.org/t/p/w500/tzVakGUagwlH3gmyhvTbKFjeu0Z.jpg', NULL, NULL, 'Zhang Ruoyun, Zhong Chuxi, Song Yang, Wu Xiaoliang', NULL, 'https://www.youtube.com/watch?v=hLEEce_lhbo', 1, 165, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (352, 1103711, 'Duel à Monte-Carlo del Norte', 'Animation', 'Jeunesse', 'Un guitariste arrive dans un village et l''avidité du sheriff et de cow-boys entraîne un désastre écologique.', '2025-11-05 00:00:00', 80, 0, 'US', 'https://image.tmdb.org/t/p/w500/dF94ddCVHJeQxETNFd1ETq2LKMk.jpg', NULL, NULL, 'Jim Lujan, Maureen McElheron', NULL, NULL, 1, 348, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (186, 1035657, 'Sally Bauer, à contre-courant', 'Drame', 'Art et Essai', 'Inspiré d’une histoire vraie. Sud de la Suède, été 1939. La Seconde Guerre mondiale est imminente. Sally Bauer, mère célibataire de 30 ans est déterminée à battre le record de la traversée de la Manche à la nage. Face à la pression sociale et sanctionnée par sa famille qui menace de lui retirer son fils, elle affronte les conventions pour tenter d’accomplir son rêve.', '2025-08-13 00:00:00', 120, 4300000, 'DK', 'https://image.tmdb.org/t/p/w500/nhuPYq6jWlSvbaOLls0RFmXxKw4.jpg', NULL, NULL, 'Josefin Neldén, Mikkel Boe Følsgaard, Lisa Carlehed, Ivar Forsling', NULL, 'https://www.youtube.com/watch?v=x-h4rWg1ONQ', 1, 180, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (188, 1011477, 'Karate Kid : Legends', 'Action', 'Grand Public', 'Li Fong, un adolescent qui fréquente l''école de kung-fu de M. Han en Chine, doit déménager à New York avec sa mère. Celle-ci souhaite que son fils intègre une école prestigieuse et qu''il mette de côté son sport de combat. À son arrivée dans sa nouvelle ville, Li rencontre Mia, une camarade de classe, ainsi que le père de celle-ci avec lesquels il se lie d''amitié. Li se retrouve ensuite entraîné dans une compétition d''arts martiaux où il doit affronter un redoutable champion de karaté.', '2025-08-13 00:00:00', 94, 45000000, 'US', 'https://image.tmdb.org/t/p/w500/n4ZPnouW3jpUnkSEpU3sFG9SCEs.jpg', NULL, NULL, 'Jackie Chan, Ben Wang, Ralph Macchio, Joshua Jackson', NULL, 'https://www.youtube.com/watch?v=fet2dxgJGNk', 1, 182, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (192, 1383247, 'Badh', 'Action', 'Grand Public', 'Badh est une agente secrète française chargée d’éliminer un puissant trafiquant d’armes en Syrie. Trahie par la DGSE, elle disparaît sans laisser de trace et refait sa vie au Maroc jusqu’au jour où son mari est pris pour cible. Rattrapée par son passé, BADH se retrouve entrainée dans un jeu mortel de vengeance et de trahison où les règles ont changé.', '2025-08-06 00:00:00', 90, 0, 'FR', 'https://image.tmdb.org/t/p/w500/kyCrHVtQnqH8wowq4hI1RBK8YFn.jpg', NULL, NULL, 'Marine Vacth, Niels Schneider, Emmanuelle Bercot, Slimane Dazi', NULL, 'https://www.youtube.com/watch?v=ZjYHgNPb1Zw', 1, 186, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (193, 1284787, 'Y’a pas de réseau', 'Comédie', 'Grand Public', 'Jonas et Gabi, 9 et 11 ans, passent le week-end avec leurs parents dans un gite isolé au milieu d’une forêt. A peine arrivés, les deux enfants décident de faire le mur, seuls en pleine nature, et vont surprendre deux malfrats aussi stupides que dangereux en train de faire exploser une antenne relais pour couper le réseau. Se lance alors une course poursuite effrénée où pour leur échapper, les deux enfants vont devoir transformer leur gîte en une véritable forteresse de pièges et obstacles.', '2025-08-06 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/3gGaTz9uZKd6UMiH4uvvrJYtZlg.jpg', NULL, NULL, 'Maxime Gasteuil, Gérard Jugnot, Manon Azem, Julien Pestel', NULL, 'https://www.youtube.com/watch?v=yAVA_QA7TWI', 1, 187, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (197, 1047020, 'Last Stop : Yuma County', 'Crime', 'Grand Public', 'Au milieu du désert brûlant d’Arizona, une station-service se retrouve à sec. Dans le diner attenant, les clients attendent dans une ambiance étouffante l’arrivée du camion-citerne pour les ravitailler. Ils pensent que le pire, c’est la chaleur, mais c’est sans compter sur l’arrivée de deux braqueurs en cavale dans le restaurant.', '2025-08-06 00:00:00', 90, 0, 'US', 'https://image.tmdb.org/t/p/w500/hleK8EXJxuRdPlhbmfI8n7n2K1B.jpg', 'Best film 56 International Film Festival of Catalonia - Sitges 2023', 0, 'Jim Cummings, Jocelin Donahue, Richard Brake, Nicholas Logan', NULL, 'https://www.youtube.com/watch?v=mUnmRzwmuJo', 1, 191, '2024-05-10 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (166, 1356670, 'En première ligne', 'Drame', 'Art et Essai', 'Floria est une infirmière dévouée qui fait face au rythme implacable d’un service hospitalier en sous-effectif. En dépit du manque de moyens, elle tente d’apporter humanité et chaleur à chacun de ses patients. Mais au fil des heures, les demandes se font de plus en plus pressantes, et malgré son professionnalisme, la situation commence dangereusement à lui échapper…', '2025-08-27 00:00:00', 92, 0, 'DE', 'https://image.tmdb.org/t/p/w500/xaVtmZBH8sSt3q0a5GuYSeyVnww.jpg', '', 2, 'Leonie Benesch, Alireza Bayram, Jürg Plüss, Jasmin Mattei', NULL, 'https://www.youtube.com/watch?v=x-bFONM8vak', 1, 161, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (184, 1135176, 'Brief History of a Family', 'Drame', 'Art et Essai', 'Wei est le fils unique d’une famille aisée, dans la Chine moderne et urbaine. Alors qu’il se rapproche de Shuo, un camarade d’école plutôt mystérieux, celui-ci commence à s’immiscer dans leur quotidien. Peu à peu, sa présence semble perturber l’équilibre familial.', '2025-08-13 00:00:00', 99, 0, 'CN', 'https://image.tmdb.org/t/p/w500/7MjB0A7ciykouc2s5iHejUyz48D.jpg', '', 0, 'Zu Feng, Guo Keyu, Sun Xilun, Lin Muran', NULL, 'https://www.youtube.com/watch?v=kbMR2nBzHLk', 1, 179, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (167, 1320414, 'La Femme qui en savait trop', 'Drame', 'Art et Essai', 'En Iran, Tarlan, professeure de danse à la retraite, est témoin d’un meurtre commis par une personnalité influente du gouvernement. Elle le signale à la police qui refuse d’enquêter. Elle doit alors choisir entre céder aux pressions politiques ou risquer sa réputation et ses ressources pour obtenir justice.', '2025-08-27 00:00:00', 100, 0, 'DE', 'https://image.tmdb.org/t/p/w500/7B3IVw7ClkebiDRo7Q4sE3iSdVQ.jpg', '', 0, 'Maryam Boubani, Nader Naderpour, Abbas Imani, Ghazal Shojaei', NULL, 'https://www.youtube.com/watch?v=0wEDklOJ9GU', 1, 162, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (175, 1284460, 'Alpha', 'Drame', 'Art et Essai', 'Alpha, 13 ans, est une adolescente agitée qui vit seule avec sa mère. Leur monde s’écroule le jour où elle rentre de l''école avec un tatouage sur le bras.', '2025-08-20 00:00:00', 128, 0, 'FR', 'https://image.tmdb.org/t/p/w500/89rX9774vG6GzE128Varjy6rKOl.jpg', '', 8, 'Mélissa Boros, Golshifteh Farahani, Tahar Rahim, Emma Mackey', NULL, 'https://www.youtube.com/watch?v=37c3uoUzn-I', 1, 170, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (176, 1244975, 'Les Orphelins', 'Action', 'Grand Public', 'Gab et Driss, amis d’enfance brouillés depuis leur départ de l’orphelinat, mènent des vies opposées : l’un est flic à l’IGPN, l’autre fixeur pour des voyous. Lorsque leur premier amour meurt dans un accident suspect, sa fille Leïla, 17 ans, s’empare de l’arme de Gab et se lance sur la piste d’une puissante entreprise prête à tout pour étouffer l’affaire. Forcés de faire équipe, les orphelins vont devoir la stopper avant qu’elle ne commette l’irréparable…', '2025-08-20 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/e08WqjLKqcw6HqHK9QlH0XGxyGb.jpg', NULL, NULL, 'Alban Lenoir, Dali Benssalah, Sonia Faïdi, Anouk Grinberg', NULL, 'https://www.youtube.com/watch?v=_5qojZYwxpk', 1, 171, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (187, 1035259, 'Y a-t-il un flic pour sauver le monde ?', 'Action', 'Grand Public', 'Un seul homme possède des compétences… disons uniques… pour diriger la prestigieuse Brigade Spéciale et… sauver le monde, tout simplement ! Cet homme, c’est le lieutenant Frank Drebin Jr. — oui, vous avez bien lu — c’est lui qui suit les traces de son illustre père dans Y a-t-il un flic pour sauver le monde ?', '2025-08-13 00:00:00', 85, 0, 'US', 'https://image.tmdb.org/t/p/w500/v9maMvSxrDb9BKmV1XtWO0Lpmsa.jpg', NULL, NULL, 'Liam Neeson, Pamela Anderson, Paul Walter Hauser, Kevin Durand', NULL, 'https://www.youtube.com/watch?v=oB4-5-PQV2Y', 1, 181, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (279, 1119539, 'Imago', 'Documentaire', 'Documentaire', 'Déni est le nouveau propriétaire d’un petit lopin de terre dans une vallée isolée en Géorgie, à la frontière de la Tchétchénie dont il est exilé depuis l’enfance. Il débarque là-bas et projette d’y construire une maison qui tranche drôlement avec les coutumes locales. Un fantasme qui ravive ses souvenirs et ceux de son clan déraciné qui pourtant ne rêve que d''une chose, le marier !', '2025-10-22 00:00:00', 108, 0, 'BE', 'https://image.tmdb.org/t/p/w500/xe5MNrG2zxthCXdJzSpLugCmLdn.jpg', NULL, NULL, 'Déni Oumar Pitsaev', NULL, NULL, 274, 274, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (189, 1007734, 'Nobody 2', 'Action', 'Grand Public', 'Le deuxième volet de Nobody.', '2025-08-13 00:00:00', 89, 0, 'US', 'https://image.tmdb.org/t/p/w500/lLBP1r4eCK28DgXfL0adjkG3XBT.jpg', NULL, NULL, 'Bob Odenkirk, Connie Nielsen, Christopher Lloyd, RZA', NULL, 'https://www.youtube.com/watch?v=_K286gOz-6I', 1, 183, '2025-08-15 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (191, 1418524, 'Confidente', 'Drame', 'Art et Essai', 'Ankara, 1999. Arzu enchaîne les appels tarifés dans le call center érotique où elle travaille. Quand un séisme soudain frappe Istanbul, un jeune homme avec lequel elle était en ligne est pris au piège sous des décombres et la supplie de le sauver. Arzu saurait bien qui appeler... au péril de sa propre vie.', '2025-08-06 00:00:00', 76, 0, 'FR', 'https://image.tmdb.org/t/p/w500/rIY0wMLrXIycTeEOAuHV7mJs5qz.jpg', 'Confidente est le quatrième long-métrage du couple franco-turc, Çagla Zencirci et Guillaume Giovanetti, après Noor (2012), Ningen (2013) et Sibel (2018).', 10, 'Saadet Işıl Aksoy, Erkan Kolçak Köstendil, Muhammet Uzuner, Elit Andaç Çam', NULL, 'https://www.youtube.com/watch?v=_JD4xPMy_7E', 1, 185, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (195, 1125257, 'Freaky Friday 2 : Encore dans la peau de ma mère', 'Familial', 'Jeunesse', 'L’histoire a lieu des années après la crise d’identité subie par Tess et Anna, les personnages joués par Jamie Lee Curtis et Lindsay Lohan. Anna est à son tour mère d’une fille et aura bientôt une belle-fille. Confrontées aux défis que pose une famille recomposée, les deux femmes vont découvrir que dans leur cas, la foudre peut frapper deux fois au même endroit.', '2025-08-06 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/4cd7H9r59pWS6jXkiCHcuShzbeS.jpg', NULL, NULL, 'Lindsay Lohan, Jamie Lee Curtis, Julia Butters, Sophia Hammons', NULL, 'https://www.youtube.com/watch?v=bdlaDd5JvH8', 1, 189, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (196, 1078605, 'Évanouis', 'Horreur', 'Art et Essai', 'Lorsque tous les enfants d’une même classe, à l’exception d’un, disparaissent mystérieusement la même nuit, à la même heure, la ville entière cherche à découvrir qui — ou quoi — est à l’origine de ce phénomène inexpliqué.', '2025-08-06 00:00:00', 128, 38000000, 'US', 'https://image.tmdb.org/t/p/w500/krIs8BtrdS8Sf6B8Z70eEdbDbkx.jpg', NULL, NULL, 'Julia Garner, Josh Brolin, Alden Ehrenreich, Benedict Wong', NULL, 'https://www.youtube.com/watch?v=48u4IbX5NPM', 1, 190, '2025-08-08 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (204, 1058642, 'Slow', 'Drame', 'Art et Essai', 'Elena, une danseuse épanouie, fait la rencontre de Dovydas, un interprète en langue des signes. Leur connexion est immédiate. Alors que leur lien s''approfondit, Dovydas confie à Elena, qu''il ne ressent aucun désir sexuel pour elle, ni pour personne : il est asexuel. Ensemble, ils tentent de bâtir une nouvelle forme d’intimité.', '2025-08-06 00:00:00', 108, 0, 'ES', 'https://image.tmdb.org/t/p/w500/kdmQxMEBddMyb56SsaqnnjOmI5c.jpg', '2023 : Slow (Meilleure réalisation au Festival de Sundance 2023)', 2, 'Greta Grinevičiūtė, Kęstutis Cicėnas, Gediminas Rimeika, Giedré Nalivaikaité', NULL, 'https://www.youtube.com/watch?v=nlwnNv6SqfU', 1, 200, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (202, 1227274, 'Sous tension', 'Drame', 'Art et Essai', 'En Grèce, Costas est depuis peu agent de sécurité dans un hôpital public sous tension. Sa famille ayant de graves problèmes financiers, il se laisse entraîner dans une combine : monter de toute pièce un dossier pour faute médicale. Entre l’appât du gain et son intégrité, le choix est difficile…', '2025-08-20 00:00:00', 123, 0, 'DE', 'https://image.tmdb.org/t/p/w500/i9ifRsJUVGc1KomeoueAbUf8nAi.jpg', '', 0, 'Giannis Karampampas, Garifalina Kontozou, Thalia Papakosta, Elena Mavridou', NULL, 'https://www.youtube.com/watch?v=qU0gZPEfTe8', 1, 197, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (182, 1242011, 'Together', 'Horreur', 'Art et Essai', 'Tim et Millie sont ensemble depuis des années quand ils décident de tout abandonner pour s’installer à la campagne. Alors que les tensions sont déjà vives, une force surnaturelle transforme leur rêve en cauchemar, menaçant leur relation, leur amour... et jusqu’à leur intégrité physique.', '2025-08-13 00:00:00', 102, 0, 'US', 'https://image.tmdb.org/t/p/w500/wEgfIrmSUibiXjp9qWLL35g1nNr.jpg', '', 0, 'Dave Franco, Alison Brie, Damon Herriman, Mia Morrissey', NULL, 'https://www.youtube.com/watch?v=iDOCSrPl7TU', 1, 177, '2025-07-30 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (203, 1069174, 'Last Shadow at First Light', 'Drame', 'Art et Essai', 'Après avoir découvert de vieux enregistrements de sa mère décédée, Ami, 16 ans, confronte son père qui nie tout ce qui s''est passé. Elle quitte Singapour pour le Japon afin d''entrer en contact avec la seule personne qui sait où se trouve sa mère, un oncle chauffeur de taxi cynique qui a déménagé à Tokyo. Ensemble, ils entreprennent un voyage vers la ville natale de la famille, dans la région côtière du nord-est du Japon, afin d''élucider le mystère de la disparition de sa mère.', '2025-08-20 00:00:00', 107, 0, 'ID', 'https://image.tmdb.org/t/p/w500/w0D16t7Hdof91HmldknjVqYyy0A.jpg', '', 0, 'Masatoshi Nagase, Mihaya Shirata, Mariko Tsutsui, Peter Yu', NULL, 'https://www.youtube.com/watch?v=h-JTSWBgeA4', 1, 198, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (205, 1290432, 'Vie privée', 'Drame', 'Art et Essai', 'Lilian Steiner est une psychiatre reconnue. Un jour, elle apprend la mort de l’une de ses patientes. Troublée, Lilian se persuade qu’il s’agit d’un assassinat, elle décide alors de mener son enquête...', '2025-11-26 00:00:00', 100, 0, 'FR', 'https://image.tmdb.org/t/p/w500/ySU2kboUiK2IVs9dB0w4vnPiYgk.jpg', NULL, NULL, 'Jodie Foster, Daniel Auteuil, Virginie Efira, Mathieu Amalric', NULL, 'https://www.youtube.com/watch?v=e3RSzFziCHo', 1, 201, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (206, 1218412, 'Promis le ciel', 'Drame', 'Grand Public', 'Marie, pasteure ivoirienne et ancienne journaliste, vit à Tunis. Elle héberge Naney, une jeune mère en quête d''un avenir meilleur, et Jolie, une étudiante déterminée qui porte les espoirs de sa famille restée au pays. Quand les trois femmes recueillent Kenza, 4 ans, rescapée d''un naufrage, leur refuge se transforme en famille recomposée tendre mais intranquille dans un climat social de plus en plus préoccupant.', '2025-11-26 00:00:00', 92, 6800000, 'FR', 'https://image.tmdb.org/t/p/w500/pc1QHKPebiiWe31WCGFpkcFcjtB.jpg', NULL, NULL, 'Aïssa Maïga, Laëtitia Ky, Déborah Naney, Mohamed Grayaâ', NULL, 'https://www.youtube.com/watch?v=tPDKAAqtPzY', 1, 202, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (207, 1149504, 'Honey Don''t!', 'Crime', 'Grand Public', 'Honey O''Donahue, une détective privée d''une petite ville enquête sur une série de morts étranges liées à une église mystérieuse.', '2025-11-26 00:00:00', 89, 0, 'US', 'https://image.tmdb.org/t/p/w500/sYdIRJZ41BE2XRdoD5SmutbcEeW.jpg', NULL, NULL, 'Margaret Qualley, Aubrey Plaza, Charlie Day, Chris Evans', NULL, 'https://www.youtube.com/watch?v=JKTN4okRe28', 1, 203, NULL);
