INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (212, 1294698, 'Dossier 137', 'Crime', 'Art et Essai', 'Le dossier 137 est en apparence une affaire de plus pour Stéphanie, enquêtrice à l’IGPN, la police des polices. Une manifestation tendue, un jeune homme blessé par un tir de LBD, des circonstances à éclaircir pour établir une responsabilité. Mais un élément inattendu va troubler Stéphanie, pour qui le dossier 137 devient autre chose qu’un simple numéro.', '2025-11-19 00:00:00', 115, 0, 'FR', 'https://image.tmdb.org/t/p/w500/frEovFFQ6CcGnAPmtLRAKRLoPa1.jpg', NULL, NULL, 'Léa Drucker, Jonathan Turnbull, Mathilde Riu, Guslagie Malanda', NULL, 'https://www.youtube.com/watch?v=SOI1ysTMvcA', 1, 208, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (213, 1288072, 'Keeper', 'Horreur', 'Art et Essai', 'Un couple s''échappe pour un week-end dans une cabane isolée. Malcolm retourne soudainement en ville laissant Liz seule.', '2025-11-19 00:00:00', 0, 0, 'CA', 'https://image.tmdb.org/t/p/w500/37wINcejfzsxovp3WZC2HEqaPNy.jpg', NULL, NULL, 'Tatiana Maslany, Rossif Sutherland, Birkett Turton, Claire Friesen', NULL, 'https://www.youtube.com/watch?v=WX1wi9eEE5k', 1, 209, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (214, 1237398, 'La fonte des glaces', 'Drame', 'Art et Essai', 'Louise Denoncourt, une agente de libération conditionnelle, opère une aile expérimentale de réhabilitation pour meurtriers. Un nouveau détenu qu’elle doit prendre à sa charge est soupçonné d’avoir tué sa mère. Rongée par le doute, Louise s’engage dans une mission qui rapidement la dépasse. Jusqu’où ira-t-elle pour prévenir toute récidive?', '2025-11-19 00:00:00', 106, 0, 'CA', 'https://image.tmdb.org/t/p/w500/qFWA7ZiD73h4cJpxOTF41eDQOb2.jpg', NULL, NULL, 'Christine Beaulieu, Lothaire Bluteau, Marc Béland, Etienne Lou', NULL, 'https://www.youtube.com/watch?v=Dn8yjAAkUi4', 1, 210, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (217, 967941, 'Wicked : Partie II', 'Fantastique', 'Art et Essai', 'Depuis qu''elle s''est opposée au Magicien d''Oz, Elphaba est surnommée la Méchante sorcière de l''Ouest par la population du Pays d''Oz qui pense qu''elle est maléfique. De son côté, Glinda est devenu la figure populaire du régime du Magicien et est surnommée la Bonne Glinda, tandis que Fiyero devient le capitaine de la garde du Magicien, bien qu''il doute encore de la culpabilité d''Elphaba.', '2025-11-19 00:00:00', 0, 150000000, 'US', 'https://image.tmdb.org/t/p/w500/qEpRUVmn1wWtfiao6FLyeznLyGR.jpg', NULL, NULL, 'Cynthia Erivo, Ariana Grande, Jonathan Bailey, Ethan Slater', NULL, 'https://www.youtube.com/watch?v=kEXOAsdIRPg', 1, 213, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (224, 1091196, 'On vous croit', 'Drame', 'Art et Essai', 'Aujourd''hui, Alice se retrouve devant un juge et n''a pas le droit à l''erreur. Elle doit défendre ses enfants, dont la garde est remise en cause. Pourra-t-elle les protéger de leur père avant qu''il ne soit trop tard ?', '2025-11-12 00:00:00', 78, 0, 'BE', 'https://image.tmdb.org/t/p/w500/igXPchdekOO4oKOlaatfkj04qZL.jpg', NULL, NULL, 'Myriem Akheddiou, Laurent Capelluto, Natali Broods, Ulysse Goffin', NULL, 'https://www.youtube.com/watch?v=xAH76ackNDE', 1, 219, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (225, 425274, 'Insaisissables 3', 'Thriller', 'Grand Public', 'Les Cavaliers sont de retour pour le braquage le plus impressionnant jamais imaginé ! Accompagnés d''un groupe de jeunes magiciens qui espèrent suivre leur trace, ils vont devoir repousser les limites de l''illusion pour orchestrer leur tour le plus spectaculaire : dérober le joyau le plus précieux du monde des mains d''une redoutable organisation criminelle...', '2025-11-12 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/bkLaI0JqXb1lRqGti0zGgUMb1Uk.jpg', NULL, NULL, 'Jesse Eisenberg, Woody Harrelson, Dave Franco, Isla Fisher', NULL, 'https://www.youtube.com/watch?v=RNdz_e63wxg', 1, 220, NULL);
