INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (240, 1269644, 'Une enfance allemande - Île d''Amrum, 1945', 'Drame', 'Art et Essai', 'Printemps 1945, sur l’île d’Amrum, au large de l''Allemagne. Dans les derniers jours de la guerre, Nanning, 12 ans, brave une mer dangereuse pour chasser les phoques, pêche de nuit et travaille à la ferme voisine pour aider sa mère à nourrir la famille. Lorsque la paix arrive enfin, de nouveaux conflits surgissent, et Nanning doit apprendre à tracer son propre chemin dans un monde bouleversé.', '2025-12-24 00:00:00', 93, 0, 'DE', 'https://image.tmdb.org/t/p/w500/b2RJUgxHBDB1UvqDlGKlPxvJeSu.jpg', NULL, NULL, 'Jasper Billerbeck, Diane Kruger, Kian Köppke, Laura Tonke', NULL, 'https://www.youtube.com/watch?v=jMEXPmF8FxU', 1, 235, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (172, 1205648, 'Le Roi Soleil', 'Drame', 'Grand Public', 'Un homme est mort au Roi Soleil, un bar-pmu à Versailles. Il laisse un ticket de loto gagnant de plusieurs millions d’euros. En s’arrangeant un peu avec la réalité et leur conscience, les témoins du drame pourraient repartir avec l’argent... Et si la vérité n''était qu''un scénario bien ficelé ?', '2025-08-27 00:00:00', 115, 0, 'FR', 'https://image.tmdb.org/t/p/w500/u8gpyd4Ra5w4AZUe4D3XOZIlfog.jpg', '', 7, 'Pio Marmaï, Sofiane Zermani, Panayotis Pascot, Lucie Zhang', NULL, 'https://www.youtube.com/watch?v=i2Z-Pn2e_BA', 1, 167, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (246, 991494, 'Bob L’Éponge – Le Film : Un Pour Tous, Tous Pirates !', 'Familial', 'Jeunesse', 'Un spin-off de Bob l''éponge centré sur le personnage de Sandy, l''écureuil.', '2025-12-24 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/xhNdh0uWMCT5q2rCALNtk8PXIr.jpg', NULL, NULL, 'Tom Kenny, Clancy Brown, Rodger Bumpass, Bill Fagerbakke', NULL, 'https://www.youtube.com/watch?v=fyZLpo4niwU', 1, 241, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (245, 1214028, 'Kangourou', 'Comédie', 'Jeunesse', 'L''ancien présentateur météo de la télévision Chris Masterman, se retrouve bloqué dans une ville de l''Outback australien à la suite d''un accident de voiture. Il se lie d''amitié avec une fillette indigène de 11 ans, Charlie.', '2025-12-17 00:00:00', 0, 0, 'AU', 'https://image.tmdb.org/t/p/w500/sm0i07RG9NOwHbT7VmTJVgPyK85.jpg', NULL, NULL, 'Lily Whiteley, Ryan Corr, Rachel House, Brooke Satchwell', NULL, 'https://www.youtube.com/watch?v=RvmaXOvLJNc', 1, 240, NULL);
