INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (256, 1228246, 'Five Nights at Freddy''s 2', 'Horreur', 'Grand Public', 'N''importe qui peut survivre à cinq nuits. Cette fois, il n''y aura pas de seconde chance.', '2025-12-03 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/enRyaRthhsuAqBwzYKqb7VfCJg.jpg', NULL, NULL, 'Josh Hutcherson, Matthew Lillard, Elizabeth Lail, Piper Rubio', NULL, 'https://www.youtube.com/watch?v=16Dw_SkKqek', 1, 251, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (107, 1234821, 'Jurassic World: Renaissance', 'Science-Fiction', 'Grand Public', '7 ans après la destruction d''Isla Nublar, les dinosaures commencent à disparaître de la surface de la Terre, à cause d''une flore et d''une faune inadaptées. Une experte nommée Zora Bennett est engagée pour mener une mission secrète. Son équipe doit récupérer l''ADN de 3 dinosaures dans une zone où ils ont trouvé refuge loin des climats changeants et des humains. Zora et son équipe vont croiser Reuben Delgado, un père accompagné de ses enfants et dont le bateau a chaviré. Tous vont se retrouver sur une des 5 îles renfermant un secret non divulgué à l’humanité jusqu’à aujourd’hui.', '2025-07-04 00:00:00', 134, 180000000, 'US', 'https://image.tmdb.org/t/p/w500/yq9PfUpsBEUZXPvRiubiBiWkOYn.jpg', NULL, NULL, 'Scarlett Johansson, Jonathan Bailey, Mahershala Ali, Rupert Friend', NULL, 'https://www.youtube.com/watch?v=_3PtXq4mA_M', 104, NULL, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (244, 1258509, 'Ástin sem eftir er', 'Drame', 'Grand Public', 'Deux familles tentent de gagner leur vie dans le coin le plus reculé de l''Islande au 19e siècle. Dans l''espoir d''une terre plus fertile, ils décident de démonter leur maison, de construire un radeau, de voyager et de le remonter à destination. En chemin, ils réalisent qu’ils vivront et mourront ensemble.', '2025-12-17 00:00:00', 109, 0, 'DK', 'https://image.tmdb.org/t/p/w500/3bDEFLesf89aRf4x0bLABuc3JVS.jpg', NULL, NULL, 'Saga Garðarsdóttir, Sverrir Gudnason, Ída Mekkín Hlynsdóttir, Þorgils Hlynsson', NULL, 'https://www.youtube.com/watch?v=tFkx_st7Bkw', 1, 239, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (209, 999689, '眾生相', 'Drame', 'Art et Essai', 'Un homme se glisse dans la peau de chacun de ses amants, s’appropriant leur personnalité au gré de ses rencontres. Ce n’est qu’en devenant un autre qu’il parvient à être pleinement lui-même.', '2025-11-26 00:00:00', 87, 0, 'US', 'https://image.tmdb.org/t/p/w500/7v5AqhHdRdozh2IAJj4hYSqu9nz.jpg', NULL, NULL, 'Jayden Cheung, Erfan Shekarriz, Arm Anatphikorn, Zenni Corbin', NULL, 'https://www.youtube.com/watch?v=BHSPwNudu9c', 1, 205, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (171, 1208795, 'Family Therapy', 'Drame', 'Art et Essai', 'Une famille apparemment parfaite composée d''Olivija, d''Aleksander et de leur fille Agata, voit leur vie est bouleversée avec l''arrivée de Julian, dévoilant les relations dysfonctionnelles qui se cachent sous la façade du bonheur.  ⎯⎯  Une réimagination humoristique de la prémisse du film TEOREMA de Pier Paolo Pasolini', '2025-08-27 00:00:00', 122, 0, 'HR', 'https://image.tmdb.org/t/p/w500/eT4zVXTvMr730miZJlSuBBv1XyB.jpg', NULL, NULL, 'Marko Mandić, Katarina Stegnar, Aliocha Schneider, Mila Bezjak', NULL, 'https://www.youtube.com/watch?v=43nxAsxK4wg', 1, 166, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (262, 1073126, 'Tu ne sauras jamais', 'Drame', 'Art et Essai', 'Paul Vincent, un vieil homme en fin de vie, est enfermé dans sa chambre d''un CHSLD en temps de COVID. L''attente est longue. Le manque d''effectifs se fait sentir. Sans nouvelles de son amoureuse qui vit aussi dans la même résidence, monsieur Vincent mettra tout en oeuvre pour la retrouver. Il sait qu''elle est encore en vie. Il doit la rejoindre.', '2025-08-06 00:00:00', 109, 0, 'CA', 'https://image.tmdb.org/t/p/w500/u5iiRZHI4rMDlu23ZbCSNDmTmfm.jpg', '', 0, 'Martin Naud, Sarah Keita, Jean-Marie Lapointe, Marie-Hélène Brousseau', NULL, 'https://www.youtube.com/watch?v=4Qsh3QyT8U0', 1, 257, '2023-11-11 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (259, 1108782, 'Le sang et la boue', 'Documentaire', 'Documentaire', 'Le quotidien de Numbi, une petite ville du Congo où des mineurs extraient à mains nues le coltan, « or gris » de nos appareils électroniques, des creuseurs aux policiers qui traquent les trafiquants, aux femmes qui trient les minerais ou vendent leurs corps, aux enfants tiraillés entre l’école et la mine.', '2025-08-27 00:00:00', 86, 0, 'FR', '', NULL, NULL, '', NULL, 'https://www.youtube.com/watch?v=3HVOj9Saprk', 1, 254, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (260, 1247597, 'Salve Maria', 'Drame', 'Art et Essai', 'Fraîchement maman, María décide d''écrire sur une femme qui a assassiné ses jumeaux.', '2025-08-20 00:00:00', 111, 0, 'ES', 'https://image.tmdb.org/t/p/w500/c1vxdtbIyKE31mX9znwIsrHJ30S.jpg', 'Meilleure Révélation Féminine (Laura Weissmahr), Goya 2025
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (261, 988359, 'Dis-moi pourquoi ces choses sont si belles', 'Drame', 'Art et Essai', 'Le Frère Marie-Victorin se lie d’amitié avec son étudiante Marcelle Gauvreau. Tous deux ont frôlé la mort et partagent le même amour de Dieu et de la nature. Plus tard, elle devient sa collaboratrice. Dans un échange épistolaire qui durera jusqu''à la mort de Marie-Victorin, ils explorent les désirs humains et la « biologie sans voile ». Ce grand amour chaste, l’amour de la flore québécoise pousse Antoine et Roxane, qui les incarnent à l''écran, à s’interroger sur leur propre rapport à l’amour et la Nature.', '2025-08-20 00:00:00', 99, 0, 'CA', 'https://image.tmdb.org/t/p/w500/dsQ5lK9izDu7M9SY4fJBUcEtsx3.jpg', NULL, NULL, 'Alexandre Goyette, Mylène Mackay, Rachel Graton, Francis Ducharme', NULL, 'https://www.youtube.com/watch?v=ve6HNz5T5T8', 1, 256, '2024-06-21 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (356, 1418849, '그 자연이 네게 뭐라고 하니', 'Drame', 'Art et Essai', '', '2025-10-01 00:00:00', 109, 0, 'KR', 'https://image.tmdb.org/t/p/w500/7p05QCzSX0bE9JSPiHutqPBXrwc.jpg', NULL, NULL, 'Ha Seong-guk, Kwon Hae-hyo, Cho Yun-hee, Kang So-yi', NULL, 'https://www.youtube.com/watch?v=_peC_sNdjIU', 1, 352, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (80, 1001270, 'Öldürdüğün Şeyler', 'Drame', 'Grand Public', 'Après plusieurs années aux Etats-Unis, Ali retourne s''installer en Turquie avec sa femme. Dans sa ville natale, il retrouve sa famille qui vit un enfer sous le joug terrible de son père. Aussi, lorsque sa mère décède dans des circonstances suspectes, Ali soupçonne-t-il rapidement son père. Aidé par un mystérieux rôdeur qu''il engage comme jardinier, le jeune homme mène une quête vengeresse qui va le confronter au pire des secrets…', '2025-07-23 00:00:00', 113, 0, 'CA', 'https://image.tmdb.org/t/p/w500/vUG8p3vUFlFoA8MO7irhw0xl3FD.jpg', NULL, NULL, 'Ekin Koç, Erkan Kolçak Köstendil, Hazar Ergüçlü, Ercan Kesal', NULL, 'https://www.youtube.com/watch?v=EJDh_VvKhi8', 1, 77, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (276, 1230368, 'Springsteen: Deliver Me from Nowhere', 'Drame', 'Grand Public', 'Biopic sur Bruce Springsteen et l''élaboration de son album phare Nebraska (1982) et du tube "Born in the USA".', '2025-10-22 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/csBV3eq4RDjNg1acNQ8kwOZyPlZ.jpg', NULL, NULL, 'Jeremy Allen White, Jeremy Strong, Paul Walter Hauser, Stephen Graham', NULL, 'https://www.youtube.com/watch?v=8kHnLl9p95g', 1, 271, '2025-10-24 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (265, 947520, 'Mary Anning, chasseuse de fossiles', 'Animation', 'Jeunesse', 'Dans l’Angleterre du XIXe siècle, Mary est une jeune fille passionnée par les fossiles, qu’elle cherche avec son père sur la plage, pour ensuite les vendre aux touristes. La mort soudaine du père jette la famille dans le désarroi : sans une source financière, ils vont bientôt devoir quitter leur maison et pire encore, pour Mary, sa bien aimée plage aux fossiles. Mais avant de mourir, son père lui a laissé un mystérieux message qui pourrait l’amener à bouleverser bien de choses…', '2025-09-17 00:00:00', 72, 0, 'BE', 'https://image.tmdb.org/t/p/w500/nsgQfSWqkrZ2Pyy55gKkevdiGY1.jpg', '', 8, '', NULL, 'https://www.youtube.com/watch?v=9Ltqf8CjQaQ', 1, 260, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (304, 533533, 'Tron: Ares', 'Science-Fiction', 'Grand Public', 'L''étonnante aventure d’un Programme hautement sophistiqué du nom de Ares, envoyé du monde numérique au monde réel pour une mission dangereuse qui marquera la première rencontre de l''humanité avec des êtres dotés d''une intelligence artificielle…', '2025-10-08 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/tkILExgVXhNLoxy4KNgCk9PC4lU.jpg', NULL, NULL, 'Jared Leto, Greta Lee, Evan Peters, Hasan Minhaj', NULL, 'https://www.youtube.com/watch?v=oNw87TQ1eVA', 1, 298, '2025-10-10 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (267, 1358491, 'Yoroï', 'Aventure', 'Art et Essai', 'Après une dernière tournée éprouvante, Aurélien décide de s''installer au Japon avec sa femme Nanako, enceinte de leur premier enfant. Alors que le jeune couple emménage dans une maison traditionnelle dans la campagne japonaise, Aurélien découvre dans un puits une armure ancestrale qui va réveiller d''étranges créatures, les Yokaïs.', '2025-10-29 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/rTVbLq1Bw7739bWWU9533lVYHjn.jpg', NULL, NULL, 'Orelsan, Clara Choï, Kazuya Tanabe', NULL, 'https://www.youtube.com/watch?v=e7SI23jSd_4', 1, 262, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (266, 1465563, 'Un poète', 'Drame', 'Art et Essai', 'Óscar Restrepo, un poète vieillissant et erratique, rencontre avec une adolescente, qu''il aide à cultiver son talent pour la poésie, apporte une lueur d''espoir à ses journées.', '2025-10-29 00:00:00', 120, 0, 'CO', 'https://image.tmdb.org/t/p/w500/9MeLgDcoV2gUWJ53EBrg5kKzOGF.jpg', NULL, NULL, 'Ubeimar Rios, Rebeca Andrade, Guillerma Cardona, Allison Correa', NULL, 'https://www.youtube.com/watch?v=Ia4PVP0qtO4', 1, 261, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (354, 1429348, 'L’Étranger', 'Drame', 'Grand Public', 'Alger, 1938. Meursault, un jeune homme d’une trentaine d’années, modeste employé, enterre sa mère sans manifester la moindre émotion. Le lendemain, il entame une liaison avec Marie, une collègue de bureau. Puis il reprend sa vie de tous les jours. Mais son voisin, Raymond Sintès vient perturber son quotidien en l’entraînant dans des histoires louches jusqu’à un drame sur une plage, sous un soleil de plomb…', '2025-10-29 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/o6BpUxl5vrcYg4XBnSogoaXOZGG.jpg', NULL, NULL, 'Benjamin Voisin, Rebecca Marder, Pierre Lottin, Swann Arlaud', NULL, NULL, 1, 351, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (273, 1010756, 'Les Intrus : Chapitre 2', 'Horreur', 'Grand Public', 'Les Intrus sont de retour – plus brutaux et impitoyables que jamais. Lorsqu’ils découvrent que l’une de leurs victimes, Maya, a survécu, ils reviennent pour terminer ce qu’ils ont commencé. Traquée et isolée, Maya doit affronter un nouveau chapitre terrifiant alors que les tueurs insensés et inarrêtables, la traquent, prêts à éliminer quiconque se mettra en travers de leur route.', '2025-10-29 00:00:00', 96, 0, 'US', 'https://image.tmdb.org/t/p/w500/cmszlBbTnEbHKFzJ0eg5QYw5wj3.jpg', NULL, NULL, 'Madelaine Petsch, Richard Brake, Rachel Shenton, Brooke Lena Johnson', NULL, 'https://www.youtube.com/watch?v=xCyP2zSHS60', 1, 268, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (271, 1225624, 'On Falling', 'Drame', 'Art et Essai', 'Aurora, migrante portugaise, travaille comme préparatrice de commandes dans un entrepôt à Édimbourg, en Écosse. Coincée entre les murs d''un immense centre de distribution et la solitude de sa propre chambre, Aurora cherche à saisir toutes les occasions pour résister à l''aliénation et à l''isolement qui menacent son identité.', '2025-10-29 00:00:00', 104, 0, 'PT', 'https://image.tmdb.org/t/p/w500/dV24R0JoqXRctUwOc0UV7cGwcOL.jpg', NULL, NULL, 'Joana Santos, Inês Vaz, Neil Leiper, Deborah Arnott', NULL, 'https://www.youtube.com/watch?v=hMlBMSdU7IY', 1, 266, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (275, 760329, 'The Smashing Machine', 'Drame', 'Grand Public', '', '2025-10-29 00:00:00', 123, 40000000, 'US', 'https://image.tmdb.org/t/p/w500/vMDqKiWCciWsF8Q3RCk3YSrZx0y.jpg', NULL, NULL, 'Dwayne Johnson, Emily Blunt, Lyndsey Gavin, Ryan Bader', NULL, 'https://www.youtube.com/watch?v=21OUFEZGXIk', 1, 270, '2025-10-03 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (293, 1215532, 'Hopper et le Secret de la Marmotte', 'Animation', 'Jeunesse', 'Ayant fait de sa différence une force, Hopper explore le monde avec Meg, moufette experte en arts martiaux, et Archie, tortue sarcastique. Lorsqu’il découvre Gina, sa sœur, tout bascule : il n’est pas seul. Tiraillé entre loyauté et devoir, Hopper part en quête d’un pouvoir légendaire pour sauver les siens. Une aventure périlleuse à travers des mondes saisissants, où secrets et dilemmes s’entremêlent.', '2025-10-15 00:00:00', 88, 0, 'BE', 'https://image.tmdb.org/t/p/w500/l0oop3DQUzZ35CZiS0r9xLlQ5KK.jpg', NULL, NULL, 'Jordan Tartakow, Laila Berzins, Joe Ochman', NULL, 'https://www.youtube.com/watch?v=lXehTTWTEiU', 1, 287, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (295, 940247, 'En garde', 'Drame', 'Art et Essai', 'Jie, un jeune talent prometteur de l’escrime, renoue avec son frère aîné Han, récemment libéré après sept ans de prison pour la mort accidentelle d’un adversaire lors d’une compétition. En secret, Han soutient Jie dans son entraînement, l’aidant à viser une qualification aux championnats nationaux. Mais une dispute éclate, et Jie commence à douter de l’innocence de son frère.', '2025-10-15 00:00:00', 109, 0, 'SG', 'https://image.tmdb.org/t/p/w500/ctMqFfhkCvYLFX0kHdazQo8Wojy.jpg', NULL, NULL, 'Hsiu-Fu Liu, Tsao Yu-ning, Ding Ning, Rosen Tsai', NULL, 'https://www.youtube.com/watch?v=FQgcG7I2aho', 1, 289, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (296, 878608, 'Résurrection', 'Drame', 'Art et Essai', 'Dans un monde où les humains ne savent plus rêver, un être pas comme les autres perd pied et n''arrive plus à distinguer l’illusion de la réalité. Seule une femme voit clair en lui. Elle parvient à pénétrer ses rêves, en quête de la vérité…', '2025-10-15 00:00:00', 160, 0, 'CN', 'https://image.tmdb.org/t/p/w500/gorqMra7VLpkRvtWzd6v7jEikqu.jpg', NULL, NULL, 'Jackson Yee, Shu Qi, Mark Chao, Li Gengxi', NULL, 'https://www.youtube.com/watch?v=JTh8gePW6FM', 1, 290, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (299, 1280282, 'Gabby et la maison magique - Le film', 'Familial', 'Jeunesse', 'Au cours d''un voyage en voiture avec sa grand-mère Gigi, la maison de poupée de Gabby, son bien le plus précieux, se retrouve entre les mains d''une femme excentrique, Vera. Gabby part alors à l''aventure dans le monde réel...', '2025-10-08 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/AsHpAbkusQPgVwKG3Sm8p2A1rCV.jpg', NULL, NULL, 'Laila Lockhart Kraner, Gloria Estefan, Kristen Wiig, Logan Bailey', NULL, 'https://www.youtube.com/watch?v=qY6cmNfAWEo', 1, 293, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (278, 1214457, 'Les cavaliers des terres sauvages', 'Documentaire', 'Documentaire', '', '2025-10-22 00:00:00', 84, 0, 'AR', 'https://image.tmdb.org/t/p/w500/h6CKjuHrikGMRtjVgnzj2GTguj7.jpg', NULL, NULL, 'Guada Gonza, Tati Gonza, Jony Avalos, Solano Avalos', NULL, 'https://www.youtube.com/watch?v=TJ5lpAxOyEo', 1, 273, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (283, 961077, 'La Petite Dernière', 'Drame', 'Art et Essai', 'Fatima, 17 ans, est la petite dernière. Elle vit en banlieue avec ses sœurs, dans une famille joyeuse et aimante. Bonne élève, elle intègre une fac de philosophie à Paris et découvre un tout nouveau monde. Alors que débute sa vie de jeune femme, elle s’émancipe de sa famille et ses traditions. Fatima se met alors à questionner son identité. Comment concilier sa foi avec ses désirs naissants ?', '2025-10-22 00:00:00', 106, 0, 'FR', 'https://image.tmdb.org/t/p/w500/7ivYhf316ObWRMPxvXuiCd81mnE.jpg', NULL, NULL, 'Nadia Melliti, Park Ji-Min, Amina Ben Mohamed, Rita Benmannana', NULL, 'https://www.youtube.com/watch?v=IS7hDjVTsHs', 1, 278, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (302, 1200277, 'Vous n’êtes pas seuls', 'Romance', 'Art et Essai', 'Léo, un livreur de pizza solitaire et anxieux, tombe sur John, un mystérieux chauffeur de taxi à la recherche d’âmes esseulées. Cette rencontre insolite plonge le jeune homme dans un délire vertigineux, bouleversant l’éclosion de sa romance avec Rita.INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (305, 1456349, 'Un simple accident', 'Drame', 'Art et Essai', 'Après un simple accident, les événements s’enchaînent...', '2025-10-01 00:00:00', 101, 0, 'IR', 'https://image.tmdb.org/t/p/w500/fS0XSf0RHG3WvBndDLsrjcwq9rZ.jpg', NULL, NULL, 'Vahid Mobasseri, Maryam Afshari, Ebrahim Azizi, Hadis Paak Baten', NULL, 'https://www.youtube.com/watch?v=_f7noSoSDd0', 1, 299, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (291, 1318037, 'Le Jour G', 'Comédie', 'Grand Public', 'Juin 1944. L’Europe est déchirée par la guerre, le Débarquement se prépare. Denis Porte continue avec dévouement son travail quotidien sur une base militaire anglaise... factice. Sa mission : déplacer chaque jour des soldats postiches et tromper ainsi l’ennemi. Chez les Porte, on a tendance de père en fils à mourir en héros pour la France. Alors pas question pour sa mère que Porte prenne le moindre risque. S’occuper d’une base factice, c’est le maximum qu’elle tolère pour son fils. Mais après avoir fait la rencontre de Sami, un médecin algérien qui rêve de rencontrer De Gaulle, ils décident lors d’une soirée arrosée d’y prendre part. Ils prennent le large avec bravoure (et pas mal de grammes dans le sang). Sauf qu’ils n’ont pas la bonne date ni le bon lieu. Ajoutez à cela un héros qui ne veut surtout pas s’exposer au danger. Le jour J, euh ou presque …', '2025-10-15 00:00:00', 0, 0, 'FR', '', '', NULL, 'Kev Adams, Brahim Bouhlel, Marie Parisot, Didier Bourdon', NULL, NULL, 285, 285, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (355, 1273051, 'The Invasion', 'Documentaire', 'Documentaire', '', '2025-10-08 00:00:00', 140, 0, 'CZ', 'https://image.tmdb.org/t/p/w500/9HdRMgXRlltpS9zWvn7LsiNqBS0.jpg', NULL, NULL, '', NULL, 'https://www.youtube.com/watch?v=0qR3uHC4qlU', 1, 215, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (301, 1254808, 'Nouvelle Vague', 'Comédie', 'Art et Essai', 'Ceci est l’histoire de Godard tournant « À bout de souffle », racontée dans le style et l’esprit de Godard tournant « À bout de souffle ».', '2025-10-08 00:00:00', 105, 0, 'FR', 'https://image.tmdb.org/t/p/w500/61K6trpEo502AngE4dT9WVo17nk.jpg', NULL, NULL, 'Guillaume Marbeck, Zoey Deutch, Aubry Dullin, Alix Bénézech', NULL, 'https://www.youtube.com/watch?v=qqmnGWhUaM8', 1, 295, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (307, 1315409, 'Invention', 'Drame', 'Art et Essai', 'Après la mort inattendue de son père conspirationniste, sa fille reçoit comme héritage le brevet d’une étrange machine médicale de guérison. C’est à travers la découverte de cette invention et de la rencontre avec celles et ceux qui connaissaient son père qu’elle va peu à peu faire son deuil.', '2025-10-01 00:00:00', 72, 0, 'US', 'https://image.tmdb.org/t/p/w500/98JuYEy6GGxxvZeGOU914hRnm7S.jpg', NULL, NULL, 'Callie Hernandez, Sahm McGlynn, James N. Kienitz Wilkins, Paul Kleiman', NULL, 'https://www.youtube.com/watch?v=8YV5gFRhFY8', 1, 301, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (328, 1374706, 'La bande son des années 90', 'Documentaire', 'Documentaire', 'Plongée dans la décennie 90, la dernière avant le nouveau millénaire. C''était la décennie des Boys Bands et des Spice Girls, de Nirvana et de Corona, de la techno et de Patrick Bruel, de NTM et de Johnny. Côté société, c''était l''époque des premiers téléphones portables, des premiers pas d''Internet, des baggys et des tamagoshis. Ces années 90 ont débuté avec la chute du mur de Berlin, sur un immense espoir et une envie de renouveau. Elles se sont terminées avec la chute des tours jumelles de New York et le chaos à l''aube d''un nouveau millénaire. Des artistes et des personnalités comme Florent Pagny, Patrick Bruel, Etienne Daho, Gaétan Roussel, MC Solaar, Axelle Red et Pascal Nègre livrent leurs souvenirs.', '2025-07-18 00:00:00', 110, 0, 'FR', 'https://image.tmdb.org/t/p/w500/qIaVCyezyFQJB8RHUf4ynzKsVuW.jpg', NULL, NULL, 'Éric Jean-Jean, Axelle Red, Patrick Bruel, Étienne Daho', NULL, 'https://www.youtube.com/watch?v=4bFA17fjChI', 1, 325, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (115, 1228681, 'La Trilogie d''Oslo / Désir', 'Drame', 'Art et Essai', 'Deux hommes hétérosexuels vivent des expériences qui les pousse à reconsidérer leur conception de la sexualité et du genre.', '2025-07-16 00:00:00', 118, 0, 'NO', 'https://image.tmdb.org/t/p/w500/mjxTLdCfyr6GAyW5l5A839W1fKI.jpg', NULL, NULL, 'Jan Gunnar Røise, Thorbjørn Harr, Siri Forberg, Birgitte Larsen', NULL, 'https://www.youtube.com/watch?v=8pA-dnr8jUE', 1, 110, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (360, 1232781, 'La Partition', 'Drame', 'Grand Public', 'Tom, chef d''orchestre à Berlin, est sur le point de devenir le père de l''enfant de son ex-femme. Sa sœur Ellen, entame une liaison avec un homme marié, avec qui elle partage une passion pour l''alcool. Leurs parents déclinent physiquement et se sentent délaissés par leurs enfants. Alors qu''ils tentent de renouer des liens, les non-dits empêchent la famille Lunies de se réconcilier.', '2024-09-04 00:00:00', 180, 0, 'DE', 'https://image.tmdb.org/t/p/w500/eqIUfRmRgR2kCmOcFPKGVEGTXzo.jpg', NULL, NULL, 'Lars Eidinger, Corinna Harfouch, Lilith Stangenberg, Ronald Zehrfeld', NULL, 'https://www.youtube.com/watch?v=AKb13t5z4_g', 1, 356, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (84, 1318480, 'Certains l''aiment chauve', 'Comédie', 'Grand Public', 'Zacharie, tout juste trentenaire, file le parfait amour avec Romy. Du jour au lendemain, cette dernière le quitte lorsqu’elle comprend ce que le futur lui réserve : une calvitie précoce. Dans six mois, il sera chauve comme un genou. Pour l’épauler, Il contacte son oncle Joseph qui connait bien le sujet. Au fil de rencontres improbables, de traitements chocs et de stratégies bancales, il va devoir se battre contre son destin !', '2025-07-16 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/5Q7wdZcjYYZygtNYtYkUvZB1Xlt.jpg', NULL, NULL, 'Kev Adams, Michaël Youn, Rayane Bensetti, Chantal Ladesou', NULL, 'https://www.youtube.com/watch?v=TZRQJSNg8fg', 1, 81, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (357, 1129608, 'த கிரேட்டஸ்ட் ஆஃப் ஆல் டைம்', 'Action', 'Grand Public', 'Les anciens membres d''une unité spéciale antiterroriste, appelée SATS, qui collaborent étroitement avec le RAW. Ensemble, ils doivent affronter une menace directement liée à des décisions prises lors de leurs missions passées.', '2024-09-06 00:00:00', 183, 36000000, 'IN', 'https://image.tmdb.org/t/p/w500/kk9SmNt6QcP5thvSYELWvO0NWuC.jpg', NULL, NULL, 'Vijay, Prashanth, Prabhu Deva, Mohan', NULL, 'https://www.youtube.com/watch?v=V6NxX8snNIw', 1, 353, '2024-09-05 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (277, 1218925, 'Chainsaw Man – The Movie : Reze Arc', 'Animation', 'Jeunesse', 'Après avoir mit hors d''état de nuire Katana Man, Denji va faire la rencontre de Reze, une jeune femme qui semble s''intéresser à lui.', '2025-10-22 00:00:00', 0, 0, 'JP', 'https://image.tmdb.org/t/p/w500/ieSTagNIFeIW2oVm4D9MDiLCHFY.jpg', NULL, NULL, 'Kikunosuke Toya, Reina Ueda, Shiori Izawa, Tomori Kusunoki', NULL, 'https://www.youtube.com/watch?v=tAzAhDNdehs', 1, 272, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (312, 604079, 'Marche ou crève', 'Horreur', 'Grand Public', 'Le jeune Garraty va concourir pour " La Longue Marche ", une compétition qui compte cent participants. Cet événement sera retransmis à la télévision, suivi par des milliers de personnes. Mais ce n’est pas une marche comme les autres, plutôt un jeu sans foi ni loi…', '2025-10-01 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/41wPG2nflDPez7wph5SKJhhBLzV.jpg', NULL, NULL, 'Cooper Hoffman, David Jonsson, Garrett Wareing, Tut Nyuot', NULL, 'https://www.youtube.com/watch?v=64LmACF6Erg', 1, 306, '2025-09-12 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (311, 730251, 'Happyend', 'Drame', 'Art et Essai', 'Dans un futur proche à Tokyo, où la menace d''un séisme catastrophique plane sur la vie quotidienne, deux meilleurs amis rebelles s''apprêtent à terminer le lycée. Une nuit, ils font une farce lourde de conséquences à leur principal qui décide d’installer un système IA de surveillance dans leur l’établissement : coincés entre cette perte de liberté et une situation politique de plus en plus sombre, tous deux réagissent de manière contrastée, confrontant ainsi des différences qu''ils n''avaient jamais ressenties auparavant.', '2025-10-01 00:00:00', 113, 0, 'JP', 'https://image.tmdb.org/t/p/w500/uaSmMj7kBP6elOp4CnpTsrF2AyL.jpg', NULL, NULL, 'Hayato Kurihara, Yukito Hidaka, Yuta Hayashi, Shina Peng', NULL, 'https://www.youtube.com/watch?v=EAeSUU5kHME', 1, 305, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (358, 1352142, 'Alien nation : autopsie d''un monstre artistique', 'Documentaire', 'Documentaire', 'Alien Nation, c’est un mouvement artistique en devenir de la fin des années 1990 et du début des années 2000, créateur de soirées déjantées peuplées d’êtres ultra lookés, assoiffés d’une contre-culture à la convergence des courants gothique, BDSM, fétichiste, techno, hardcore et tribal. Extravagance, délire fortement érotisé, performances artistiques dérangeantes, tels sont les ingrédients de ces fêtes uniques des nuits underground parisiennes de l’époque. L’art transgressif, le corps fétichisé, mis en scène y sont célébrés, avec pour seul credo la liberté.INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (361, 1140721, 'À l''ancienne', 'Comédie', 'Grand Public', 'Deux amis de toujours vivent sur une petite île de Bretagne et découvrent que l''un des habitants a gagné le gros lot à la loterie nationale. Les deux vieilles canailles se mettent alors à la recherche du mystérieux gagnant afin de s''assurer ses faveurs avant que la nouvelle ne se répande. Mais lorsqu’ils découvrent que ce dernier est mort, ticket gagnant en main, ils décident d’organiser avec la complicité de tout le village une grande arnaque au loto pour prendre sa place.', '2024-09-04 00:00:00', 89, 0, 'FR', 'https://image.tmdb.org/t/p/w500/1BAXWoVP71jCIHtD0pRXmupe6w5.jpg', NULL, NULL, 'Gérard Darmon, Didier Bourdon, Chantal Lauby, Paloma Coquant', NULL, 'https://www.youtube.com/watch?v=N03G_Y0yOg0', 1, 357, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (363, 1000434, 'Mi bestia', 'Thriller', 'Grand Public', 'Bogotá en 1996. Une rumeur circule : pendant une éclipse lunaire qui aura lieu dans quelques jours, le diable arrivera. La population est effrayée. Mila, 13 ans, est troublée par cette prophétie. Le monde autour, lui semble plus étrange, et Mila sent qu’elle-même se transforme. Ne serait-elle pas l’être maudit tant annoncé ?', '2024-09-04 00:00:00', 76, 600000, 'CO', 'https://image.tmdb.org/t/p/w500/wewPa62BwgkvRvYM9scBCgomLvW.jpg', NULL, NULL, 'Stella Martinez, Mallerly Murillo, Marcela Mar, Héctor Sánchez', NULL, NULL, 1, 360, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (359, 1341648, 'Ce qui se voit et ce qui ne se voit pas', 'Comédie', 'Grand Public', 'Lors d’une visite à Montmartre, une mère et sa fille d’une trentaine d’années rencontrent une vieille dame qui prédit à la jeune femme qu’elle arrivera bientôt à tomber enceinte et garder son enfant. Quelques mois plus tard, la prédiction de la vieille dame s’est accomplie. La mère va chercher à remercier cette vieille dame, mais elle n’a ni son nom ni aucun indice pour la retrouver. Elle va tenter alors par tous les moyens, même surnaturels, de la revoir. Le film suivra au travers de nombreuses histoires comment la Providence par des chemins cachés va provoquer la rencontre de la mère avec la vieille dame.', '2024-09-04 00:00:00', 78, 0, 'FR', 'https://image.tmdb.org/t/p/w500/v3qPzDLpAjGvnqXRvN1pfPGCjG9.jpg', NULL, NULL, 'Irène Ismaïloff, Christian Diaz, Maud Imbert, Cédric Appietto', NULL, NULL, 1, 355, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (364, 1000127, 'À son image', 'Drame', 'Art et Essai', 'Fragments de la vie d’Antonia, jeune photographe de Corse-Matin à Ajaccio. Son engagement, ses amis, ses amours se mélangent aux grands événements de l’histoire politique de l''île, des années 1980 à l''aube du XXIe siècle. C’est la fresque d’une génération.', '2024-09-04 00:00:00', 113, 0, 'FR', 'https://image.tmdb.org/t/p/w500/ztPyYMQxR6tCLBzZ6OzkXwF7VZr.jpg', NULL, NULL, 'Clara-Maria Laredo, Marc Antonu Mozziconacci, Louis Starace, Barbara Sbraggia', NULL, 'https://www.youtube.com/watch?v=iPm_jppScaw', 1, 361, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (327, 1049942, 'Bambi: The Reckoning', 'Horreur', 'Grand Public', 'Une mère et son fils ont un accident de voiture et se retrouvent bientôt traqués par Bambi, un cerf mutant en pleine frénésie meurtrière, cherchant à se venger de la mort de sa mère.', '2025-07-25 00:00:00', 81, 800000, 'GB', 'https://image.tmdb.org/t/p/w500/cy76B7VCiIvqUibGLTgdYlK8kx8.jpg', NULL, NULL, 'Roxanne McKee, Tom Mulheron, Nicola Wright, Russell Geoffrey Banks', NULL, 'https://www.youtube.com/watch?v=aQ4d9GJPBCM', 1, 323, '2025-07-25 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (362, 1084066, 'Tatami', 'Thriller', 'Grand Public', 'La judokate iranienne Leila et son entraîneuse Maryam se rendent aux Championnats du monde de judo avec l''intention de ramener sa première médaille d''or à l''Iran. Mais au cours de la compétition, elles reçoivent un ultimatum de la République islamique ordonnant à Leila de simuler une blessure et d’abandonner pour éviter une possible confrontation avec l’athlète israélienne. Sa liberté et celle de sa famille étant en jeu, Leila se retrouve face à un choix impossible : se plier au régime iranien, comme l''implore son entraîneuse, ou se battre pour réaliser son rêve.', '2024-09-04 00:00:00', 103, 0, 'US', 'https://image.tmdb.org/t/p/w500/dVtEsQ517Mga3Zcwwa9Ckl8e8n9.jpg', NULL, NULL, 'Arienne Mandi, Zar Amir Ebrahimi, Jaime Ray Newman, Nadine Marshall', NULL, 'https://www.youtube.com/watch?v=maLBtuJDsx0', 1, 359, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (68, 1032472, 'Touch', 'Romance', 'Art et Essai', 'Kristofer, un vieillard solitaire, mène une existence résignée depuis la mort de son épouse, survenue quelques années plus tôt. Inquiété par ses problèmes de mémoire, il consulte un médecin, qui lui apprend qu''il souffre des premiers symptômes de la maladie d''Alzheimer. Kristofer décide alors de profiter du temps qui lui reste pour découvrir ce qui est arrivé à son premier amour, Miko, une japonaise disparue dans des circonstances mystérieuses, il y a 50 ans, à Londres. Alors qu’il s’apprête à retourner en Angleterre, Kristofer apprend que les voyages deviendront bientôt difficiles à cause de la pandémie de COVID-19, qui vient d''éclore. Pour le vieillard, c’est le début d’une véritable course contre la montre.', '2025-07-30 00:00:00', 121, 0, 'IS', 'https://image.tmdb.org/t/p/w500/ozlQnkSWLtEvdF0Xax0HspowccO.jpg', NULL, NULL, 'Egill Ólafsson, Kōki,, Pálmi Kormákur Baltasarsson, Masahiro Motoki', NULL, 'https://www.youtube.com/watch?v=bh9ft_kT88Q', 1, 65, '2024-07-12 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (333, 1212271, 'Eleanor the Great', 'Drame', 'Art et Essai', '', '2025-11-19 00:00:00', 98, 0, 'US', 'https://image.tmdb.org/t/p/w500/5zkKz65sdw8JPjLiYQKeC2kceLb.jpg', NULL, NULL, 'June Squibb, Erin Kellyman, Chiwetel Ejiofor, Jessica Hecht', NULL, 'https://www.youtube.com/watch?v=ozsNcDD2bAk', 1, 330, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (233, 798645, 'Running Man', 'Action', 'Grand Public', 'Dans un futur proche, The Running Man est l’émission numéro un à la télévision : un jeu de survie impitoyable où des candidats, appelés les Runners, doivent échapper pendant 30 jours à des tueurs professionnels, sous l’œil avide d’un public captivé. Chaque jour passé augmente la récompense à la clé — et procure une dose d’adrénaline toujours plus intense.  Ben Richards, ouvrier désespéré prêt à tout pour sauver sa fille gravement malade, accepte l’impensable : participer à ce show mortel, poussé par Dan Killian, son producteur aussi charismatique que cruel. Mais personne n’avait prévu que Ben, par sa rage de vivre, son instinct et sa détermination, devienne un véritable héros du peuple… et une menace pour tout le système.  Alors que les audiences explosent, le danger monte d’un cran. Ben devra affronter bien plus que les Hunters : il devra faire face à un pays entier accro à le voir tomber.', '2025-11-05 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/2ksjtKQyqjufVZawsnpG0uXqJF4.jpg', NULL, NULL, 'Glen Powell, Josh Brolin, Michael Cera, Jayme Lawson', NULL, 'https://www.youtube.com/watch?v=483F9ITL1n0', 1, 228, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (294, 1197137, 'Black Phone 2', 'Horreur', 'Grand Public', 'Depuis son enlèvement, Finney, aujourd’hui âgé de 17 ans, éprouve beaucoup de mal à reprendre le cours d’une vie normale, alors que rien ni personne ne saurait arrêter Gwen, sa sœur de 15 ans. Mais le sinistre téléphone se met à sonner dans les rêves de l’adolescente, où elle voit sans cesse trois garçons se faire pourchasser dans un camp de montagne appelé Alpine Lake. Déterminée à mettre fin à ces cauchemars et à en percer le mystère, Gwenn persuade son frère de se rendre sur place, malgré le blizzard qui frappe la station. C’est là qu’elle découvre l’horrible vérité derrière le lien entre l’Attrapeur et sa propre famille. Les deux adolescents vont alors devoir affronter un tueur que la mort a rendu presque invincible et à qui leurs destins sont beaucoup plus liés qu''ils n’auraient pu l’imaginer.', '2025-10-15 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/xUWUODKPIilQoFUzjHM6wKJkP3Y.jpg', NULL, NULL, 'Ethan Hawke, Mason Thames, Madeleine McGraw, Demián Bichir', NULL, 'https://www.youtube.com/watch?v=3OocNMlIlEI', 1, 288, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (165, 1364904, 'Fantôme Utile', 'Comédie', 'Art et Essai', 'March fait le deuil de sa femme Nat, récemment décédée, victime de la pollution due à la poussière. Il découvre que son esprit est revenu en prenant possession de leur aspirateur. Dérangé par un fantôme, apparu suite à la mort d’un ouvrier qui a causé la fermeture de l’usine, sa famille rejette l’étrange relation entre un homme et un fantôme. Tentant de les convaincre de leur amour, Nat se propose de faire le ménage dans l’usine. Pour devenir un fantôme utile, elle doit d’abord éliminer ceux qui ne servent à rien.', '2025-08-27 00:00:00', 130, 0, 'DE', 'https://image.tmdb.org/t/p/w500/dwlpKYIsgsqRyWxZ71u50TDCKZI.jpg', '', 8, 'Davika Hoorne, Witsarut Himmarat, Apasiri Nitibhon, Wanlop Rungkumjad', NULL, 'https://www.youtube.com/watch?v=CzY56l4cn7Q', 1, 160, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (152, 1172091, 'Wilding, Retour à la Nature Sauvage', 'Documentaire', 'Documentaire', 'L''histoire d''un jeune couple qui mise sur la nature pour assurer l''avenir de son domaine agricole défaillant, vieux de quatre cents ans. Le jeune couple lutte contre des traditions bien ancrées et ose remettre le destin de sa ferme entre les mains de la nature. Ils arrachent les clôtures, rendent la terre à l''état sauvage et confient son rétablissement à un mélange hétéroclite d''animaux apprivoisés et sauvages. C''est le début d''une grande expérience qui deviendra l''une des plus importantes expériences de ré-ensauvagement en Europe.', '2025-09-10 00:00:00', 75, 0, 'GB', 'https://image.tmdb.org/t/p/w500/fiVjT0iojVNBL5wj1Peo9ivh7q1.jpg', NULL, NULL, 'Isabella Tree, Rhiannon Hughes, Matthew Collyer, Charlie Burrell', NULL, 'https://www.youtube.com/watch?v=u1nBnpSfz9U', 1, 147, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (331, 1027273, 'Egoist', 'Drame', 'Art et Essai', 'Éditeur dans la mode, Kōsuke est d’une élégance insolente. Obsédé par son apparence, il embauche Ryūta, un garçon simple, comme coach sportif personnel. Au fil de leurs entraînements, des sentiments de plus en plus passionnés se développent entre les deux hommes, jusqu’au jour où Ryūta disparaît brusquement…', '2025-10-01 00:00:00', 120, 0, 'JP', 'https://image.tmdb.org/t/p/w500/uu2dYVQSGIFRqtAUWykWsiSgup7.jpg', NULL, NULL, 'Ryohei Suzuki, Hio Miyazawa, Sawako Agawa, Yuko Nakamura', NULL, 'https://www.youtube.com/watch?v=csb-2u8S0vI', 1, 328, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (177, 1124566, 'Valeur sentimentale', 'Drame', 'Art et Essai', 'A la mort de leur mère, Nora et Agnès voient leur père Gustav réapparaître dans leur vie. Réalisateur de films autrefois reconnu, il a écrit un scénario dont il voudrait que Nora, devenue comédienne, joue le rôle principal, mais cette dernière refuse catégoriquement. Lors d''une rétrospective qui lui est consacrée dans un festival français, Gustav rencontre une jeune star hollywoodienne qui, bouleversée par l’un de ses films, manifeste son désir de travailler avec lui. Il lui offre le rôle initialement écrit pour Nora, voyant là l’opportunité inespérée de relancer sa carrière. Le tournage en Norvège devient l’occasion pour Gustav d''affronter ses démons et lui donne une dernière chance de renouer avec ses filles.', '2025-08-20 00:00:00', 133, 7800000, 'NO', 'https://image.tmdb.org/t/p/w500/t2n3BUZgflmSCyivnSatqP21kaV.jpg', 'Cannes', 9, 'Renate Reinsve, Inga Ibsdotter Lilleaas, Stellan Skarsgård, Elle Fanning', NULL, 'https://www.youtube.com/watch?v=wX91J8svFoA', 1, 172, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (136, 1315702, 'Dalloway', 'Drame', 'Grand Public', 'Clarissa, romancière en mal d’inspiration, rejoint une résidence d’artistes prestigieuse à la pointe de la technologie. Elle trouve en Dalloway, son assistante virtuelle, un soutien et même une confidente qui l’aide à écrire. Mais peu à peu, Clarissa éprouve un malaise face au comportement de plus en plus intrusif de son IA, renforcé par les avertissements complotistes d’un autre résident. Se sentant alors surveillée, Clarissa se lance secrètement dans une enquête pour découvrir les réelles intentions de ses hôtes. Menace réelle ou délire paranoïaque ?', '2025-09-17 00:00:00', 120, 200000, 'FR', 'https://image.tmdb.org/t/p/w500/bRx0YRptSuv7O9LiOP59cvA4rqB.jpg', '', 7, 'Mylène Farmer, Cécile de France, Anna Mouglalis, Lars Mikkelsen', NULL, 'https://www.youtube.com/watch?v=5F5UjXk7enQ', 1, 131, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (81, 617126, 'Les 4 Fantastiques : Premiers pas', 'Science-Fiction', 'Grand Public', 'Dans le contexte vibrant d’un monde rétro-futuriste inspiré des années 60, Fantastic Four : First Steps présente la première famille de Marvel : Reed Richards/Mister Fantastic, Sue Storm/La Femme Invisible, Johnny Storm/La Torche Humaine et Ben Grimm/La Chose  alors qu’ils font face à leur défi le plus redoutable à ce jour. Contraints d’équilibrer leur rôle de héros avec la force de leur lien familial, ils doivent défendre la Terre contre un dieu spatial vorace appelé Galactus et son énigmatique héraut, le Surfeur d’Argent. Et comme si le plan de Galactus de dévorer la planète entière et tous ses habitants n’était pas déjà assez mauvais, cela devient soudainement très personnel.', '2025-07-23 00:00:00', 130, 0, 'US', 'https://image.tmdb.org/t/p/w500/2REHnvEBsPA121X4Fi8dvGaYJ4o.jpg', NULL, NULL, 'Pedro Pascal, Vanessa Kirby, Joseph Quinn, Ebon Moss-Bachrach', NULL, 'https://www.youtube.com/watch?v=mVlzRbUaxZ8', 1, 78, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (23, 1013446, 'Reflet dans un diamant mort', 'Thriller', 'Grand Public', 'John D, un septuagénaire vivant dans un hôtel de luxe sur la Côte d’Azur, est intrigué par sa voisine de chambre qui lui rappelle les heures les plus folles de la Riviera durant les années 60.À cette époque, il était espion dans un monde en pleine expansion et plein de promesses. Un jour, cette voisine disparaît mystérieusement... et replonge John face à ses démons : ses adversaires d’antan sont-ils de retour pour semer le chaos dans son monde idyllique ?', '2025-06-25 00:00:00', 87, 0, 'BE', 'https://image.tmdb.org/t/p/w500/scOBEcIfVlG890tKV5XI42t0EhU.jpg', NULL, NULL, 'Fabio Testi, Yannick Renier, Koen De Bouw, Maria de Medeiros', NULL, 'https://www.youtube.com/watch?v=8-JuPgJc_J0', 1, 23, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (34, 1294706, 'Le rendez-vous de l’été', 'Comédie', 'Art et Essai', 'Au cœur des Jeux olympiques de Paris 2024. Blandine, 30 ans, est venue de Normandie pour assister aux compétitions de natation et retrouver une demi- sœur perdue de vue depuis 10 ans. Habituée au calme et à la solitude, Blandine découvre une ville bouillonnante dont elle n’a pas les codes. Au fil des jours, la jeune femme fait des rencontres, se perd, hésite, tente de (re)tisser des liens et de naviguer au cœur d’une ville enfiévrée par cet événement hors normes…', '2025-06-11 00:00:00', 77, 0, 'FR', 'https://image.tmdb.org/t/p/w500/6eqcRb1dlCJNUNp0NwntuzFeL1J.jpg', NULL, NULL, 'Blandine Madec, India Hair, Arcadi Radeff, Matthias Jacquin', NULL, '1', 1, 33, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (88, 1084816, 'Les Filles désir', 'Drame', 'Art et Essai', 'Marseille en plein été. À 20 ans, Omar et sa bande, moniteurs de centre aéré et respectés du quartier, classent les filles en deux catégories : celles qu''on baise et celles qu''on épouse. Le retour de Carmen, amie d’enfance ex-prostituée, bouleverse et questionne leur équilibre, le rôle de chacun dans le groupe, leur rapport au sexe et à l’amour.', '2025-07-16 00:00:00', 93, 0, 'FR', 'https://image.tmdb.org/t/p/w500/r39yrDtzZ2d9Obkwa1EsOpbYhZc.jpg', NULL, NULL, 'Houssam Mohamed, Leïa Haichour, Lou Anna Hamon, Kader Benchoudar', NULL, NULL, 1, 85, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (200, 1036950, 'Le premier venu', 'Comédie', 'Grand Public', 'Dans une dizaine de jours, Gina, présentatrice de la minute hippique et héritière des poivres Duval, va se marier avec Mathieu, professeur d’université spécialisé dans l’équation de Schrödinger, son fiancé de longue date, qui a tout pour plaire. Gina baigne dans le bonheur jusqu’au soir où, en rentrant chez elle, elle découvre que leur appartement a été cambriolé. Et puis, après analyse du vol, elle comprend qu’il n’y a que les affaires de Mathieu qui manquent... En fait de vol, Gina s’est fait larguer comme une pauvre chose. Elle est inconsolable. Sa meilleure amie lui conseille de coucher avec le premier venu, histoire de retrouver un peu d’amour propre.', '2025-07-02 00:00:00', 90, 0, 'FR', 'https://image.tmdb.org/t/p/w500/jDl8SahQ6hNTN3pjm0OpmPZTr2O.jpg', NULL, NULL, 'Claire Keim, Makita Samba, Pierre Arditi, Laurent Capelluto', NULL, '1', 1, 195, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (15, 1254135, '13 jours, 13 nuits', 'Action', 'Grand Public', 'Kaboul, 15 août 2021. Alors que les troupes américaines s''apprêtent à quitter le territoire, les Talibans prennent d’assaut la capitale et s''emparent du pouvoir. Au milieu du chaos, le commandant Mohamed Bida et ses hommes assurent la sécurité de l''ambassade de France, encore ouverte. Pris au piège, le commandant Bida décide de négocier avec les Talibans pour organiser un convoi de la dernière chance avec l’aide d’Eva, une jeune traductrice franco-afghane. Commence alors une course contre la montre pour conduire les évacués jusqu’à l’aéroport et fuir l’enfer de Kaboul avant qu''il ne soit trop tard.', '2025-06-27 00:00:00', 112, 31400000, 'BE', 'https://image.tmdb.org/t/p/w500/j3FN1msfXUOFGhy9viu4NNL6btF.jpg', NULL, NULL, 'Roschdy Zem, Lyna Khoudri, Sidse Babett Knudsen, Christophe Montenez', NULL, 'https://www.youtube.com/watch?v=OqSlnLsNfnA', 1, 15, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (43, 973628, 'A Normal Family', 'Drame', 'Art et Essai', 'Deux frères, un avocat matérialiste et un chirurgien idéaliste, et leurs épouses respectives, se retrouvent une fois par mois autour d''un dîner. Au cours d''un de ces repas, les deux couples abordent l''agression criminelle de leurs enfants sur un vagabond. Ils font face alors à leurs différences de moralité et à des secrets longtemps enfouis...', '2025-06-11 00:00:00', 116, 0, 'KR', 'https://image.tmdb.org/t/p/w500/6oKxIHM08TRkv7QCpi9cqHU1q9F.jpg', NULL, NULL, 'Sul Kyung-gu, Jang Dong-gun, Kim Hee-ae, Claudia Kim', NULL, '1', 1, 42, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (144, 999075, 'Left-Handed Girl', 'Drame', 'Art et Essai', 'Une mère célibataire et ses deux filles arrivent à Taipei pour ouvrir une petite cantine au cœur d''un marché nocturne de la capitale taiwanaise. Chacune d''entre elles doit trouver un moyen de s''adapter à cette nouvelle vie et réussir à maintenir l''unité familiale.', '2025-09-17 00:00:00', 108, 0, 'TW', 'https://image.tmdb.org/t/p/w500/DEiZIMxoTh91BIn8Z3SlzabNDA.jpg', NULL, NULL, 'Janel Tsai, Brando Huang, Ma Shih-yuan, Nina Yeh', NULL, 'https://www.youtube.com/watch?v=-IdNKnzbrVw', 1, 139, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (143, 1000169, 'Muganga - Celui qui soigne', 'Histoire', 'Art et Essai', 'Denis Mukwege, docteur Congolais, pasteur et futur lauréat du Prix Nobel de la Paix, rencontre Guy Cadière, chirurgien belge et athée. Au-delà de leurs differences, ils s’unissent pour une mission commune : redonner un corps et une dignité à des milliers de femmes utilisées comme armes de guerre dans l’est de la République démocratique du Congo.', '2025-09-17 00:00:00', 120, 0, 'BE', '', NULL, NULL, 'Isaach de Bankolé, Vincent Macaigne, Manon Bresch, Babetida Sadjo', NULL, NULL, 1, 138, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (272, 1220566, 'Les aigles de la république', 'Drame', 'Art et Essai', 'George Fahmy, l’acteur le plus adulé d’Egypte, accepte sous la contrainte de jouer dans un film commandé par les plus hautes autorités du Pays. Il se retrouve plongé dans le cercle étroit du pouvoir. Comme un papillon de nuit attiré par la lumière, il entame une liaison avec la mystérieuse épouse du général qui supervise le film.', '2025-10-29 00:00:00', 129, 0, 'DK', 'https://image.tmdb.org/t/p/w500/aohnANrzvGo2WkZsuHqinQhKkwU.jpg', NULL, NULL, 'Fares Fares, Lyna Khoudri, Zineb Triki, Amr Waked', NULL, NULL, 1, 267, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (286, 1461294, 'Red Bird', 'Action', 'Grand Public', 'Max pansait les blessures de son père Alex lorsqu’il rentrait de ses missions secrètes sous l’identité du « Red Bird ». Aujourd’hui, son père étant mort dans des circonstances étranges, Max va remonter les pistes une à une pour trouver le ou les responsables, accompagné de son ami de toujours, Sam.', '2025-10-15 00:00:00', 100, 100000, 'FR', 'https://image.tmdb.org/t/p/w500/eRRbDK8YeqOuPeKodcerRQR5AJD.jpg', NULL, NULL, 'Jean-Louis Tribes, Eric Delcourt, Chris Tomneer, Jean-Marie Paris', NULL, NULL, 1, 281, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (248, 83533, 'Avatar: Fire and Ash', 'Science-Fiction', 'Grand Public', 'Le troisième volet de la saga Avatar.  Après avoir exploré la forêt luxuriante dans Avatar 1 et les océans dans Avatar 2 : La Voie de l’Eau, Avatar 3 : Feu et Cendres s’aventurera dans des paysages volcaniques à couper le souffle. Le film introduira une nouvelle tribu Na’vi, surnommée le peuple des cendres, vivant à proximité d’un volcan actif. Ces Na’vi, bien plus belliqueux que les clans vus jusqu’à présent, représenteront un défi de taille pour Jake Sully et sa famille.  Selon James Cameron, cette tribu apportera une nouvelle dynamique à l’univers de Pandora, en incarnant une force conflictuelle influencée par un environnement extrême.', '2025-12-17 00:00:00', 192, 400000000, 'US', 'https://image.tmdb.org/t/p/w500/vDdFxksDMkUJjZXd00OKJfwXKre.jpg', NULL, NULL, 'Sam Worthington, Zoe Saldaña, Sigourney Weaver, Stephen Lang', NULL, NULL, 1, 243, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (220, 1257406, 'Deux procureurs', 'Drame', 'Art et Essai', 'Union Soviétique, 1937. Des milliers de lettres de détenus accusés à tort par le régime sont brûlées dans une cellule de prison. Contre toute attente, l’une d’entre elles arrive à destination, sur le bureau du procureur local fraîchement nommé, Alexander Kornev. Il se démène pour rencontrer le prisonnier, victime d’agents de la police secrète, la NKVD. Bolchévique chevronné et intègre, le jeune procureur croit à un dysfonctionnement. Sa quête de justice le conduira jusqu’au bureau du procureur-général à Moscou. A l’heure des grandes purges staliniennes, c’est la plongée d’un homme dans un régime totalitaire qui ne dit pas son nom.', '2025-11-12 00:00:00', 118, 0, 'FR', 'https://image.tmdb.org/t/p/w500/tZvE4CkWvazDWuG44RzhU2AhmAc.jpg', NULL, NULL, 'Aleksandr Kuznetsov, Aleksandr Filippenko, Anatoliy Belyy, Andris Keišs', NULL, '1', 1, 215, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (319, 896096, 'Le Mystérieux regard du flamant rose', 'Drame', 'Art et Essai', 'Début des années 1980, dans le désert chilien. Lidia, 11 ans, grandit au sein d’une famille queer flamboyante et aimante, qui a trouvé refuge dans un cabaret, aux abords d’une ville minière rude et poussiéreuse. Quand une mystérieuse maladie mortelle commence à se propager – une rumeur affirme qu’elle se transmet par un simple regard, lorsqu’un homme tombe amoureux d’un autre – la communauté devient rapidement la cible des peurs et fantasmes collectifs. Dans ce western moderne, Lidia se lance dans une quête de vengeance dans un monde rongé par la haine et l’intolérance. Sa famille devient son unique refuge, et l’amour, peut-être, le plus grand des dangers.', '2026-01-07 00:00:00', 104, 0, 'CL', 'https://image.tmdb.org/t/p/w500/3Zv1cEy1zuHKQ12nncmX5irCgXh.jpg', NULL, NULL, 'Tamara Cortés, Matías Catalán, Paula Dinamarca, Claudia Cabezas', NULL, NULL, 1, 313, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (321, 975335, 'Magalhães', 'Drame', 'Art et Essai', 'Magellan, navigateur portugais épris de liberté, se rebelle contre l’autorité du Roi qui refuse de soutenir ses rêves d’exploration. Porté par une soif insatiable de découvrir les confins du monde, il convainc la Couronne espagnole de financer une expédition audacieuse vers les terres mythiques de l’Est. Mais le voyage se transforme en un périple éprouvant : la faim, les tempêtes et les mutineries mettent l’équipage à genoux. Lorsque Magellan atteint enfin les îles de l’archipel malais, l’explorateur idéaliste s’efface pour laisser place à un conquérant obsédé par la domination et la conversion, provoquant des soulèvements violents qui commencent à lui échapper… Ce n’est pas le mythe de Magellan, mais la vérité de son voyage.', '2025-12-31 00:00:00', 156, 0, 'ES', 'https://image.tmdb.org/t/p/w500/dHIq1OXRJl3eKbTjLZbqzzgqyO7.jpg', NULL, NULL, 'Gael García Bernal, Dario Yazbek Bernal, Ângela Ramos, Amado Arjay Babon', NULL, 'https://www.youtube.com/watch?v=7gmzROBvD1g', 315, 315, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (282, 989246, 'Le Secret des mésanges', 'Animation', 'Jeunesse', 'Lucie, petite fille dégourdie de 10 ans, vient passer quelques jours de vacances avec sa mère, Caroline. Celle-ci est archéologue et participe à des fouilles à la campagne avec Pierrot, un collègue débonnaire. Très vite, Lucie découvre que sa mère a vécu enfant dans cette région et qu’elle cache un secret sur son histoire familiale. Encouragée dans sa quête par un couple de mésanges et d’autres amis à quatre pattes, Lucie entraîne dans ses aventures Yann, un nouveau copain qui, bien malgré lui, va se retrouver au coeur des évènements. Tous les deux vont aller de surprises insolites en découvertes fabuleuses.', '2025-10-22 00:00:00', 66, 4600000, 'BE', 'https://image.tmdb.org/t/p/w500/3y4ht5GM03SuNSbNuVz60i32MDf.jpg', NULL, NULL, '', NULL, NULL, 1, 277, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (156, 979976, 'Connemara', 'Drame', 'Grand Public', 'Issue d''un milieu modeste, Hélène a quitté depuis longtemps les Vosges. Aujourd''hui, elle a la quarantaine. Un burn-out brutal l’oblige à quitter Paris, revenir là où elle a grandi, entre Nancy et Epinal. Elle s''installe avec sa famille, retrouve un bon travail, la qualité de vie en somme… Un soir, sur le parking d’un restaurant franchisé, elle aperçoit un visage connu, Christophe Marchal, le beau Hockeyeur des années lycées. Christophe, ce lointain objet de désir, une liaison qu''Hélène n''avait pas vu venir... Dans leurs étreintes, ce sont deux France, deux mondes désormais étrangers qui rêvent de s’aimer. Cette idylle, cette ile leur sera-t-elle possible ?', '2025-09-10 00:00:00', 112, 5250375, 'FR', 'https://image.tmdb.org/t/p/w500/hUXBefd5T5Y1flyDF0xGNYpHOt2.jpg', '', 7, 'Mélanie Thierry, Bastien Bouillon, Jacques Gamblin, Bruno Sanches', NULL, 'https://www.youtube.com/watch?v=yddw3JBzkbo', 1, 151, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (288, 1337985, 'Lumière pâle sur les collines', 'Drame', 'Art et Essai', 'Royaume-Uni, 1982. Une jeune anglo-japonaise entreprend d’écrire un livre sur la vie de sa mère, Etsuko, marquée par les années d’après-guerre à Nagasaki et hantée par le suicide de sa fille aînée. Etsuko commence le récit de ses souvenirs trente ans plus tôt, lors de sa première grossesse, quand elle se lia d''amitié avec la plus solitaire de ses voisines, Sachiko, une jeune veuve qui élevait seule sa fille. Au fil des discussions, l’écrivaine remarque une certaine discordance dans les souvenirs de sa mère… les fantômes de son passé semblent toujours là - silencieux, mais tenaces.', '2025-10-15 00:00:00', 123, 0, 'JP', 'https://image.tmdb.org/t/p/w500/f0CGpo5HvSzC0HKP8FNlPEUdApT.jpg', NULL, NULL, 'Suzu Hirose, Fumi Nikaido, Yoh Yoshida, Camilla Aiko', NULL, NULL, 283, 283, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (292, 1266798, 'Chien 51', 'Thriller', 'Grand Public', 'Dans un futur proche, Paris a été divisé en 3 zones qui séparent les classes sociales et où l’intelligence artificielle ALMA a révolutionné le travail de la police. Jusqu’à ce que son inventeur soit assassiné et que Salia et Zem, deux policiers que tout oppose, soient forcés à collaborer pour mener l’enquête.', '2025-10-15 00:00:00', 0, 0, 'BE', '', NULL, NULL, 'Gilles Lellouche, Adèle Exarchopoulos, Stéphane Bak, Hugo Dillon', NULL, 'https://www.youtube.com/watch?v=QT93A5IJNqw', 1, 286, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (263, 1320420, 'Медовий місяць', 'Drame', 'Art et Essai', 'Février 2022. Olya et Taras sont heureux de passer leur première nuit dans leur nouvel appartement. À l’aube, ils sont réveillés par une série d’explosions. L’invasion russe a commencé et le jeune couple se retrouve piégé chez lui, entouré de soldats ennemis. Ils vont découvrir des sentiments contraires : la peur mais aussi, l''amour et l''espoir. Ils vont alors apprendre à survivre…', '2025-09-24 00:00:00', 84, 0, 'UA', 'https://image.tmdb.org/t/p/w500/1wkVjyfj423wufIdFVaY0pAsJro.jpg', NULL, NULL, 'Roman Lutskyi, Irina Nirsha', NULL, 'https://www.youtube.com/watch?v=-_y4wOabPSU', 1, 258, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (155, 1038392, 'Conjuring : L''Heure du jugement', 'Horreur', 'Grand Public', 'Ed et Lorraine Warren sortent de leur retraite en 1986 pour enquêter sur l''effroyable affaire Smurl. Confrontés à une entité démoniaque d''une noirceur inédite, ils sont rejoints par leur fille Judy, désormais adulte et dotée de dons médiumniques, et son compagnon Tony. Une ultime enquête où la foi, la famille et le surnaturel s''entrelacent dans une lutte désespérée contre le mal.', '2025-09-10 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/29ES27icY5CzTcMhlz1H4SdQRod.jpg', NULL, NULL, 'Vera Farmiga, Patrick Wilson, Mia Tomlinson, Ben Hardy', NULL, 'https://www.youtube.com/watch?v=NDHT2OfitHw', 1, 150, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (264, 1211736, 'Disco Afrika : une histoire malgache', 'Drame', 'Art et Essai', 'Madagascar, aujourd’hui. Kwame, 20 ans, tente de gagner sa vie dans les mines clandestines de saphir. Suite à un événement inattendu, il doit rejoindre sa ville natale où il retrouve sa mère, d’anciens amis, mais aussi la corruption qui gangrène son pays. Ballotté par des sentiments contraires, il va devoir choisir entre argent facile et fraternité, individualisme et éveil à une conscience politique.', '2025-09-24 00:00:00', 80, 0, 'DE', 'https://image.tmdb.org/t/p/w500/hkvnqRqYICduXSESqdWp4jxD8jG.jpg', NULL, NULL, 'Delanoël Parista Sambo, Laurette Ramasinjanahary, Joe Clarence Lerova, Drwina Razafimahaleo', NULL, 'https://www.youtube.com/watch?v=AhBygNimJ8g', 1, 259, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (159, 1313032, 'Ciudad sin sueño', 'Drame', 'Art et Essai', 'Toni, un garçon Rom de 15 ans, vit dans le plus grand bidonville illégal d''Europe, en périphérie de Madrid. Fier d''appartenir à sa famille de ferrailleurs, il suit son grand-père partout. Mais à mesure que leur terrain devient la proie des démolisseurs, la famille se divise : lorsque certains choisissent de partir en ville, son grand-père, lui, refuse de quitter leurs terres. Au fil des nuits, Toni doit faire un choix : s’élancer vers un avenir incertain ou s''accrocher au monde de son enfance.', '2025-09-03 00:00:00', 97, 0, 'FR', 'https://image.tmdb.org/t/p/w500/nDW75PMamILrE9eBNmYYsLe13si.jpg', NULL, NULL, 'Antonio Fernández, Fernández Gabarre, Bilal Sedraoui, Fernández Silva', NULL, 'https://www.youtube.com/watch?v=GnGRJzFQb_I', 1, 154, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (308, 1241921, 'A Big Bold Beautiful Journey', 'Drame', 'Grand Public', 'Imaginez pouvoir ouvrir une porte et la franchir pour revivre un moment décisif de votre passé. Sarah et David, deux inconnus célibataires, se rencontrent lors du mariage d''un ami commun et, par un incroyable coup du sort, se lancent ensemble dans une aventure grandiose - drôle, fantastique et pleine d''émotions - où ils revivent des instants marquants de leurs vies respectives. Ces souvenirs retracent leurs parcours et pourraient bien leur offrir une chance de transformer leur avenir.', '2025-10-01 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/raXxfnnWEYukSCA6y89peh3NPjl.jpg', NULL, NULL, 'Colin Farrell, Margot Robbie, Kevin Kline, Phoebe Waller-Bridge', NULL, 'https://www.youtube.com/watch?v=7gFZTipYNEw', 1, 302, '2025-09-19 00:00:00');
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (158, 1408208, 'Exit 8', 'Horreur', 'Art et Essai', 'Un homme piégé dans un couloir de métro cherche la sortie numéro 8. Pour la trouver, il faut traquer les anomalies. S’il en voit une, il fait demi-tour. S’il n’en voit aucune, il continue. Mais s’il se trompe, il est renvoyé à son point de départ. Parviendra-t-il à sortir de ce couloir sans fin ?', '2025-09-03 00:00:00', 100, 0, 'JP', 'https://image.tmdb.org/t/p/w500/4moIv5Zewxg0gFuNC7m75x3JbDx.jpg', '', 0, 'Kazunari Ninomiya, Yamato Kochi, Naru Asanuma, Kotone Hanase', NULL, 'https://www.youtube.com/watch?v=k0bFK_DofF0', 1, 153, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (164, 480657, 'Ni dieux ni maîtres', 'Drame', 'Art et Essai', 'An 1215. Hiver. Un mystérieux étranger, prisonnier évadé, arrive dans un petit village isolé du royaume de France où sévissent la famine et la lèpre et dominé par un seigneur vieillissant, un ancien héros des croisades, le Seigneur Ocam. Avec sa horde de chevaliers, Ocam enlève une jeune fille du village afin d’exercer sur elle son droit de cuissage. Une poignée de villageois, épaulés par L’Etranger tente de la délivrer. Ils ont jusqu’à la tombée du jour.', '2025-09-03 00:00:00', 78, 0, 'FR', 'https://image.tmdb.org/t/p/w500/pGgjA55dG8g36Q52ewSWRG6fUGF.jpg', '', NULL, 'Jenna Thiam, Édith Scob, Saleh Bakri, Jean-Claude Drouot', NULL, NULL, 159, 159, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (141, 1149614, 'Oui', 'Drame', 'Art et Essai', 'Israël au lendemain du 7 octobre. Y., musicien de jazz précaire, et sa femme Jasmine, danseuse, donnent leur art, leur âme et leur corps aux plus offrants, apportent plaisir et consolation à leur pays qui saigne. Bientôt, Y. se voit confier une mission de la plus haute importance : mettre en musique un nouvel hymne national.', '2025-09-17 00:00:00', 150, 0, 'CY', 'https://image.tmdb.org/t/p/w500/tuRrL7F3aEg0smXUlUEbaGS4Ooo.jpg', NULL, NULL, 'Ariel Bronz, Efrat Dor, Naama Preis, Aleksey Serebryakov', NULL, NULL, 1, 136, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (153, 1151272, 'Sirāt', 'Drame', 'Art et Essai', 'Un père et son fils parviennent à une rave perdue au cœur des montagnes du sud du Maroc. Ils cherchent Mar — fille et sœur — disparue depuis plusieurs mois lors de l’une de ces fêtes sans fin. Plongés dans la musique électronique et une liberté brute qui leur est étrangère, ils distribuent inlassablement sa photo. L’espoir s’amenuise, mais ils s’obstinent et suivent un groupe de ravers vers une dernière fête dans le désert. À mesure qu’ils s’enfoncent dans l’immensité brûlante, le voyage les confronte à leurs propres limites.', '2025-09-10 00:00:00', 120, 0, 'ES', 'https://image.tmdb.org/t/p/w500/8rs2tm9DBgjmueLnXpmBJ7b2Jru.jpg', '', NULL, 'Sergi López, Bruno Núñez, Richard Bellamy, Stefania Gadda', NULL, 'https://www.youtube.com/watch?v=4NugY9WLrDc', 1, 148, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (297, 840873, 'Marcel et Monsieur Pagnol', 'Animation', 'Jeunesse', 'A l’apogée de sa gloire, Marcel Pagnol reçoit la commande d’une rédactrice en chef d’un grand magazine féminin pour l’écriture d’un feuilleton littéraire, dans lequel il pourra raconter son enfance, sa Provence, ses premières amours...INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (181, 1265717, 'À feu doux', 'Drame', 'Art et Essai', 'Élégante octogénaire, Ruth Goldman reçoit un homme à déjeuner. Alors qu’elle pense poursuivre le rendez-vous galant vers une destination surprise, elle est menée à une résidence médicalisée.  Portée par un appétit de vivre insatiable et malgré sa mémoire capricieuse, Ruth s’y réapproprie son âge et ses désirs.', '2025-08-13 00:00:00', 90, 0, 'US', 'https://image.tmdb.org/t/p/w500/oK60bJWEDuBMfN26v4Ty2iSRbxo.jpg', 'Présenté dans la sélection Orizzonti lors de la dernière édition de la Mostra de Venise, À feu doux est reparti avec le prix du meilleur premier film (Lion du Futur) ainsi que celui de meilleure réalisatrice pour Sarah Friedland et celui de la meilleure actrice pour Kathleen Chalfant.', 7, 'Kathleen Chalfant, Carolyn Michelle, Andy McQueen, H. Jon Benjamin', NULL, 'https://www.youtube.com/watch?v=NY7qpocVWZE', 1, 176, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (71, 1326057, '7 jours', 'Drame', 'Art et Essai', 'Myriam, activiste et militante pour les droits de l’Homme, est emprisonnée depuis des années en Iran loin de son mari et de ses enfants. Lorsqu’elle obtient enfin une permission pour raisons médicales, elle a 7 jours pour décider de fuir le pays et retrouver sa famille ou de rester en Iran pour continuer sa lutte. Commence alors une véritable course contre la montre.', '2025-08-06 00:00:00', 113, 0, 'DE', 'https://image.tmdb.org/t/p/w500/andlGLlEdoUpn3YQYiWfMqlHrte.jpg', ' écrit par Mohammad RASOULOF', 0, 'Vishka Asayesh, Majid Bakhtiari, Sina Parvaneh, Zanyar Mohammadi', NULL, 'https://www.youtube.com/watch?v=IerZ6N6RMQQ', 1, 68, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (185, 1115780, 'La voie du serpent', 'Crime', 'Art et Essai', 'Albert Bacheret est un père dévasté par la disparition inexplicable de sa fille de huit ans. Alors que la police semble incapable de résoudre l''affaire, il décide de mener sa propre enquête et reçoit l''aide inattendue de Sayoko, une énigmatique psychiatre japonaise. Ensemble, ils kidnappent des responsables du "Cercle", une société secrète. Mais chaque nouvel indice mène à un nouveau suspect qui présente toujours une version différente des faits... Obsédé par la vérité, Albert va devoir naviguer entre sa soif aveugle de vengeance et une infinie spirale de mensonges.', '2025-09-03 00:00:00', 112, 0, 'JP', 'https://image.tmdb.org/t/p/w500/p6pB98PB2xAOzMLWUMTuZkpkEYA.jpg', '', 0, 'Damien Bonnard, Ko Shibasaki, Mathieu Amalric, Grégoire Colin', NULL, 'https://www.youtube.com/watch?v=iup5EVXGyG4', 1, 53, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (377, 1316564, 'A Wu-Tang Experience: Live at Red Rocks Amphitheatre', 'Musical', 'Documentaire', '', '2025-09-17 00:00:00', 0, 0, 'US', 'https://image.tmdb.org/t/p/w500/wHtVmlGJ0Vv1gcYLzBJHcTExipv.jpg', NULL, NULL, 'RZA, Method Man, Christopher Dragon, Oliver "Power" Grant', NULL, NULL, 0, 371, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (122, 1465560, 'Put Your Soul on Your Hand and Walk', 'Documentaire', 'Documentaire', 'Put Your Soul on Your Hand and Walk est ma réponse en tant que cinéaste, aux massacres en cours des Palestiniens. Un miracle a eu lieu lorsque j’ai trouvé Fatem Hassouna, présentée à moi par un ami palestinien. Depuis, elle m’a prêté ses yeux pour voir Gaza où elle résistait en documentant la guerre, et moi, je suis devenue un lien entre elle et le reste du monde, depuis sa « prison de Gaza » comme elle le disait. Nous avons maintenu cette ligne de vie pendant plus de 200 jours. Les bouts de pixels et sons que l’on a échangé, sont devenu le film que vous voyez. L’assassinat de Fatem le 16 avril 2025 suite à une attaque israélienne sur sa maison en change à jamais le sens.', '2025-09-24 00:00:00', 110, 0, 'FR', 'https://image.tmdb.org/t/p/w500/gCksDwMpAO96GZq6XKkYsenNgKj.jpg', NULL, NULL, 'Fatima Hassouna, Sepideh Farsi', NULL, 'https://www.youtube.com/watch?v=ufm-NpHa-p4', 1, 117, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (375, 1026225, 'King of Kings: Chasing Edward Jones', 'Documentaire', 'Documentaire', '', '2025-09-10 00:00:00', 98, 1000000, 'FR', 'https://image.tmdb.org/t/p/w500/5db3GcDgV2tXaaCFgsaiAgIoZF3.jpg', NULL, NULL, 'Quincy Jones, Sylvie Laurent, Robert M. Lombardo, Johanna Marin Coles', NULL, 'https://www.youtube.com/watch?v=zLZKf768i4k', 0, 369, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (270, 1233506, 'L''Homme qui rétrécit', 'Aventure', 'Grand Public', 'Paul, un homme ordinaire, partage sa vie entre son entreprise de construction navale, sa femme Elise, et leur fille Mia. Lors d’une sortie en mer, Paul se retrouve confronté à un étrange phénomène météorologique inexpliqué. Dès lors, Paul rétrécit inexorablement, sans que la science ne puisse lui expliquer pourquoi ni lui être d’aucun secours. Quand, par accident, il se retrouve prisonnier dans sa propre cave, et alors qu’il ne mesure plus que quelques centimètres, il va devoir se battre pour survivre dans cet environnement banal devenu périlleux.', '2025-10-29 00:00:00', 0, 0, 'FR', 'https://image.tmdb.org/t/p/w500/yAXJnh8QCdjx6OMTDZjsyops1w0.jpg', NULL, NULL, 'Jean Dujardin, Marie-Josée Croze, Daphné Richard, Serge Swysen', NULL, 'https://www.youtube.com/watch?v=VM9Xv9f4VUU', 1, 265, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (378, 1446078, 'La Malédiction des Tahu''a', 'Thriller', 'Grand Public', 'La soirée de Moea, une contrôleuse aérienne sur un atoll isolé du Pacifique. Alors qu’une tempête tropicale arrive, elle est contactée par un avion en difficulté qui n’apparaît sur aucun radar. Tandis que d’étranges phénomènes font leur apparition, Moea comprend que la vraie menace se trouve à l’intérieur de l’avion.', '2025-09-03 00:00:00', 0, 0, 'FR', '', NULL, NULL, 'Marie Kaffman, Alexandra Gentil, Ali Tiemoko-Haïdara, Ha''anui Bellais', NULL, NULL, 0, 372, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (376, 1440650, 'La Casa', 'Documentaire', 'Documentaire', '', '2025-09-03 00:00:00', 85, 0, 'FR', 'https://image.tmdb.org/t/p/w500/ha5ETF7rhsvQ6HX2hGEjgiAFOKA.jpg', NULL, NULL, '', NULL, NULL, 0, 370, NULL);
INSERT INTO public."Film" (id, "tmdbId", title, genre, category, synopsis, "releaseDate", duration, budget, origin, "posterUrl", commentaire, rating, actors, keywords, "trailerUrl", seances, "directorId", "releaseCanDate") VALUES (322, 1151031, 'Substitution - Bring Her Back', 'Horreur', 'Art et Essai', 'À la mort accidentelle de son père, Andy réclame la garde de Piper, sa demi-soeur malvoyante, mais il lui manque trois mois pour atteindre les 18 ans réglementaires. En attendant, les services sociaux placent Piper chez Laura, une conseillère habituée de ce genre de cas. Mais le protecteur Andy refuse de se séparer de sa demi-soeur et s''impose chez Laura, qui habite une grande maison à la campagne. Très vite, l''adolescent remarque le comportement étrange et intrusif de leur hôtesse, qui héberge déjà Oliver, un petit garçon muet et plutôt inquiétant. Il appert que la conseillère faussement affable poursuit un rêve: éveiller l''esprit de sa propre fille morte noyée.', '2025-07-30 00:00:00', 104, 15000000, 'AU', 'https://image.tmdb.org/t/p/w500/lNwjWspvbwd9wQYpVKXaZm9LfK9.jpg', NULL, NULL, 'Sally Hawkins, Sora Wong, Billy Barratt, Jonah Wren Phillips', NULL, 'https://www.youtube.com/watch?v=cyGyW15M0hI', 1, 317, '2025-05-30 00:00:00');
